INSERT INTO news VALUES("12","OOEBV-wieder-Bundesnachwuchsleistungszentrum","OÖBV wieder Bundesnachwuchsleistungszentrum","0","Nachwuchs||Top-News||","<h2>OÖBV wieder Bundesnachwuchsleistungszentrum</h2><p><img src=\"/content/news/OOEBV-wieder-Bundesnachwuchsleistungszentrum/5b85561ba0ecf.png\" style=\"width: 300px;\" class=\"fr-fic fr-fil fr-dii\"></p><p><strong>OÖBV hat wieder den Status eines </strong><br><strong>Bundesnachwuchsleistungszentrum</strong><br><strong>ÖBV-Bundesnachwuchleistungszentrum – Nord</strong></p><p>Der ÖBV-Leistungssportausschuss hat auf Grund der erfolgreichen <br>Entwicklungsarbeit im OÖBV-Nachwuchsleistungssport insbesondere<br> im letzten Jahr den Antrag bzgl. der Titelvergabe ÖBV-<br>Bundesnachwuchsleistungszentrum Nord am Standort Linz <br>zugestimmt. INSERT INTO news VALUES("13","Hobbynachwuchsturnier-in-Altmuenster","Hobbynachwuchsturnier in Altmünster","0","Nachwuchs||Top-News||","<h2>Hobbynachwuchsturnier in Altmünster</h2><p><img src=\"/content/news/Hobbynachwuchsturnier-in-Altmuenster/5b8556fc07fd9.png\" style=\"width: 300px;\" class=\"fr-fic fr-fil fr-dii\"></p><p><strong>19 Teilnehmer/-innen aus 6 Vereinen fanden den </strong><br><strong>Weg nach Altmünster zum heurigen Hobbynachwuchsturnier. </strong><br><strong>Auch heuer war die Austragung vorerst wieder fraglich. </strong><br><strong>Erst nach Urgenzen kam die notwendige Teilnehmerzahl </strong><br><strong>zustande, wobei ATV-Andorf maßgeblich dazu beitrug </strong><br><strong>(5 Teilnehmer/innen), dass doch ein ausgeglichenes </strong><br><strong>Turnier zustande kam. Erfreulich war, dass nicht nur Betreuer </strong><br><strong>sondern auch Familien der Spieler/innen mitgekommen waren.</strong></p><p><br></p><p>Leider konnte kein U13 Bewerb bei den Mädchen gespielt werden. Das einzige U11 Mädchen<br> (Mayer Babette; Sportunion Altmünster) spielte deshalb bei den U15 Mädchen, wobei sie sich<br> einen beachtlichen 2. Platz erkämpfte.</p><p>Für sehr viele Teilnehmer/innen war es wieder die erste Turniererfahrung, was ja auch Sinn <br>der Veranstaltung sein soll.</p><p>Eric Hayböck (BC-Windischgarsten) spielte 2 Altersklassen höher und siegte auch auch dort nach spannenden <br>Matches in der U15 Klasse. Weitere Platzierungen in U15: 2.Pl. Florian Höller (Sport-Union Altmünster); <br>3.Pl. Noah Putz (Sport-Union Altmünster); 4.Pl. Kaltenbrunner Moritz (Union Ohlsdorf)</p><p>Bei den U11 DE siegte die schon etwas spielerfahrene Dalila Sekeric (Sportunion Altmünster). <br>Weitere Platzierungen: 2.Pl. Dana-Lynn Grafinger (Union Urfahr); 3.Pl. Jasmin Eder (ATV-Andorf);</p><p>Bei den U11 HE dominierte ganz klar Alexander Puschl aus Ohlsdorf. <br>Weitere Platzierungen: 2.Pl. Florian Kreiseder ebenfalls aus Ohlsdorf; <br>3.Pl. Max Baumgartner (BC-70 Linz); 4.Pl. Richard Feitzlmayr (ATV Andorf) 5.Pl. Felix Kirchberger (ATV-Andorf)</p><p>Bei den U13 HE konnte sich Neueinsteiger Höller Andreas (Sport-Union Altmünster) den 1. Platz sichern. <br>Weitere Platzierungen : 2.Pl. Felix Neuhuber (Sport-Union Altmünster); 3.Pl. Bachmayer Tobias (ATV-Andorf)</p><p>Bei den U15 DE siegte ebenfalls Hanna Neuhuber (Sport-Union Altmünster), ebenfalls Neueinsteigerin. <br>Weitere Platzierungen: 2.Pl. Babette Mayer (Sport-Union Atmünster); <br>3.Pl. Marlene Stein (Sport-Union Altmünster); 4.Pl. Viktoria Feitzlmayr (ATV-Andorf)</p><p><em>Zum Abschluss des Turniers gab es auch noch eine Tombola.<br>Auf Grund der sommerlichen Temperaturen wurden alle Spieler/innen mit einem Eis belohnt.</em></p><p><strong>[Bericht: Peter Kickinger]</strong></p>","2018-05-30","/content/news/Hobbynachwuchsturnier-in-Altmuenster/5b8556fc07fd9.png","16");
INSERT INTO news VALUES("14","Mit-neuem-Schwung-in-die-Saison-2018-19","Mit neuem Schwung in die Saison 2018-19","0","Nachwuchs||Top-News||","<h2>Mit neuem Schwung in die Saison 2018-19</h2><p><img src=\"/content/news/Mit-neuem-Schwung-in-die-Saison-2018-19/5b8557d50d4dc.png\" style=\"width: 300px;\" class=\"fr-fic fr-fil fr-dii\"></p><p><strong>Der Präsident des OÖBV Kons. Herbert Koch mit seinem </strong><br><strong>Statement zur Saison 2018-19:</strong></p><p><strong>Die Vorbereitungen auf die Saison 2018-19 sind weitgehend </strong><br><strong>abgeschlossen. Die Auslosungen für die Mannschaftsmeisterschaften, </strong><br><strong>von der Bundesliga bis zur 2.Klasse, stehen fest und sind auf </strong><br><strong>der Tournament-Software eingearbeitet. Der Terminplan für die österr.-</strong><br><strong> und oberösterreichischen Turniere ist ebenfalls veröffentlicht.</strong></p><p>Termingerecht haben fast alle Vereine die Ranglisten für die einzelnen <br>Mannschaften abgegeben. Die administrative Vorbereitung auf die <br>kommende Saison wurde, wie in den letzten Jahren, von unserer Schriftführerin Karin Burger tadellos erledigt. Auch die <br>Melde-Disziplin der Vereine hat sich wieder deutlich verbessert. Der im Mai neugewählte Verbandsvorstand hat seine erste<br>Bewährungsprobe hinter sich. Ich möchte mich bei allen Beteiligten für den Einsatz herzlich bedanken.</p><p>In einigen Wochen geht es dann so richtig los. Am 12. September startet die O.Ö. Mannschaftsmeisterschaft. Bereits<br> am 8. und 9. September finden die Bundesmeisterschaften der Dachverbände statt. Unser Bundesland ist in den beiden <br>Bundesligen, die am 6.10.2018 starten, heuer mit 4 von 12 Mannschaften vertreten. Spannende Auseinandersetzungen <br>sind dabei in beiden Ligen zu erwarten. Die zahlreichen Lokalderbys haben dabei einen besonderen Reiz. Wir können <br>gespannt sein, wie sich die Meisterschaften in den div. O.Ö. Ligen entwickeln. Vielleicht gelingt es einer Mannschaft <br>den Aufstieg in die Bundesliga zu schaffen.</p><p>Ein Teil unserer BORG-Sportler ist gerade dabei, sich gemeinsam mit den Tischtennis – SportlerInnen des O.Ö. Kaders <br>auf einem Trainingslager in China, in Begleitung des Landestrainers Peter Zauner, auf die Saison vorzubereiten. <br>Bereits im August wurde in der Landessportschule in Linz ein Trainingskurs für den Nachwuchs und teilweise der <br>allgemeinen Klasse abgehalten. Die neu gestaltete Landessportschule hat dabei eine besondere Motivation bei <br>den Beteiligten ausgelöst.</p><p>Der in der letzten Saison gegründete Nachwuchsarbeitskreis hat ein umfangreiches Trainings- und Turnierprogramm <br>entwickelt. Einige neue Funktionäre haben in der Diskussion um den Nachwuchs neue Ideen eingebracht. <br>Das Gemeinsame wird deutlich mehr in den Vordergrund gestellt.</p><p>Ich bin überzeugt, dass die Basis für eine spannende und interessante Saison geschaffen ist. Unsere Sportlerinnen <br>und Sportler können sich auf eine faire und hoffentlich verletzungsfreie Saison, mit vielen Terminen für sportliche <br>Auseinandersetzungen freuen.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-08-28","/content/news/Mit-neuem-Schwung-in-die-Saison-2018-19/5b8557d50d4dc.png","6");
INSERT INTO news VALUES("73","Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018","Trainingstagebuch – Jinan, Provinz Shandong China 2018","0","International||Nachwuchs||Top-News||","<h2>Trainingstagebuch – Jinan, Provinz Shandong China 2018</h2><p><img width=\"317\" src=\"/content/news/Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018/5b8715b8f17cf.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_1954.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1954-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1954-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" style=\"width: 317px; height: 180px;\"></p><p><strong>Oberösterreichs Tischtennis- und Badmintonnachwuchs </strong><br><strong>trainiert bei den besten der Welt in China</strong></p><p><strong>Bereits zum 2. Mal trainieren Oberösterreichs Tischtennis- </strong><br><strong>und Badmintontalente in der chinesischen Millionen-Stadt </strong><br><strong>Jinan (Provinz Shandong). Diese einmalige Chance einer Sportkooperation </strong><br><strong>ergab sich durch die wirtschaftliche Kooperation des Sportland OÖ und der Provinz Shandong.</strong></p><p>Kommentar der beiden Landestrainer Phillipp Aistleitner (Tischtennis) und Peter Zauner (Badminton):</p><p>„<em>Wir sind jetzt schon zum 2. Mal in Jinan. Für uns ist es jeden Tag beeindruckend mit </em><br><em>welcher Professionalität und Einstellung hier gearbeitet wird. Wir versuchen </em><br><em>zusammen mit unseren jungen Talenten die Atmosphäre hier aufzusaugen uns sie so gut es geht im österreichischen Trainingsalltag einzubauen.</em>“</p><p><strong>Trainingstagebuch von Jannik Auberger:</strong></p><p>Die Reise ging am 14.8. um 13:30 Uhr los. Am Anfang der langen Anreise nach China gab es schon Komplikationen wegen eines Koffers, <br>der ohne Besitzer am Flughafen stand. Nach einer kurzen Verzögerung durch die großräumige Absperrung konnten wir uns dann Richtung <br>Gate begeben. Der Flug hob pünktlich ab und die Flugzeit betrug 8h 40 min. Während des Fluges gab es einige kleine Turbulenzen, <br>doch sonst war er sehr angenehm.</p><p>Als wir in China angekommen sind haben wir den Bus genommen Richtung Bahnhof. Wir machten einen kurzen Halt in einem Restaurant <br>und wir nahmen die erste Mahlzeit in China ein. Den Schnellzug nahmen wir um 11:40 und wir fuhren ein bisschen mehr als zwei Stunden.<br>Am Bahnhof in Jinan wurden wir von den Trainern abgeholt und fuhren dann mit dem Bus ins Hotel. Den Rest des Tages haben wir uns ausgeruht, <br>am Abend besichtigten wir dann die Trainingshalle.</p><p>Beim Frühstück gab es traditionelles chinesisches Frühstück. Am Anfang mussten wir uns daran gewöhnen doch inzwischen finden es alles lecker.</p><p>Das Training fing am nächsten Tag um 8:00 Uhr in der Früh an. Das Mittagessen war, wie an jedem Tag, um 12.00 Uhr. Nachdem hatten wir eine <br>Mittagspause, wo wir uns meisten ausgeruht haben und wenn wir nicht gerade eine Pause gemacht haben, gingen wir meistens in die Stadt.</p><p>Im Nachmittagstraining hatten wir bis jetzt zumeist eine Fitnesseinheit.</p><p>Bis jetzt kann man sagen, dass das Trainingslager sehr gelungen ist und natürlich auch überaus anstrengend.</p><p><strong>Programm der ersten Tage:</strong></p><p><strong>Montag:</strong><br>8:15-11:30<br>30 min aufwärmen<br>60min: Krafttraining: 4 Stationen 2er Teams, Kniebeugen, Ausfallschritt, Bizeps, Handgelenk, Bank drücken-am Ende 100 schnelle kurze Wh.<br>30 min. Clear Drop<br>20 min. pro Spieler 1:1 ,4 Ecken über Service Linie, 2. Spieler vorne ganzes Feld<br>10 min Stretching<br>15:00-18:00<br>30 min aufwärmen<br>15 Min. Drive<br>2×15 min. Angriff vs. Verteidigung 1:1<br>40 min. Koordinations-Zirkel<br>10 min Stretching</p><p><strong>Dienstag:</strong><br>8:15-11:30<br>30 min. aufwärmen<br>50 min. Ballmaschine: 5 Runden 4 Übungen mit 20 Bällen: Smash Netz, Verteidigung Zuwurf, China Sprung Li-Re, ganzes Feld<br>50 min. Rallies 1:1<br>10 min. Stretching<br>15:00-18:00<br>30 min. Aufwärmen<br>10 min Einspielen<br>70 min. Match ohne Punkte<br>50 min. Doppelsprünge, 1,2,3 min<br>10 min. Stretching</p><p><strong>Mittwoch</strong><br>8:15-11:30<br>30 min. aufwärmen<br>90 min. Krafttraining 3 Serien, 9 Übungen<br>75 min. Ballmaschine 1 Aufspieler, 1 Übender: kurz, schieben, Angriff , kurz<br>10 min. Stretching<br>15:00-17:30<br>30 min. aufwärmen<br>110 min. Matches 2 Runden<br>10 min. Stretching</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-08-29","/content/news/Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018/5b8715b8f17cf.png","20");
INSERT INTO news VALUES("82","Spannende-Spiele-bei-Schuelerturnier-in-Windischgarsten","Spannende Spiele bei Sch&uuml;lerturnier in Windischgarsten","2","Nachwuchs||","<h2>Spannende Spiele bei Sch&uuml;lerturnier in Windischgarsten</h2><p><a href=\"http://www.badminton-ooe.at/?attachment_id=782\" rel=\"attachment wp-att-782\"><img data-fr-image-pasted=\"true\" title=\"01_ooebv_sch_rlt_2008\" src=\"/content/news/Spannende-Spiele-bei-Schuelerturnier-in-Windischgarsten/5b96b999b1f8e.png\" alt=\"01_ooebv_sch_rlt_2008\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/08/01_ooebv_sch_rlt_2008-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/08/01_ooebv_sch_rlt_2008-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/08/01_ooebv_sch_rlt_2008.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-fil fr-dii\" width=\"159\" height=\"90\"></a>Mit 49 Kindern aus 10 Vereinen war es f&uuml;r die Ventigo Union Windischgarsten als Ausrichter des 1. O&Ouml; U11/U13 Turniers 2008/09 eine gro&szlig;e Herausforderung dieses so gut wie m&ouml;glich &uuml;ber die B&uuml;hne zu bringen. Durch das sehr disziplinierte Verhalten der Kinder und Betreuer war es am Ende ein gelungenes Turnier. Die erfolgreichsten Teilnehmer stellte die Union Ohlsdorf. Als teilnehmerst&auml;rkste Mannschaft angereist erreichten sie zwei Siege, einen Zweiten und zwei Dritte Pl&auml;tze. Besonders die Finale in den U13 Bewerben waren an Dramatik fast nicht zu toppen. So konnte sich Schausberger Michael gegen Kolbeinsson Axel im dritten Satz knapp mit 22:20 durchsetzen. Auch Kruppa Hanna musste in den dritten Satz und bezwang dort ihre Gegnerin Stadler Uli mit 21:18. Bei der Siegerehrung, wo lobenswerter Weise fast alle Vereine noch anwesend waren, bekam jeder Teilnehmer eine Urkunde und einen kleinen Sachpreis. Die Sieger freuten sich &uuml;ber Pokale und etwas gr&ouml;&szlig;ere Sachpreise. Einen gro&szlig;en Dank m&ouml;chte ich meinen Vereinskollegen aussprechen die daf&uuml;r sorgten, dass bei jedem Spiel ein Schiedsrichter auf dem Feld stand, dass Wartezeiten zwischen den Spielen praktisch nicht vorhanden waren und die auch f&uuml;r das leibliche Wohl unserer G&auml;ste immer etwas bereit hatten.</p><p><strong>Die jeweiligen Top 3:</strong></p><p><em>U11 Burschen:</em><br>1. Mittermayr Lukas (BC Alkoven)<br>2. Weigl Johannes (ASK&Ouml; Linz)<br>3. Leko Luka (ABV Wels)<br><em>U11 M&auml;dchen:</em><br>1. Haas Jana (Union Ohlsdorf)<br>2. Turner Lelaina (ASK&Ouml; Traun)<br>3. Peiskammer Lena (Union Ohlsdorf)<br><em>U13 Burschen:</em><br>1. Schausberger Michael (Union Ohlsdorf)<br>2. Kolbeinsson Axel (ASK&Ouml; Linz)<br>3. Benda Philipp (ABV Wels)<br><em>U13 M&auml;dchen:</em><br>1. Kruppa Hanna (Sportunion Altm&uuml;nster)<br>2. Stadler Uli (Union Ohlsdorf)<br>3. Hochmeier Katharina (Union Ohlsdorf)</p>","2008-09-17","/content/news/Spannende-Spiele-bei-Schuelerturnier-in-Windischgarsten/5b96b999b1f8e.png","10");
INSERT INTO news VALUES("83","ASKOE-Bundesmeisterschaften-in-Traun","ASK&Ouml; Bundesmeisterschaften in Traun","2","OEM||","<h2>ASK&Ouml; Bundesmeisterschaften in Traun</h2><p><a href=\"http://www.badminton-ooe.at/?attachment_id=760\" rel=\"attachment wp-att-760\"><img title=\"askoe_bm_2008\" src=\"/content/news/ASKOE-Bundesmeisterschaften-in-Traun/5b96b9dc62ba6.png\" alt=\"askoe_bm_2008\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2008/09/askoe_bm_2008-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2008/09/askoe_bm_2008-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2008/09/askoe_bm_2008.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Ausgezeichnete Erfolge unserer &nbsp;Sportler bei den diesj&auml;hrigen ASK&Ouml; Bundesmeisterschaften in Traun. Vom 06.-07.09.2008 k&auml;mpften 170 Aktive Sportler um den Titel des ASK&Ouml; Bundesmeisters. Traditionell wurden sehr viele Bewerbe von den Teilnehmern des ASK&Ouml; Kellag K&auml;rnten gewonnen. Auch unsere Sportler konnten speziell im Nachwuchsbereich ordentlich abr&auml;umen, und sich &uuml;ber einige Titel freuen. In den einzelnen Altersklassen konnte durch die Neuordnung der Altersklassen ganz gut die Form der Spieler f&uuml;r die neue Saison &uuml;berpr&uuml;ft werden. Von allen Spielern konnten die Leistungen die im Ask&ouml; Nachwuchs Leistungskurs eine Woche vor dem Turnier auf der Gugl in Linz gezeigt wurden best&auml;tigt werden. Auf diesem Weg w&uuml;nsche ich allen Nachwuchssportlern der ASK&Ouml; eine gute Saison 08/09, und gratuliere nochmals zu den ausgezeichneten Plazierungen. Die Masse an Startern stellte eine gro&szlig;e Herausforderung an die Turnierleitung, welche der ASK&Ouml; Traun in Kooperation mit dem BSC 70 Linz und BC Windischgarsten hervorragend meisterte.<br>Die einzelnen Ergebnisse und Raster findet ihr unter: <a href=\"http://www.sportkoch.at\" target=\"_blank\">www.sportkoch.at</a></p>","2008-09-07","/content/news/ASKOE-Bundesmeisterschaften-in-Traun/5b96b9dc62ba6.png","8");
INSERT INTO news VALUES("84","ASKOE-Landesmeisterschaften-2008-in-Windischgarsten","ASKÖ Landesmeisterschaften 2008 in Windischgarsten","2","OOEM||","<h2>ASKÖ Landesmeisterschaften 2008 in Windischgarsten</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=883\" rel=\"attachment wp-att-883\"><img title=\"askoe_lm_2009\" src=\"/content/news/ASKOE-Landesmeisterschaften-2008-in-Windischgarsten/5b96ba2ca4102.png\" alt=\"askoe_lm_2009\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/08/askoe_lm_2009-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/08/askoe_lm_2009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/08/askoe_lm_2009.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Die talentiertesten und hoffnungsvollsten NachwuchsspielerInnen unserer ASKÖ-Vereine traten zum Kräftemessen am 30. 11. 2008 in Windischgarsten an. Nach der Begrüßung durch unseren Präsidenten Fritz Hochmaier konnten wir um 9 Uhr mit den ersten Spielen starten. 60 Teilnehmer sprengten fasst die Kapazitäten des Turnsaales des Veranstalters. Sehr ansprechende Leistungen in allen Bewerben zeigte von großem Einsatz der verantwortlichen Trainer im Nachwuchsbereich bei allen teilnehmenden Vereinen. Durch gekürzte Sätze, große Disziplin aller Teilnehmer und der sehr guten Turnierleitung war es möglich um 18:30 die Sieger der Bewerbe zu küren. Die Firmen Headstart, Wilson und die ansässige Raiffeisenbank haben es ermöglicht, das alle  Preisträger auch Sachpreise erhielten. Ein kleiner Höhepunkt für unsere jüngsten war sicherlich die Verlosung des neuen Babolat Satelite Synchro Rakets, dass die Fa. Sportkoch zur Verfügung stellte. Der Gewinner des Babolat Schlägers hieß Mittermayr Lukas vom BC Alkoven. Viel Freude mit dem Schläger! Besonders erwähnenswert die Spieler, die mit gleich 3 Goldmedaillen ausgezeichnet werden konnten.<br>Dies waren:<br><strong>Gösweiner Christina</strong> (BC Windischgarsten)<br><strong>Aigner Daniel</strong> (BC Windischgarsten)<br><strong>Andrej Servov</strong> (Askö Traun)</p><p>Medaillenspiegel:</p><table border=\"0\"><tbody><tr><td><strong>Verein</strong></td><td><strong>Gold</strong></td><td style=\"width: 22.4575%;\"><strong>Silber</strong></td><td style=\"width: 12.712%;\"><strong>Bronze</strong></td></tr><tr><td>BC Windischgarsten</td><td>8</td><td style=\"width: 22.4575%;\">5</td><td style=\"width: 12.712%;\">6,5</td></tr><tr><td>ASKÖ Traun</td><td>5,5</td><td style=\"width: 22.4575%;\">2</td><td style=\"width: 12.712%;\">3</td></tr><tr><td>ABV Wels</td><td>2,5</td><td style=\"width: 22.4575%;\">4</td><td style=\"width: 12.712%;\">10,5</td></tr><tr><td>BC Alkoven</td><td>2</td><td style=\"width: 22.4575%;\">3,5</td><td style=\"width: 12.712%;\">3,5</td></tr><tr><td>ASKÖ Linz</td><td>–</td><td style=\"width: 22.4575%;\">3,5</td><td style=\"width: 12.712%;\">6,5</td></tr></tbody></table>","2008-11-30","/content/news/ASKOE-Landesmeisterschaften-2008-in-Windischgarsten/5b96ba2ca4102.png","6");
INSERT INTO news VALUES("85","Wiederauflage-des-Finales-Gruber-vs-Kainrath-in-Windischgarsten","Wiederauflage des Finales Gruber vs Kainrath in Windischgarsten","2","OOEBV-RLT||","<h2>Wiederauflage des Finales Gruber vs Kainrath in Windischgarsten</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=871\" rel=\"attachment wp-att-871\"><img title=\"02_öbv_e_rlt_2008\" src=\"/content/news/Wiederauflage-des-Finales-Gruber-vs-Kainrath-in-Windischgarsten/5b96ba58c43b7.png\" alt=\"02_öbv_e_rlt_2008\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2008/12/02_öbv_e_rlt_2008-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2008/12/02_öbv_e_rlt_2008-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2008/12/02_öbv_e_rlt_2008.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Am Sonntag den 14. Dezember fand in Windischgarsten das 2. Oberösterreichische E-RLT statt. Von 21 genannten Sportlern waren schließlich hochmotivierte 19 Spieler von neun verschiedenen Vereinen am Start. Als Sieger ging der für UBC Vorchdorf spielende Bernhard Gruber hervor, der sich in einem über drei Sätze gehenden Finale gegen Christoph Kainrath (BSC 70 Linz) durchsetzten konnte. Interessant dabei: Gruber und Kainrath spielten bereits beim 1. E-RLT der aktuellen Saison in Ohlsdorf ein 3-Satz-Match. Auch damals konnte Bernhard Gruber gewinnen, allerdings fand diese Begegnung bereits in der Vorrunde statt. Im Spiel um Platz 3 konnte sich der für Kremsmünster spielende Paul Zwicklhuber gegen Andi Weilguni (Union Ventigo Windischgarsten) durchsetzten. Ein Dankeschön geht von unserer Seite an die sehr disziplinierten Teilnehmer. Keine einzige w.o. Partie und alle Spieler waren bis zum Ende des Finales und der Siegerehrung in der Halle.</p>","2008-12-15","/content/news/Wiederauflage-des-Finales-Gruber-vs-Kainrath-in-Windischgarsten/5b96ba58c43b7.png","5");
INSERT INTO news VALUES("86","Guten-Rutsch-ins-Neue-Jahr","Guten Rutsch ins Neue Jahr!","2","Verbandsintern||","<h2>Guten Rutsch ins Neue Jahr!</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/PrositNeujahr.jpg\"><img src=\"/content/news/Guten-Rutsch-ins-Neue-Jahr/5b96ba8100b11.png\" alt=\"PrositNeujahr\" title=\"PrositNeujahr\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/PrositNeujahr-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/PrositNeujahr-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/PrositNeujahr.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Der Vorstand des OÖ. Badmintonverbandes wünscht allen SpielerInnen, Vereinsfunktionären, Eltern und treuen Homepagebesuchern einen guten Rutsch ins Neue Jahr und vor allem viel Gesundheit und Erfolg im Jahr 2010. Gleich im Jänner 2010 finden zahlreiche Veranstaltungen statt, wobei die OÖ. Nachwuchslandesmeisterschaften am 23. 1. 2010 in Traun das Highlight des Monats Jänner bedeuten. Anmeldungen sind bis spätestens Samstag, 16. Jänner 2010 an Herbert Koch unter der E-Mail-Adresse <a href=\"mailto:herbert.koch@gmx.at\">herbert.koch@gmx.at</a> zu richten. Mehr Details zu dieser Veranstaltung findet Ihr in der Zentralausschreibung.</p>","2009-12-30","/content/news/Guten-Rutsch-ins-Neue-Jahr/5b96ba8100b11.png","3");
INSERT INTO news VALUES("87","Teilnehmerstarkes-Doppel-Ranglistenturnier-in-Neuhofen","Teilnehmerstarkes Doppel-Ranglistenturnier in Neuhofen","2","OOEBV-RLT||","<h2>Teilnehmerstarkes Doppel-Ranglistenturnier in Neuhofen</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/doppel_rlt_2009_neuhofen.jpg\"><img src=\"/content/news/Teilnehmerstarkes-Doppel-Ranglistenturnier-in-Neuhofen/5b96baa7d718f.png\" alt=\"doppel_rlt_2009_neuhofen\" title=\"doppel_rlt_2009_neuhofen\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/doppel_rlt_2009_neuhofen-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/doppel_rlt_2009_neuhofen-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/doppel_rlt_2009_neuhofen.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Beginnend mit strengstem Morgenfrost, der sich leider auch in unserer Halle, bedingt durch einen Heizungsfehler übertragen hatte, startete das OÖ. Doppel-Ranglistenturnier pünktlich am 20. 12. 2009 um 9.00 Uhr.<br>Eines ist sofort aufgefallen: Es dürfte eines der teilnehmerstärksten Turniere in den letzten Jahren gewesen sein.<br>Es traten wie folgt an:<br>25 Herrendoppel (Sieger: Giel/Giel), 12 Damendoppel (Sieger: Tippelt/Wu) und 28 Mixpaarungen (Sieger: Giel/Wu).<br>Es bedurfte einiges an Arbeit und Vorbereitung seitens des UBC-Neuhofen, diese enorme Menge an Spielern zufrieden zu stellen und es arbeiteten auch viele Vereinsmitglieder dabei mit, besonders auch unsere Buffetdamen, die am Turnierende ziemlich geschlaucht waren, zudem diese ja beim Damendoppelbewerb zwischendurch auch noch teilnahmen. Nun, manchen Teilnehmern dauerte es zu lange um bei der Siegerehrung noch anwesend zu sein, denn das Turnier dauerte bis 18:45 Uhr! Herzlichen Dank an alle Teilnehmer für ihr Verständnis und ihre Ausdauer bei diesem wirklich sehr langen Turniertag, aber es war wieder einmal zu sehen, das diese Arbeit, ein solches Turnier zu veranstalten dem Badmintonsport viel bringt! Herzlichen Dank allen Helfern, die diesen sehr anstrengenden Tag mit ihrem vollen Einsatz zu einer gelungenen Veranstaltung machten.</p>","2009-12-28","/content/news/Teilnehmerstarkes-Doppel-Ranglistenturnier-in-Neuhofen/5b96baa7d718f.png","8");
INSERT INTO news VALUES("88","Erfolgreiches-Bundesliga-Wochenende-fuer-Oberoesterreich","Erfolgreiches Bundesliga-Wochenende für Oberösterreich","2","Bundesliga||","<h2>Erfolgreiches Bundesliga-Wochenende für Oberösterreich</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=2074\" rel=\"attachment wp-att-2074\"><img src=\"/content/news/Erfolgreiches-Bundesliga-Wochenende-fuer-Oberoesterreich/5b96bac7ef854.png\" alt=\"Ardi Putra\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/IMG_94444-134x90.jpg 134w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/IMG_94444.jpg 618w\" sizes=\"(max-width: 134px) 100vw, 134px\" class=\"fr-fic fr-dii fr-fil\" width=\"134\" height=\"90\"></a></p><p>Sowohl in der 1. als auch in der 2. Bundesliga blieben dieses Wochenende alle oberösterreichischen Mannschaften siegreich. ASKÖ Traun kletterte durch einen 6:2 Erfolg gegen ASKÖ Kelag Kärnten auf Tabellenrang 2. Ardi Putra, im Bild zu sehen, steuerte mit seinen Siegen im 1.Herreneinzel und im 2. Herrendoppel 2 Punkte zum Sieg bei.<br>Mit einer geschlossenen Mannschaftsleistung konnte der BSC 70 Linz  gegen den Tabellenführer ASV Pressbaum überraschend hoch mit 8:0 gewinnen. Damit stehen die Linzer nun an 3. Stelle in der Tabelle. Das Rennen um die Playoff-Plätze bleibt somit weiter sehr spannend.<br>Auch in der 2. Bundesliga gab es einen Sieg eines Teams aus Oberösterreich gegen ein Team aus Kärnten. BC Alkoven gewann gegen ASKÖ Kelag Kärnten II mit 5:3 und steht nun in der Tabelle auf Rang 4.<br>Im neuen Jahr startet die Badminton-Bundesliga  wieder am 6. bzw. 8.-10. Jänner.</p>","2009-12-21","/content/news/Erfolgreiches-Bundesliga-Wochenende-fuer-Oberoesterreich/5b96bac7ef854.png","5");
INSERT INTO news VALUES("89","U15-Jugend-RLT-in-Neuhofen","U15-/Jugend-RLT in Neuhofen","2","Nachwuchs||OOEBV-RLT||","<h2>U15-/Jugend-RLT in Neuhofen</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_ooebv_jgd_rlt_2009.jpg\"><img src=\"/content/news/U15-Jugend-RLT-in-Neuhofen/5b96bf7ec2045.png\" alt=\"02_ooebv_jgd_rlt_2009\" title=\"02_ooebv_jgd_rlt_2009\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_ooebv_jgd_rlt_2009-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_ooebv_jgd_rlt_2009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_ooebv_jgd_rlt_2009.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Am 13.12.2009 um 09:00 Uhr wurde mit insgesammt 38 Jugendlichen dieses Turnier gestartet. Seitens des UBC Neuhofen wurde erstmals durch Sponsorenhilfe mit einem LapTop und einer Lautsprecheranlage gearbeitet, was sich anfangs als sehr gewöhnungsbedürftig, aber im Verlauf des Turniers als sehr gutes Instrument bei der Durchführung eines Turniers erwiesen hat. Es gab 4 verschiedene Raster an Bewerben auszuspielen. Wie erwartet setzten sich die Serov Brüder wieder einmal durch, aber die Leistungen in allen Bewerben waren wieder sehr zufriedenstellend. Zum Glück gab es nur 2 Verletzungen, leider aber bei einem teilnehmenden Mädchen der Verdacht eines Seitenbandeinrisses angenommen werden muss, der wir alles Gute und baldige Genesung wünschen. Durch die Disziplin aller Teilnehmer konnte das Turnier um 14:30 beendet werden.</p>","2009-12-20","/content/news/U15-Jugend-RLT-in-Neuhofen/5b96bf7ec2045.png","3");
INSERT INTO news VALUES("90","Andreas-Rabel-feierte-50-Geburtstag","Andreas Rabel feierte 50. Geburtstag","2","Verbandsintern||","<h2>Andreas Rabel feierte 50. Geburtstag</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/andreas_rabl.jpg\"><img src=\"/content/news/Andreas-Rabel-feierte-50-Geburtstag/5b96bfd155109.png\" alt=\"andreas_rabl\" title=\"andreas_rabl\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/andreas_rabl-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/andreas_rabl-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/andreas_rabl.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>1996 wurde der UBC Neuhofen gegründet und sogleich ein Schülerturnier organisiert, bei dem auch die beiden Söhne von Andreas Rabel teilgenommen haben. Ein Jahr später wurde eine eigene Sektion offiziell unter Mitarbeit  von Peter Lindner (er ist auch heute noch dabei) gegründet. Nach der Anmeldung beim OÖBV haben gleich 2 Mannschaften bei der OÖ Mannschaftsmeisterschaft teilgenommen. Heute hat Union Neuhofen gleich 7 Teams im Meisterschaftsbetrieb. Andreas hat für die  Adaptierung der Tennishalle zur Sporthalle unermüdlich gekämpft. Heute steht dem Verein eine Halle mit 8 Spielfeldern zur Verfügung. Seit 1999 arbeitet Andreas Rabel im OÖBV mit. Durch sein Engagement ist es unter anderem gelungen, die teilnehmenden Mannschaften an der OÖMM auf 51 zu erhöhen. Seit der vorletzten Periode ist er Vizepräsident des OÖBV. Der Vorstand des OÖBV hat einstimmig die Verleihung des goldenen Ehrenzeichens an Andreas Rabel beschlossen und die Überreichung anlässlich seiner Geburtstagsfeier vorgenommen. Am 16.12.2009 feierte Andreas Rabel seinen 50. Geburtstag. Wir bedanken uns für die Einladung und  wünschen Andi Rabel persönlich weiterhin alles Gute und freuen uns auf eine gute Zusammenarbeit in den nächsten Jahren.<br>Der OÖBV Vorstand</p>","2009-12-18","/content/news/Andreas-Rabel-feierte-50-Geburtstag/5b96bfd155109.png","3");
INSERT INTO news VALUES("91","Frauenpower-beim-2-U11U13-RLT-in-Andorf","Frauenpower beim 2. U11/U13 RLT in Andorf","2","Nachwuchs||OOEBV-RLT||","<h2>Frauenpower beim 2. U11/U13 RLT in Andorf</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_oebv_rlt_2009_andorf.jpg\"><img src=\"/content/news/Frauenpower-beim-2-U11U13-RLT-in-Andorf/5b96c0443004a.png\" alt=\"02_oebv_rlt_2009_andorf\" title=\"02_oebv_rlt_2009_andorf\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_oebv_rlt_2009_andorf-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_oebv_rlt_2009_andorf-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/02_oebv_rlt_2009_andorf.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Am zweiten Adventsonntag wurde in Andorf das zweite Schülerranglistenturnier in der Kategorie U11/U13 veranstaltet. Nach 62 Nennungen spielten letztendlich 56 Teilnehmer und Teilnehmerinnen aus ganz Oberösterreich um die Plätze in den Altersklassen U11 und U13. Es gab spannende und knappe Spiele, das Brüderpaar Dominik und Luka Leko aus Wels spielte diesmal im Bewerb U13 den Sieger aus, bei den Mädchen siegte atU13-Nationalspielerin Jana Haas. Im Bewerb U11 Burschen siegte Daniel Radlinger, ein neuer Spieler des BC Alkoven, und bei den Mädchen gewann Hanna Raup, ebenfalls eine Spielerin des BC Alkoven. Die erfreuliche Entwicklung, die man schon beim ersten Ranglistenturnier dieser Kategorie feststellen konnte, hielt auch bei diesem Turnier an. Die Mädchen sind auf dem Vormarsch – Frauenpower, die wir beim Badminton brauchen!</p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/DEU11.XLS\" target=\"_blank\">U11 DE Raster</a><br><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/HEU11.XLS\" target=\"_blank\">U11 HE Raster</a><br><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/DEU13.XLS\" target=\"_blank\">U13 DE Raster</a><br><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/HEU13.XLS\" target=\"_blank\">U13 HE Raster</a></p>","2009-12-16","/content/news/Frauenpower-beim-2-U11U13-RLT-in-Andorf/5b96c0443004a.png","4");
INSERT INTO news VALUES("92","Erfolgreiche-Doppelrunde-fuer-BC-Raiffeisen-Alkoven","Erfolgreiche Doppelrunde für BC Raiffeisen Alkoven","2","Bundesliga||","<h2>Erfolgreiche Doppelrunde für BC Raiffeisen Alkoven</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/bundesliga_alkoven_01_2009.jpg\"><img src=\"/content/news/Erfolgreiche-Doppelrunde-fuer-BC-Raiffeisen-Alkoven/5b96c06b48f7d.png\" alt=\"bundesliga_alkoven_01_2009\" title=\"bundesliga_alkoven_01_2009\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/bundesliga_alkoven_01_2009-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/bundesliga_alkoven_01_2009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/bundesliga_alkoven_01_2009.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Der BC Raiffeisen Alkoven absolvierte am Wochenende eine spannende Doppelrunde in der 2. Badminton-Bundesliga. Obwohl der Kader verletzungsbedingt nicht vollständig zur Verfügung stand, erkämpfte das Team um Iris Freimüller einen Sieg und ein Unentschieden. Gegen Racketlon Klosterneuburg sah am Samstag alles bereits nach einem Sieg aus, doch letztendlich mussten sich die Alkovener mit einem Remis zufrieden geben. Iris Freimüller gewann ihr Einzel und zusammen mit ihrer aus der Babypause in das Team zurückgekehrten Schwester Tina auch das Doppel. Auch Thomas Hahn spielte stark und gewann das 1. Einzel und das Doppel mit dem erst 15-jährigen Simon Rebhandl. Im entscheidenden Mixed lief bereits alles für die Alkovener Paarung Tina Freimüller /Simon Rebhandl. Der 1.Satz wurde schnell und klar gewonnen, dann aber schlichen sich einige vermeidbare Fehler ein. Die Niederösterreicher wurden immer stärker und konnten die Partie noch knapp im 3. Satz für sich entscheiden. Am Sonntag war WBH Wien zu Gast. In geänderter Formation sah es vorerst nicht recht rosig aus. Leider gingen alle drei Doppelspiele verloren und die Wiener gingen somit 3:0 in Führung.  Dann aber begann eine furiose Aufholjagd der Alkovener. Thomas Hahn, Lukas und Simon Rebhandl und Iris Freimüller gewannen alle Einzelspiele. Damit hing wieder alles am Mixed. Iris Freimüller/Lukas Rebhandl präsentierten sich von Beginn an stark und ließen der Wiener Paarung keine Chance. Mit den 3 errungenen Punkten liegt der BC Raiffeisen Alkoven nun ein Spiel vor dem Ende der Herbstrunde an 4. Stelle der Tabelle.</p>","2009-12-08","/content/news/Erfolgreiche-Doppelrunde-fuer-BC-Raiffeisen-Alkoven/5b96c06b48f7d.png","5");
INSERT INTO news VALUES("93","Spannende-Bundesligarunde-am-19-und-20-Dezember","Spannende Bundesligarunde am 19. und 20. Dezember","2","Bundesliga||","<h2>Spannende Bundesligarunde am 19. und 20. Dezember</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=1942\" rel=\"attachment wp-att-1942\"><img src=\"/content/news/Spannende-Bundesligarunde-am-19-und-20-Dezember/5b96c08f7aed8.png\" alt=\"_MG_9303\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/MG_9303-147x90.jpg 147w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/MG_9303.jpg 618w\" sizes=\"(max-width: 147px) 100vw, 147px\" class=\"fr-fic fr-dii fr-fil\" width=\"147\" height=\"90\"></a>Kurz vor Weihnachten finden wieder spannende Spiele in der 1. und 2. Badminton-Bundesliga statt. Vor allem in der 1. Bundesliga ist der Kampf um die 4 Play-Off Plätze sehr spannend. Im Duell 3. gegen 2. spielt ASKÖ Traun am Samstag um 16 Uhr gegen ASKÖ Kelag Kärnten und BSC 70 Linz kämpft am Sonntag um 14 Uhr gegen den Tabellenführer ASV Pressbaum.<br>Eine Übersicht mit allen Spielen der 1. und 2. Badminton-Bundesliga am Wochenende finden sie <a href=\"http://www.tournamentsoftware.com/sport/matches.aspx?id=C89038EA-D735-4E25-96D2-369CA896DB0D&d=20091219\">hier.</a></p>","2009-12-05","/content/news/Spannende-Bundesligarunde-am-19-und-20-Dezember/5b96c08f7aed8.png","6");
INSERT INTO news VALUES("94","5-Medaillen-fuer-UBC-Oldies-bei-den-Altersklasse-Meisterschaften","5 Medaillen für UBC Oldies bei den Altersklasse Meisterschaften","2","OEM||","<h2>5 Medaillen für UBC Oldies bei den Altersklasse Meisterschaften</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/ak_ms_2009.jpg\"><img src=\"/content/news/5-Medaillen-fuer-UBC-Oldies-bei-den-Altersklasse-Meisterschaften/5b96c0b374bfa.png\" alt=\"ak_ms_2009\" title=\"ak_ms_2009\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/12/ak_ms_2009-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/ak_ms_2009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/12/ak_ms_2009.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Zweimal Vizestaatsmeister – dreimal Bronze: Die Ausbeute der UBC Oldies Waltraud Kronsteiner und Harald Starl bei den Altersklasse Meisterschaften in Reute kann sich sehen lassen. Als Titelverteidiger ging Harald Starl im Doppel mit Afred Tröstl (Dornbirn) an den Start. Nach dem Dreisatzsieg im Halbfinale gegen die Tiroler Lokalmatadore musste sich das Duo am Weg zur Titelverteidigung gegen die Vorarlberger Lehner / Isopp mit 1: 2 Sätzen im Finale geschlagen geben.</p><p><br></p><p><strong>Einzelsieg knapp verpasst</strong><br>Es will einfach nicht gelingen. Im Herren Einzel 45+ konnte Starl im Semifinale den Favoriten Isopp (Hohenems) knapp mit 21:17, 23:21 besiegen. Im Finale gegen den Wolfurter Lehner endete für den Vorchdorfer glücklos. Im wohl spannendsten Finale der Titelkämpfe verpasse Starl mit 24:22, 14:21, 19:21 den ersten Einzeltitel hauchdünn.</p><p><strong>Kronsteiner’s Comeback</strong><br>Nach ihrer schweren Handverletzung feierte Waltraud Kronsteiner ein erfolgreiches Comeback. Im Doppel scheitere sie mit ihrer Tiroler Partnerin Dorner nur knapp den Finaleinzug. Ihre zweite Bronzemedaille gewann sie im Mixed mit Harald Starl, wo sie gegen die späteren Meister Giesinger / Aberer (Hohenems) ohne Chance waren.</p>","2009-12-01","/content/news/5-Medaillen-fuer-UBC-Oldies-bei-den-Altersklasse-Meisterschaften/5b96c0b374bfa.png","4");
INSERT INTO news VALUES("95","Florian-Baumgartner-ist-3facher-OEsterreichischer-Meister","Florian Baumgartner ist 3facher Österreichischer Meister","2","OEM||","<h2>Florian Baumgartner ist 3facher Österreichischer Meister</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=985\" rel=\"attachment wp-att-985\"><img title=\"baumgartner_3fach_oem\" src=\"/content/news/Florian-Baumgartner-ist-3facher-OEsterreichischer-Meister/5b96c1546c994.png\" alt=\"baumgartner_3fach_oem\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/02/baumgartner_3fach_oem-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/02/baumgartner_3fach_oem-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/02/baumgartner_3fach_oem.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Am vergangenen Wochenende fanden die Österreichischen Meisterschaften der Klassen U17 und U19 in Judenburg statt.Das BLZ Vorchdorf holt 8 Medaillen! Natürlich waren nicht nur die Spielerinnen und Spieler des BLZ Vorchdorf am Start, auch die Schüler des BORG für Leistungssport in Linz konnten Ihre Leistungen zeigen und zum guten Abschneiden des Landesverbandes OÖ beitragen. Klaus Dornig errang mit seinem Partner Christoph Almer im Herren-Doppel U19 eine Bronze-Medaille und Jakob Ostermann und Manuel Dornig im Herrendoppel U17 eine Silbermedaille. Die Österreichischen Meisterschaften U17/19 in Judenburg waren für denTrainingsstützpunkt Vorchdorf erneut ein voller Triumph. Insgesamt acht Medaillen (3 Gold, 1 Silber und 4 Bronze) holten die Athleten nach Oberösterreich. Allein unserem Trainingsstützpunkt ist es zu verdanken, dass der LV Oberösterreich noch den erfreulichen zweiten Platz im Medaillenspiegel erreichen konnte. Florian Baumgartner (Union Ohlsdorf) schaffte mit drei Goldmedaillen in der Altersklasse U17 am Wochenende den Hattrick. Der Ohlsdorfer gewann das Jungeneinzel, mit Partner Thomas Sturm (Union Ohlsdorf) das Doppel und mit Alexandra Mathis das Mixed. Für eine positive Überraschung sorgte Lukas Rebhandl (Ventigo Union Windischgarsten) im Einzel. Der Windischgarstener schlug im Viertelfinale mit dem Wiener Vilson Vattanirappel, den eigentlichen Favoriten im Einzel. Ein erstaunliches Bild gab es am Freitagabend in der toll aufbereiteten Halle. Im Mixed-Halbfinale standen sich ausschließlich auf allen vier Courts BLZ-Vorchdorf-Spieler gegenüber. Der U15-Spieler Simon Rebhandl (Ventigo Union Windischgarsten) zeigte mit einer Silbermedaille im Mixed und einer Bronze-Medaille im Doppel mit seinem Bruder Lukas erneut sein Talent. In der U19 sind wir mit keinen Medaillenanwärtern an den Start gegangen. Somit waren unsere Erwartungen im Vorfeld bereits gedämpft. Unsere einzigen Starter Thomas Wimmer (Union Ohlsdorf) und Günter Kofler (UBC Vorchdorf) mussten sich in den ersten Runden, technisch und taktisch besseren Spielern, klar geschlagen geben. Als Erkenntnis von Judenburg bleibt, dass wir die Altersklasse U17 im Jungenbereich (noch) dominieren. Wollen wir das auch in höheren Altersklassen fortführen, muss der Trainingsumfang weiter gesteigert werden. Andere Landesverbände holen immer weiter auf.<br>Alle Ergebnisse unter <a href=\"http://www.badminton.at\">www.badminton.at</a><br>Manuel Rösler, Sportlicher Leiter Trainingsstützpunkt BLZ Vorchdorf</p>","2009-02-09","/content/news/Florian-Baumgartner-ist-3facher-OEsterreichischer-Meister/5b96c1546c994.png","7");
INSERT INTO news VALUES("96","Top-Ergebnis-bei-52-Staatsmeisterschaften-fuer-Oberoesterreich","Top-Ergebnis bei 52. Staatsmeisterschaften für Oberösterreich","2","OEM||","<h2>Top-Ergebnis bei 52. Staatsmeisterschaften für Oberösterreich</h2><p>                                                                        </p><p><a href=\"http://www.badminton-ooe.at/?attachment_id=797\" rel=\"attachment wp-att-797\"><img title=\"oem_2009\" src=\"/content/news/Top-Ergebnis-bei-52-Staatsmeisterschaften-fuer-Oberoesterreich/5b96c177e5fee.png\" alt=\"oem_2009\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2009/02/oem_2009-159x90.jpg 159w, http://www.badminton-ooe.at/wp-content/uploads/2009/02/oem_2009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2009/02/oem_2009.jpg 618w\" sizes=\"(max-width: 159px) 100vw, 159px\" class=\"fr-fic fr-dii fr-fil\" width=\"159\" height=\"90\"></a>Tolle Bilanz des oberösterreichischen Spitzensports bei den diesjährigen Staatsmeisterschaften. Mit Finalteilnahmen in allen 5 Bewerben und dem Sieg in 3 Bewerben erfüllten die Vertreter des OÖ Leistungsbadminton alle Ansprüche bei weitem. Mit etwas Glück wäre speziell im DD und HD noch die eine oder andere Medaille drinnen gewesen. In der Königsdisziplin, den Einzelbewerben, stellte im HE OÖ mit Lahnsteiner Michael und Zauner Peter ( beide Askö Traun) sogar beide Finalisten. Wobei der Umstand, dass 3 von 4 Semifinalisten aus dem Sport Borg in Linz kamen, die Qualität dieser Einrichtung eindrucksvoll bestätigt. Im Finale konnte sich Zauner Peter doch überraschend sicher gegen Michael Lahnsteiner durchsetzen und sich so zum 2. Mal nach 2006 den Einzelstaatsmeistertitel sichern. Im DE Finale spielte sich Miriam Gruber (Vorchdorf) ungefährdet ins Finale. Mit Mayer Claudia hatte sie es dort mit einer ebenbürtigen Gegnerin zu tun. Leider schlichen sich des Öfteren leichte Fehler speziell im Netzbereich ein und dadurch musste sich Miriam mit dem 2. Platz zufriedengeben. Noch mehr Pech hatte Freimüller Iris (BC Alkoven), die als Favorit im DD mit Partnerin Riedl Tina ebenfalls sicher ins Finale kam. Eine Verletzung von Tina im Semifinale des DD verhinderte ein Antreten im Finale, und so musste der Sieg der Paarung Heber/Baldauf kampflos überlassen werden. Eine Klase für sich war die Paarung Jürgen Koch/Peter Zauner im HD Bewerb. Erst im Finale konnten sie etwas gefordert werden, wobei der Sieg nie gefährdet war. Mit hohem Tempo und sehr variablen Spiel auch in Drucksituationen, kamen ihre Gegner mit ihrem Angriff selten zu einem Punktgewinn. In sehr überzeugender Manier ging dieser Staatsmeistertitel ebenfalls nach OÖ. Überraschend war das Erreichen des Finales im Mixed Doppel von Jürgen Koch/Zhou Niannian. Überraschend deshalb da Zhou meist nur einmal die Woche trainieren kann. Eng war es bis zur Mitte des ersten Satzes, danach konnte das Spiel aber immer mit 3 bis 4 Punkten Vorsprung kontrolliert werden. Mit diesem Titelgewinn gingen 3 von 5 Staatsmeistertiteln nach OÖ.</p><p><strong>Ergebnisse aus OÖ Sicht:</strong></p><p>HE<br>1. Zauner Peter<br>2. Lahnsteiner Michael</p><p>DE<br>2. Miriam Gruber</p><p>HD:<br>1. Koch Jürgen/Zauner Peter</p><p>DD:<br>2. Iris Freimüller/Tina Riedl</p><p>Mixed:<br>1. Koch Jürgen/Zhou Niannian</p><p><em>Medaillenverteilung in OÖ</em><br>Askö Traun (3x Gold, 1x Silber)<br>BC Alkoven (0,5x Silber)<br>Union Vorchdorf (1x Silber)</p>","2009-02-01","/content/news/Top-Ergebnis-bei-52-Staatsmeisterschaften-fuer-Oberoesterreich/5b96c177e5fee.png","4");
INSERT INTO news VALUES("924","Achtung-OEsterr-Meisterschaften-U13U15-nun-doch-in-Sporthalle-Haid","Achtung! Österr. Meisterschaften U13/U15 nun doch in Sporthalle Haid!!!","2","Nachwuchs||OEM||Top-News||","<h2>Achtung! Österr. Meisterschaften U13/U15 nun doch in Sporthalle Haid!!!</h2><p>                <img src=\"/content/news/Achtung-OEsterr-Meisterschaften-U13U15-nun-doch-in-Sporthalle-Haid/5ba2a37e23249.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\" width=\"135\" height=\"180\">                                                        </p><p><strong>ACHTUNG! WICHTIGE MELDUNG!</strong></p><p><strong> </strong></p><p><strong>Die Österr. Meisterschaften U13/U15 können nun doch am kommenden Wochenende in der – ursprünglich ausgeschriebenen – </strong></p><strong> <p>Sporthalle Haid / Walter-Wimmer-Halle (Dr. Adolf-Schärf-Straße 23, 4053 Haid) </p> </strong><p></p><p><strong>durchgeführt werden! Die Reparaturarbeiten konnten rechtzeitig fertiggestellt werden.</strong></p>","2017-11-15","/content/news/Achtung-OEsterr-Meisterschaften-U13U15-nun-doch-in-Sporthalle-Haid/5ba2a37e23249.png","3");
INSERT INTO news VALUES("925","Regio-Lehrgang-Nord-Neuhofen","Regio Lehrgang Nord Neuhofen","2","Nachwuchs||Top-News||","<h2>Regio Lehrgang Nord Neuhofen</h2><p>                <img src=\"/content/news/Regio-Lehrgang-Nord-Neuhofen/5ba2a3e8283e2.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Talentprojekt-320x180.jpg 320w, http://www.badminton-ooe.at/wp-content/uploads/Talentprojekt-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Talentprojekt.jpg 485w\" sizes=\"(max-width: 320px) 100vw, 320px\" class=\"fr-fic fr-dii fr-fil\" width=\"320\" height=\"180\">                                                        </p><p><strong>OÖBV und SBV veranstalten Ende November einen Regio Lehrgang Nord in Neuhofen. Trainiert wird in bis zu drei Gruppen für junge Spieler/innen ab Jahrgang 2007. Alle Informationen dazu nachfolgend.</strong></p><p><strong> </strong></p><p><strong>Nächste Regio-Trainingsmaßnahme </strong></p><p>Termin: Samstag, 25.11.2017, von 13:00 bis 17:30<br>Treffpunkt: 12:30 Halle<br>Ort: Sporthalle Neuhofen an der Krems, Sportallee 60, 4501 Neuhofen<br>Betreuer: Peter Zauner – Landestrainer OÖBV<br>Daniel Walchshofer – Co-Trainer  </p><p>Anmeldung: Wir bitten um Voranmeldung bis 20.11.2017 an: <a href=\"mailto:ooe-badmintonverband@aon.at\"><em><strong>ooe-badmintonverband@aon.at</strong></em></a></p><p>Mitbringen: Badmintonausrüstung, Sportgewand, Hallenschuhe, Getränk und Jause, etc.<br>Heimtrainer: Auch HeimtrainerInnen sind herzlich eingeladen, teilzunehmen!</p><p>Weitere Regio-Trainingsmaßnahmen Samstag, 30.12.2017 – Ohlsdorf </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2017-11-10","/content/news/Regio-Lehrgang-Nord-Neuhofen/5ba2a3e8283e2.png","5");
INSERT INTO news VALUES("926","2-OOEBV-Doppel-RLT-MD-2","2. OÖBV Doppel-RLT (MD)","2","OOEBV-RLT||Top-News||","<h2>2. OÖBV Doppel-RLT (MD)</h2><p>                <img src=\"/content/news/2-OOEBV-Doppel-RLT-MD/5ba2a412110d8.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_2_OÖBV_Doppel-RLT_05.11.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_2_OÖBV_Doppel-RLT_05.11-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_2_OÖBV_Doppel-RLT_05.11-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>2. OÖBV Doppel-RLT (MD) von Haid nach Vorchdorf verlegt</strong></p><p><strong> </strong></p><p><strong>Am Sonntag den 5. November sollte abermals die Sporthalle Haid der Austragungsort für eines der OÖBV-Doppel-Turnier-Serie sein. Ein Sturmschaden am Hallendach der Sporthalle Haid verursachte eine kleine Panik beim Veranstalter, doch mit der Zusage von Harald Starl das man die Sporthalle Vorchdorf für diesen Event benützen kann entspannte sich sofort die Lage. Durch die rasche Ausschreibung des neuen Austragungsortes seitens des OÖBV und der sofortigen Umstellung in der TA sowie in der TA-App waren alle Teilnehmer/Innen informiert und alles war wieder im Lot.</strong></p><p>Unter den 50 Teilnehmer/Innen aus 18 verschiedenen Vereinen waren einige neue Gesichter zu entdecken die sich für diesen Event begeistern konnten, die Qualität sowie die Wertigkeit dieser Turnier-Serie ist sehr gut. 25 Mixed-Doppel lieferten sich auf 5 Spielfeldern spannende und zum Glück auch verletzungsfreie Spiele.<br>Das Turnier startete eine Stunde später als üblich um 11:00 Uhr und wurde mit der Siegerehrung um 18:00 Uhr beendet. Das Motto für die Begrüßung war „Süßes“ und alle Spieler/Innen bekamen ein Duplo zum Turnierstart und das Motto für die Siegerpreise vom ASK Nettingsdorf-Badminton/Racketlon war „Wein“ darum bekamen die ersten drei Doppelpaarungen jeweils eine Flasche Rose mit Giotto verziert sowie die viertplatzierten einen kleinen Glückwünsch in Milka-Form.</p><p>Anbei die Auflistung der besten vier Paarungen, alles andere ist in der <a href=\"http://www.tournamentsoftware.com/sport/tournament.aspx?id=17374B98-C9F4-49B7-912A-DE54F84319CB\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p>Mixed-Doppel:<br>1. Platz Kornelia Steidl / Ralf Stiglbauer<br>2. Platz Lisa Dober / Christian Adler<br>3. Platz Denise Sendlhofer / Christoph Hajek<br>4. Platz Sun Pei / Gyula Szöke</p><p>Man kann eine gute Turnierstimmung nicht mit Worten übermitteln diese muss man selbst spüren, darum erteilt der ASK Nettingsdorf-Badminton/Racketlon (Die SMILEY-Schlägertruppe) den Auftrag an alle Turnierteilnehmer/Innen diese Doppel-Turnier-Serie euren Vereinskollegen/Innen nahe zu bringen, den Turnier spielen ist das beste Training.</p><p>Ein herzliches und großes DANKE, an alle Teilnehmer/Innen sowie an meine Helferleins Roswitha, Kerstin, Günter, Klaus und Josef vom ASK Nettingsdorf-Badminton/Racketlon für den guten Turnierablauf.</p><p>Das 3. OÖBV-Doppel-RLT wird am Sonntag den 7. Jänner 2018 in Laakirchen ausgetragen, damit sich die guten und feinen Weihnachtskeks-Kilos wieder in Muskelmasse verwandeln. Die „TA“ sowie die TA-App ist für euch schon aktiv geschaltet und erwartet eure Anmeldungen.</p><p><strong>[Bericht: Peter Krenmayr]</strong></p>","2017-11-07","/content/news/2-OOEBV-Doppel-RLT-MD/5ba2a412110d8.png","4");
INSERT INTO news VALUES("927","2-OOEBV-Doppel-RLT-3","2. OÖBV Doppel RLT","2","OOEBV-RLT||","<h2>2. OÖBV Doppel RLT</h2><p>                <img src=\"/content/news/2-OOEBV-Doppel-RLT/5ba2a431728a2.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Achtung.png 485w, http://www.badminton-ooe.at/wp-content/uploads/Achtung-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/Achtung-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Achtung! Aufgrund des Sturms am Wochenende, bei der das Hallendach der Sporthalle Haid beschädigt wurde, findet das 2. OÖBV Doppel RLT in der Sporthalle in Vorchdorf statt. </strong></p><p>Adresse: Kapellenweg 5, 4655 Vorchdorf.<br>Auslosung: 10:30<br>Beginn: 11:00</p><p>[Bericht: Redaktion – Lukas Rebhandl]</p>","2017-11-02","/content/news/2-OOEBV-Doppel-RLT/5ba2a431728a2.png","12");
INSERT INTO news VALUES("928","1-OEBV-A-RLT-2018","1. ÖBV A-RLT 2018","2","OEBV-RLT||Top-News||","<h2>1. ÖBV A-RLT 2018</h2><p>                <img src=\"/content/news/1-OEBV-A-RLT-2018/5ba2a44e95c8d.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG-20180129-WA0009.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG-20180129-WA0009-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG-20180129-WA0009-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Das erste A-Turnier der Saison 2018 war ein erfolgreiches für die Spieler/innen aus Oberösterreich. Beim Turnier kurz vor den Staatsmeisterschaften konnten sich vor allem Katharina Hochmeir und Markus Ratzenböck in Szene setzen. </strong></p><p>Katharina Hochmeir sicherte sich im Dameneinzel den zweiten Platz hinter Titelverteidigerin Jenny Ertl. Und auch im Damendoppel konnte sie einen Podestplatz verbuchen. Es wurde der dritte Platz mit Partnerin Carina Meinke. Ebenfalls dritter wurde Markus Ratzenböck. Er führt eine starke Leistung der OÖ-Spieler an – nicht weniger als 6 Spieler fanden sich in den Top 13 wieder. </p><p>Damit sollte es für die Staatsmeisterschaften zumindest Außenseiterchancen auf eine Medaille geben. Gerade das hohe Niveau auf dem sich zur Zeit mehrere Spieler befinden könnte uns noch schöne Momente bescheren. </p><p>Alle Ergebnisse auf <a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=27F9DCBC-8CF6-419C-948D-75A21B2F9B6E\"><em><strong>Tournamentsoftware</strong></em></a></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-29","/content/news/1-OEBV-A-RLT-2018/5ba2a44e95c8d.png","10");
INSERT INTO news VALUES("929","Bericht-zum-U11U13-Turnier-in-Ohlsdorf-am-2712018","Bericht zum U11/U13 Turnier in Ohlsdorf am 27.1.2018","2","OOEBV-RLT||Top-News||","<h2>Bericht zum U11/U13 Turnier in Ohlsdorf am 27.1.2018</h2><p>                <img src=\"/content/news/Bericht-zum-U11U13-Turnier-in-Ohlsdorf-am-2712018/5ba2a48a5a392.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OhlsdorfJänner.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/OhlsdorfJänner-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/OhlsdorfJänner-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am 27. Jänner fand in Ohlsdorf das erste OÖBV-U11/U13 Ranglisten-Turnier der neuen Saison in Ohlsdorf statt. Leider fanden sich nur 17 Teilnehmer, die dafür allerdings schon ihr teilweise (großes) Können aufblitzen ließen. Speziell die Finalspiele konnten sich durchaus sehen lassen. Erfreulich war auch das Zustandekommen des U11 Turniers bei den Burschen, bei dem sich der Favorit Eric Hayböck aus Windischgarsten keine Blöße gab und das Turnier vor den beiden Ohlsdorfern Alexander Puschl und Florian Kreiseder für sich entschied.</strong></p><p>Für den  Damen U11 Bewerb hatten sich leider nur 2 Mädchen angemeldet, sodass diese im U13 Bewerb mitspielen mussten. Dort war es natürlich denkbar schwer für diese beiden Mädchen, die sich allerdings tapfer schlugen. Im direkten Spiel konnte sich dann Xenia Frühauf (BC Alkoven) den U11 Titel vor Dalila Serecicc (Union Altmünster) sichern.<br>Im sehr stark besetzten Damen U13 Bewerb, bei dem immerhin 3 Spielerinnen des österreichischen Talentekaders spielten, konnte sich Sarah Dlapka (Union Ohlsdorf) im Finale gegen ihre Vereinskollegin Hanna Gillesberger durchsetzen. Dritte wurde in diesem Bewerb Raffaela Frühauf. Aber auch die Viertplatzierte Emma Groiss (Union Kirchdorf) zeigte bei einigen Ballwechseln ihr Können.<br>Im mit 7 Spielern besetzten U13 Bewerb der Herren konnte sich Sebastian Huber (Union Ohlsdorf) im Finale gegen seinen Vereinskollegen Lorenz Windauer behaupten. In diesem  3-Satz-Match wurde den Zuschauern schon sehr sehenswertes Badminton geboten. Den dritten Platz sicherte sich in diesem Bewerb Niklas Fichter (BC Windischgarsten), der in einem spannenden und guten Spiel Benjamin Maier (BC Alkoven) die Stirn bot.<br>Bei der Siegerehrung bekamen alle Spielerinnen und Spieler nicht nur ihre wohlverdienten Pokale, sondern als netten Abschluss auch noch einen Muffin mit auf den Weg, den sich alle redlich verdient hatten.<br>Ein großes Kompliment geht auch noch an die Turnierorganisation, die das Turnier fehlerfrei und zügig durchzog. Vielen Dank dafür!</p><p><strong>[Bericht: Stephan Dlapka – Union Ohlsdorf]</strong></p>","2018-01-29","/content/news/Bericht-zum-U11U13-Turnier-in-Ohlsdorf-am-2712018/5ba2a48a5a392.png","3");
INSERT INTO news VALUES("930","1-OEsterr-Jugendranglistenturnier-2018","1. Österr. Jugendranglistenturnier 2018","2","OEBV-RLT||Top-News||","<h2>1. Österr. Jugendranglistenturnier 2018</h2><p>                <img src=\"/content/news/1-OEsterr-Jugendranglistenturnier-2018/5ba2a4a630a87.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/1.-OÖ-RLT-2018-WRNDF.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/1.-OÖ-RLT-2018-WRNDF-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/1.-OÖ-RLT-2018-WRNDF-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am vergangenen Wochenende traf sich die Elite der U19-Spieler/innen in Wiener Neustadt, um ihre Klasse unter beweisen zu stellen. Oberösterreich war mit 13 Teilnehmern wieder stark aufgestellt und konnte einige gute Platzierungen erreichen.</strong></p><p>Aufgrund der Verschiebung der Beginnzeit am Samstag auf 12 Uhr konnten wir am Freitagabend noch einige gemütliche und lustige Stunden im Hotel verbringen und uns gut auf die bevorstehenden Matches vorbereiten. Da nicht viele Betreuer mitgereist waren, unterstützten, coachten und motivierten sich die jungen Spieler/innen gegenseitig, sodass keiner alleine am Feld stand – großes Lob!<br>Den einzigen Podestplatz an diesem Wochenende erkämpften sich Jan-Matteo Brüggenwerth und Eva Rebhandl. Sie erreichten im Mixed den 3. Rang.<br><strong><br> Jan-Matteo Brüggenwerth:</strong><br>„<em>Die herausragende Gruppendynamik und die angenehme Atmosphäre zwischen Spielern und Betreuern war Grundlage für ein selbstbewusstes Auftreten auf dem Platz und den damit verbundenen Erfolgen jedes einzelnen Spieler, welche ihre Ziele größtenteils erreichen, wenn nicht sogar verbessern konnten.</em>“</p><p><strong>[Bericht: Eva Rebhandl – Union Windischgarsten]</strong></p>","2018-01-29","/content/news/1-OEsterr-Jugendranglistenturnier-2018/5ba2a4a630a87.png","8");
INSERT INTO news VALUES("931","1-OEBV-B-RLT-2018","1. ÖBV-B-RLT 2018","2","OEBV-RLT||Top-News||","<h2>1. ÖBV-B-RLT 2018</h2><p>                <img src=\"/content/news/1-OEBV-B-RLT-2018/5ba2a4bd5010d.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/k-DSCF5862-777x437.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/k-DSCF5862-777x437-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/k-DSCF5862-777x437-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Sehr erfolgreich verlief das 1. ÖBV-B-RLT 2018 für die Teilnehmer aus Oberösterreich. 4 der 5 Bewerbe konnten von OÖ-Spielern gewonnen werden. Das Herreneinzel entschied Luca Froschauer (Askö Traun) für sich. Ebenfalls den Sieg holte Vereinskollegin Lena Zinganell im Dameneinzel. Sie konnte sich gemeinsam mit Laura Hauser das Damendoppel und mit Harald Koch das Mixed gewinnen. Sie blieb also im gesamten Turnier ungeschlagen. Die weiteren Podestplätze konnten im Mixeddoppel Luca Froschauer/Laura Hauser und Alexander Hammerer/Nadine Reiter erzielt werden. </strong></p><p>Alle Ergebnisse zum Nachlesen auf <a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=B0F3943B-47DF-4F1A-B52D-78047796AB85\"><em><strong>Tournamentsoftware</strong></em></a></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-23","/content/news/1-OEBV-B-RLT-2018/5ba2a4bd5010d.png","4");
INSERT INTO news VALUES("932","OEsterreichisches-Ranglistenturnier-U13-und-U15-in-Weiz","Österreichisches Ranglistenturnier U13 und U15 in Weiz","2","Nachwuchs||OEBV-RLT||Top-News||","<h2>Österreichisches Ranglistenturnier U13 und U15 in Weiz</h2><p>                <img src=\"/content/news/OEsterreichisches-Ranglistenturnier-U13-und-U15-in-Weiz/5ba2a4e4f310a.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_20180121_144208_HDR1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180121_144208_HDR1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180121_144208_HDR1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am 20./21. Jänner 2018 fand das erste österreichische Ranglistenturnier der U13 und U15 Spielerinnen und Spieler in Weiz statt.<br> Dabei starteten 58 Spielerinnen und Spieler aus ganz Österreich in 10 Bewerben, zum ersten Mal nach der Anpassung der Altersstufen an das internationale System.<br> Aus Oberösterreich nahmen an diesem Turnier 18 Teilnehmer aus 4 Vereinen teil, die sich in einigen spannenden Spielen gegen die gute österreichische Konkurrenz teilweise sehr gut in Szene setzen konnten.</strong></p><p>So gab es folgende Podestplätze der oberösterreichischen Teilnehmer:</p><p>HD U13: 3.Platz durch Lorenz Windauer und Sebastian Huber (beide Sportunion Ohlsdorf)<br>DD U13: 1.Platz durch Sarah Dlapka (Sportunion Ohlsdorf) und ihre Partnerin aus Vorarlberg<br>DD U13: 2.Platz durch Hanna Gillesberger (Sportunion Ohlsdorf) und Raffaela Frühauf (BC Alkoven)<br>DD U13: 3.Platz durch Emma Manjic (BC Alkoven) und ihre Partnerin aus der Steiermark<br>DD U15: 2.Platz durch Anita Fobian und Lara Stockinger (beide Askö Traun)<br>DD U15: 3.Platz durch Ronja Auberger (Askö Traun) und Tabea Stierberger (BC Alkoven)<br>MD U15: 3Platz durch Tabea Stierberger (BC Alkoven) und ihren Partner aus der Steiermark<br>DE U13: 2.Platz durch Sarah Dlapka (Sportunion Ohlsdorf)<br>DE U15: 3.Platz durch Kira Dlapka (Sportunion Ohlsdorf)</p><p>Es scheint fast so, dass die momentane Stärke in Oberösterreich in den Doppelbewerben liegt.<br>Unbedingt ist auch das tolle Miteinander zu erwähnen, dass momentan unter den oberösterreichischen Vereinen herrscht. Demzufolge verbrachten die Spielerinnen und Spieler und ihre Betreuer auch außerhalb der Sporthalle eine sehr nette und gemütliche Zeit miteinander bei der abendlichen Analyse im Hotel, in dem alle oberösterreichischen Vereine gemeinsam untergebracht waren.</p><p><strong>[Bericht: Stephan Dlapka (Union Ohlsdorf)]</strong></p>","2018-01-23","/content/news/OEsterreichisches-Ranglistenturnier-U13-und-U15-in-Weiz/5ba2a4e4f310a.png","9");
INSERT INTO news VALUES("933","OOE-Landesmeisterschaft-nbspDrei-Titel-fuer-Katharina-Hochmeir","OÖ. Landesmeisterschaft  Drei Titel für Katharina Hochmeir","2","OOEM||Top-News||","<h2>OÖ. Landesmeisterschaft  Drei Titel für Katharina Hochmeir</h2><p>                <img src=\"/content/news/OOE-Landesmeisterschaft-nbspDrei-Titel-fuer-Katharina-Hochmeir/5ba2a4ff85e99.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/lm18.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/lm18-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/lm18-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Oberösterreichs beste Badmintonspieler und –spielerinnen ermittelten am Wochenende in Vorchdorf ihre neuen Landesmeister und Landesmeisterinnen: Katharina Hochmeir gewann drei Titel.</strong></p><p>Im Herren Einzel konnte sich Titelfavorit Lukas Rebhandl (UNION Windischgarsten) im Finale gegen Lokalmatador Dominik Kronsteiner in zwei Sätzen durchsetzen. Ohne Satzverlust blieb Titelverteidigerin Katharina Hochmeir (UNION Ohlsdorf) im Dameneinzel – sie siegte ebenfalls in zwei Sätzen gegen ihre Teamkollegin Jana Haas.<br>.</p><p><em>Foto: Die Sieger im Herreneinzel: v.l.n.r.: Dominik Kronsteiner, Lukas Rebhandl, Michael Schausberger und Andrej Serov.</em></p><p>Knapp in drei Sätzen konnte sich Rekordlandesmeister Jürgen Koch mit Alexander Serov (ASKÖ Traun) gegen die Titelverteidiger Simon und Lukas Rebhandl (UNION Windischgarsten) durchsetzen. In souveräner Manier sicherte sich Katharina Hochmeir mit Nadine Reiter (UNION Ohlsdorf) durch einen 2 : 0 Finalerfolg über Laura Hauser / Lena Zinganell (ASKÖ Traun) ihren zweiten Titel. </p><p>Etwas überraschend kam für Katharina Hochmeir der dritte Titel im Mixed. Mit ihrem Partner Andrej Serov siegte sie im Vereinsduell gegen Michael Schausberger / Nadine Reiter in drei Sätzen. </p><p>Alle Ergebnisse sind online auf <a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=2D24F8A6-8F5D-460E-8DB2-3BED6E2A7AAD\"><em><strong>Tournamentsoftware</strong></em></a> einzusehen. </p><p><strong>[Bericht: Harald Starl – UBC Vorchdorf]</strong></p>","2018-01-14","/content/news/OOE-Landesmeisterschaft-nbspDrei-Titel-fuer-Katharina-Hochmeir/5ba2a4ff85e99.png","6");
INSERT INTO news VALUES("934","Vorberichterstattung-zu-den-LM-kommendes-Wochenende","Vorberichterstattung zu den LM kommendes Wochenende","2","OOEBV-RLT||Top-News||","<h2>Vorberichterstattung zu den LM kommendes Wochenende</h2><p>                <img src=\"/content/news/Vorberichterstattung-zu-den-LM-kommendes-Wochenende/5ba2a5313073f.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20151107-UBC_Vorchdorf-487-2.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20151107-UBC_Vorchdorf-487-2-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20151107-UBC_Vorchdorf-487-2-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>OÖ. Landesmeisterschaft in Vorchdorf</strong></p><p><strong> </strong></p><p><strong>Oberösterreichs beste Badmintonspieler und –spielerinnen ermitteln am kommenden Wochenende (13. – 14. Jänner 2018) in Vorchdorf ihre Landesmeister und Landesmeisterinnen.</strong></p><p>Da Rekordmeister Jürgen Koch seinen Titel im Einzel nicht verteidigen wird (er spielt nur im Herrendoppel) ist Vizemeister Lukas Rebhandl (UNION Windischgarsten) Favorit und an Nr. 1 gesetzt. Bei den Damen ist die Ohlsdorferin Katharina Hochmeir Titelverteidigerin und Favoritin. </p><p>Im Herrendoppel werden wohl Jürgen Koch / Alexander Serov (ASKÖ Traun) die größten Konkurrenten der Titelverteidiger Simon und Lukas Rebhandl (UNION Windischgarsten) sein. Neue Landesmeister wird es auch im Damendoppel und Mixed geben. Während bei den Damen die Ohlsdorfer Katharina Hochmeir / Nadine Reiter die großen Favoritinnen sind, sind im Mixed die Lokalmatadore Dominik Kronsteiner / Zita Banhegyi an Nr. 1 gesetzt.</p><p>Die Landesmeisterschaften beginnen in der Sporthalle Vorchdorf am Samstag, 13. Jänner 2018 um 10 Uhr mit den Vorrundenspielen.<br>Am Sonntag, 14. Jänner 2018 finden ab 9:30 Uhr die Semi- und Finalspiele statt.</p><p>Die Auslosung ist bereits online auf <a href=\"http://www.tournamentsoftware.com/sport/tournament.aspx?id=2D24F8A6-8F5D-460E-8DB2-3BED6E2A7AAD\"><em><strong>Tournamentsoftware</strong></em></a> einzusehen. </p><p><strong>[Bericht: Harald Starl – UBC Vorchdorf]</strong></p>","2018-01-11","/content/news/Vorberichterstattung-zu-den-LM-kommendes-Wochenende/5ba2a5313073f.png","6");
INSERT INTO news VALUES("935","1-Bundesliga-Traun-bleibt-in-Hinrunde-ungeschlagen","1. Bundesliga: Traun bleibt in Hinrunde ungeschlagen!","2","Bundesliga||Top-News||","<h2>1. Bundesliga: Traun bleibt in Hinrunde ungeschlagen!</h2><p>                <img src=\"/content/news/1-Bundesliga-Traun-bleibt-in-Hinrunde-ungeschlagen/5ba2a5558e697.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42197.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat die Hinrunde der ersten österreichischen Bundesliga ungeschlagen beendet. In der fünften Runde gab es auswärts bei Askö kelag Kärnten ein 5:3. Wie in der gesamten Saison waren vorallem die Einzelleistungen ausschlaggebend für den Sieg – alle 3 Herreneinzel und das Dameneinzel konnten die Trauner gewinnen.<br> In den beiden anderen Partien konnte sich Feldkirch gegen Wien mit 8:0 durchsetzten. Wolfurt und Mödling trennten sich 4:4 unentschieden. </strong></p><p><strong> </strong></p><p><strong>Nachfolgend das Statement von Askö Trauns Präsident Herbert Koch: </strong></p><p>Ohne Punkteverlust bleibt nach der Hinrunde die Mannschaft der ASKÖ Traun überlegener Tabellenführer in der 1. Bundesliga. Im auswärtigen Spitzenspiel  gegen Kelag Kärnten setzten sich die Oberösterreicher mit 5:3 durch. Damit beendete die Mannschaft um Wolfgang Gnedt und Jürgen Koch die Hinrunde mit bereits 4 Punkten Vorsprung  auf den ersten Verfolger der nach wie vor Kelag Kärnten heißt. Vor dem Spiel wussten wir, dass das Auswärtsspiel aufgrund der letzten Ergebnisse sehr schwer werden wird. Trotz des 1:2 Rückstandes  nach den ersten  3 Doppelspielen blieben  vor allem unsere Routiniers Jürgen Koch, Wolfgang Gnedt und Lisa Heidenreich total konzentriert und gewannen ihre Einzelspiele. Den wichtigen 5. Punkt steuerte Collins Filimon zum Erfolg bei nachdem das Doppel Koch/ Gnedt zu Beginn siegte.</p><p><em>Wir haben für die Rückrunde bereits 4 Punkte Vorsprung und können in den nächsten Begegnungen ohne Druck absolvieren. Im Vorjahr hatten wir am Ende  des Grunddurchganges nach 10 Spielen, so viel  Punkte wie heuer bereits bei der Hälfte der Meisterschaft. Unser Ziel ist es, die Qualifikation für die Play- off- Runden an erster Stelle zu beenden. Damit hätten wir das Heimrecht bei den Entscheidungen. Aus dem Vorjahr wissen wir, dass dieser Umstand entscheidend sein kann. Wenn sich niemand verletzt sind die Aussichten auf einen Spitzenplatz, vielleicht sogar auf  den 13. Meistertitel vorhanden.</em></p><p>Bild: Am 8.1. ist er 45 Jahre und noch immer konkurrenzfähig- Jürgen Koch</p><p>Alle Ergebnisse auf <a href=\"http://www.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=1\"><em><strong>Tournamentsoftware</strong></em></a></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-07","/content/news/1-Bundesliga-Traun-bleibt-in-Hinrunde-ungeschlagen/5ba2a5558e697.png","8");
INSERT INTO news VALUES("936","Ende-der-Hinrunde-in-der-2-Bundesliga","Ende der Hinrunde in der 2. Bundesliga","2","Bundesliga||Top-News||","<h2>Ende der Hinrunde in der 2. Bundesliga</h2><p>                <img src=\"/content/news/Ende-der-Hinrunde-in-der-2-Bundesliga/5ba2a57dd0f31.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Mit der fünften Runde der 2. österreichischen Bundesliga wurde die Hinrunde abgeschlossen. Im OÖ-Derby konnte sich BC Raiffeisen Alkoven auswärts gegen UBC Vorchdorf mit 5:3 durchsetzten. Der BSC 70 Linz musst sich auswärts beim Tabellenführer ASV Pressbaum klar mit 1:7 geschlagen geben. Und auch für Union Ohlsdorf bracht die Auswärtsreise nichts zählbares ein. Sie mussten mit einem 2:6 die Heimreise antreten. </strong></p><p><strong> </strong></p><p><strong>Nachfolgend die Stimmen zu den Spielen: </strong></p><strong> </strong><p></p><p><strong>BC Raiffeisen Alkoven (Fritz Freimüller): </strong><br>Unser Team feierte einen verdienten Sieg beim Tabellenletzten, der dieses Mal durch hervorragende Leistungen der Herren zustande kam. Den Grundstein legten die beiden Herrendoppel Lukas Rebhandl/Thomas Hahn und Simon Rebhandl/Richard Wan. Dann legten Lukas, Simon und Thomas noch nach und fixierten den Sieg für Alkoven. In den Damenspielen hatten die Vorchdorferinnen knapp die Nase vorne.<br>Teammanager Fritz Freimüller freute sich riesig über den Erfolg seiner Mannschaft: „<em>Für uns zählt dieser Sieg doppelt, wir können damit etwas ruhiger in die Rückrunde gehen. Auf diesen Erfolg können wir aufbauen.</em>“</p><p><strong>UBC Vorchdorf (Harald Starl): </strong><br>Das neue Jahr bringt den Vorchdorfern vorerst noch kein Glück. Im Derby gegen BC Alkoven mussten sich die Vorchdorfer erneut knapp mit 3 : 5 geschlagen geben und bleiben damit weiter Schlusslicht. Und die Partie begann katastrophal. Beide Herrendoppel gingen klar an Alkoven und so stand das UBC Team von Beginn an mit dem Rücken zur Wand. Zwar konnten die UBC Damen Tina Riedl / Martina Nöst mit ihrem Sieg vor den Einzelspielen auf 1 : 2 verkürzen, ehe es so richtig dick für die Hausherren kam. Primoz Flis spielte gegen seinen Angstgegner Lukas Rebhandl lange Zeit souverän, hatte sogar vier Matchbälle, die er allesamt nicht verwerten konnte und mit 21:15, 24:26, 11:21 letztlich verlor. Erike Seiwald musste sich nach vielen vergebenen Chancen knapp in zwei Sätzen geschlagen geben. Schwerer als erwartet tat sich Martina Nöst im Dameneinzel – sie konnte jedoch nach viel Kampf einen 2 : 1 Satzsieg nach Hause spielen. Florian Brandstötter spielte weit unter seinen Erwartungen und verlor klar in zwei Sätzen. Den Schlusspunkt setzten Dominik Kronsteiner / Zita Banhegyi mit ihrem schwer erarbeiteten Dreisatzsieg im Mixed zum Endstand von 3 : 5.<br>„<em>Eine bittere und unnötige Niederlage,</em>“ so UBC Obmann Harald Starl enttäuscht nach dem Spiel, der auch weiß, dass es nun schwer mit dem Klassenerhalt werden wird.</p><p>Alle Ergebnisse auf <a href=\"http://www.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=2\"><em><strong>Tournamentsoftware</strong></em></a></p><p><strong>Die Rückrunde startet am 10. und 11. Februar 2018 mit einer Doppelrunde. </strong></p><p><strong> </strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-07","/content/news/Ende-der-Hinrunde-in-der-2-Bundesliga/5ba2a57dd0f31.png","4");
INSERT INTO news VALUES("937","Vorberichterstattung-1-Bundesliga-9","Vorberichterstattung 1. Bundesliga","2","Bundesliga||Top-News||","<h2>Vorberichterstattung 1. Bundesliga</h2><p>                <img src=\"/content/news/Vorberichterstattung-1-Bundesliga/5ba2a5bd0b771.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_1.png 485w, http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_1-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_1-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Das erste Spiel im Jahr 2018 bringt in der ersten Bundesliga den Schlager Tabellenzweiter gegen Tabellenersten – Askö kelag Kärnten gegen Askö Traun. Die Trauner könnten mit einem Sieg ihre Tabellenführung ausbauen und auch ihre weiße Weste behalten. Die weiteren Spiele sind Wolfurt gegen Mödling und Feldkirch gegen Wien. </strong></p><p><strong> </strong></p><p><strong>Askö Traun Präsident Herbert Koch zum Spiel: </strong></p><p>„<em>Unser Ziel ist es, die Tabellenführung zu verteidigen. Eine schwierige Aufgabe, wenn man die Ergebnisse der Kärntner in den vergangenen Runden betrachtet. Bereits mit einem  Unentschieden würden  wir auf der Top- Position bleiben. Jedenfalls ist beim Aufeinandertreffen der beiden an 1. und 2. Position liegenden Mannschaften ein spannendes Badminton- Ereignis garantiert. Sollten wir das Spiel erfolgreich bestehen, ist das Erreichen des Halbfinales schon sehr realistisch. Im Vorjahr reichten für die Qualifikation zur Entscheidung 10 Punkte, heuer haben wir nach 4 von 10 Runden bereits 8 Punkte auf unserem Konto.</em>“</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-05","/content/news/Vorberichterstattung-1-Bundesliga/5ba2a5bd0b771.png","3");
INSERT INTO news VALUES("938","Vorberichterstattung-2-Bundesliga-10","Vorberichterstattung 2. Bundesliga","2","Bundesliga||Top-News||","<h2>Vorberichterstattung 2. Bundesliga</h2><p>                <img src=\"/content/news/Vorberichterstattung-2-Bundesliga/5ba2a5dc2488b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_2.png 485w, http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_2-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/Bundesliga_2-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Das neue Jahr in der zweiten österreichischen Bundesliga beginnt wie das alte aufgehört hat, nämlich mit einem OÖ Derby. Am Samstag 15:00 empfängt UBC Vorchdorf den BC Raiffeisen Alkoven. Ebenfalls Samstag spielt der BSC 70 Linz auswärts gegen Tabellenführer ASV Pressbaum. Am Sonntag wird die Runde mit der Partie Badminton Moving Wiener Neustadt gegen Union Ohlsdorf abgeschlossen. </strong></p><p><strong> </strong></p><p><strong>Die Stimmen vor dem Spiel: </strong></p><strong> </strong><p></p><p><strong>UBC Vorchdorf: </strong><br>Das neue Jahr beginnt für die Badmintonfans mit einem neuerlichen Derby: UBC Vorchdorf empfängt BC Alkoven (Samstag, 6. Jän. 2018, 15 Uhr Sporthalle).<br>Nach den zuletzt knappen Niederlagen stehen die Vorchdorfer gewaltig unter Druck. „<em>Wir brauchen dringend ein Erfolgserlebnis und Punkte,</em>“ so UBC Obmann Harald Starl. Das Duell der beiden OÖ. Vereine war in der Vergangenheit stets ein Duell auf Augenhöhe. Knappe Ergebnisse waren die Folge und auch das Spiel am Samstag verspricht viel Spannung. Vorchdorf dürfte bei den Damen ein leichtes Plus haben, während Alkoven vor allem in den Doppelbewerben stark aufgestellt ist.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-01-05","/content/news/Vorberichterstattung-2-Bundesliga/5ba2a5dc2488b.png","6");
INSERT INTO news VALUES("939","4-OOEBV-Doppel-RLT-MD-in-Haid","4. OÖBV Doppel-RLT (MD) in Haid","2","OOEBV-RLT||Top-News||","<h2>4. OÖBV Doppel-RLT (MD) in Haid</h2><p>                <img src=\"/content/news/4-OOEBV-Doppel-RLT-MD-in-Haid/5ba2a6019d278.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_4_OÖBV_Doppel-RLT_25.02.2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_4_OÖBV_Doppel-RLT_25.02.2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_4_OÖBV_Doppel-RLT_25.02.2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am Sonntag den 25. Februar war die Sporthalle Haid erneut der Austragungsort für ein Doppelturnier. Leider erreichte die Grippewelle auch einige Doppelpaarungen und das Teilnehmerfeld dezimierte sich auf 16 Mixed-Doppel (Altersdurchschnitt 41 Jahre). Die Paarungen kamen aus Salzburg und Oberösterreich um sich spielerisch und gesellschaftlich von der besten Seite zu zeigen. Die 32 Teilnehmer/Innen aus 12 verschiedenen Vereinen lieferten sich auf 6 Spielfeldern spannende und zum Glück auch verletzungsfreie Spiele.</strong></p><p>Das Turnier startete pünktlich um 10:00 Uhr und wurde mit der Siegerehrung um 15:30 Uhr beendet.Die jüngste Mixed-Paarung schlug an ihrem Jahrestag die besseren Bälle und gewann auch zum ersten Mal ein Mixed-Turnier. Bei der Siegerehrung bekamen die ersten drei Doppelpaarungen jeweils eine Flasche Rot und Weiß mit Giotto verziert und die viertplatzierten nur eine Flasche Rot und Weiß. Anbei die Auflistung der besten vier Paarungen, alle anderen Platzierungen sind in der <a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=F83B33F4-9D7B-4B39-A671-7E8CC521CA7A\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p><strong>Mixed-Doppel:</strong></p><p>1. Platz Tina Plank / Christoph Hajek<br>2. Platz Sarah Anleitner / Matthias Reischauer<br>3. Platz Christina Wu / Nikita Arnold<br>4. Platz Susanna Auberger / Otmar Auberger</p><p>Die ASK Nettingsdorf-Badminton/Racketlon (SMILEY-Schlägertruppe) versuchte mit einem Speed-Test den ganzen Turnierablauf noch etwas aufzulockern. Es wollte fasst jede Paarung wissen mit welcher Geschwindigkeit sie den Schläger schwingen können. Die beiden Werte der Paarungen wurden addiert und die Siegerpaarung (Tina Plank / Christoph Hajek) erreichte mit 375 km/h die Bestmarke. Die Turnierleitung entschied sich für die Paarung mit dem sanftesten Smash (Daniela Kreindl / Günter Mauhart) erreichten immerhin 274 km/h und ihr High-Speed wurde mit einer Flasche Rot sowie Weiß prämiert. Ein herzliches und großes DANKE, an alle Teilnehmer/Innen sowie an unsere zukünftige Pensionistin und langjähriges Mitglied sowie ehemalige Obfrau Roswitha Ben Ahmed die ihren letzten Auftritt bei einem Badminton-Event für den ASK Nettingsdorf-Badminton/Racketlon hatte. Roswitha, wir wünschen dir alles Liebe und Gute für die Zukunft. </p><p><strong>Das 5. OÖBV-Doppel-RLT mit den Bewerben (DD) und (HD) wird am Sonntag den 25. März 2018 in der Solar-City-Halle ausgetragen, Die „TA“ sowie die TA-App ist schon aktiv geschaltet und wartet auf eure Anmeldungen.</strong></p><p><strong> </strong></p><p><strong>[Bericht: Peter Krenmayr]</strong></p>","2018-02-27","/content/news/4-OOEBV-Doppel-RLT-MD-in-Haid/5ba2a6019d278.png","6");
INSERT INTO news VALUES("940","Wolfgang-Gnedt-bei-den-Austrian-Open-2018","Wolfgang Gnedt bei den Austrian Open 2018","2","International||Top-News||","<h2>Wolfgang Gnedt bei den Austrian Open 2018</h2><p>                <img src=\"/content/news/Wolfgang-Gnedt-bei-den-Austrian-Open-2018/5ba2a628be21a.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DSC_0114.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DSC_0114-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DSC_0114-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Die Badminton Austrian Open 2018 stehen unmittelbar bevor – der Badminton Höhepunkt des Jahres 2018 beginnt am Mittwoch, 21. Februar 2018 mit den ersten Qualifikationsrunden und endet am Samstag, 24. Februar 2018 um 17:00 Uhr mit den Finalspielen in der Stadthalle B Wien.<br> Die Austrian Open zählen auch heuer wieder zu einem der größten internationalen Sportveranstaltungen im Lande: 287 Athleten aus 42 Nationen haben für die Open 2018 ihre Nennung abgegeben. </strong></p><p>In den letzten Jahren war WBH Wien für die Ausrichtung verantwortlich – heuer trägt der ÖBV mit Hilfe mehrerer Mitgliedsvereinen aus Wien und Niederösterreich die Verantwortung. Die Austrian Open zählen zur Weltrangliste und sind als Internationales Challenge Turnier mit USD 25.000 dotiert.</p><p>Aktuelle Daten und Ergebnisse findet man unter <a href=\"http://autopen.at/\"><em><strong>Austrian Open 2018</strong></em></a></p><p>Wolfgang Gnedt (BSC 70 Linz) trifft zum Auftakt auf den Thailänder Phanuwat Srimanta, derzeit auf Weltranglisten Position 721, sollte von der Papierform als erste Hürde für Wolfgang zu schaffen sein. Wolfgang selbst liegt derzeit auf Weltranglistenplatz 215.<br>Nach zuletzt sehr guten Leistungen bei den Staatsmeisterschaften und auch in der Badminton Bundesliga, ist es für Wolfgang die nächste Möglichkeit zur Weiterentwicklung.<br>Sein Spiel wird das 6. Spiel (nach Spielbeginn 10 Uhr) auf Court Nr. 1 sein.<br><strong><br> [Bericht: BSC 70 Linz – Reinhard Hechenberger]</strong></p>","2018-02-21","/content/news/Wolfgang-Gnedt-bei-den-Austrian-Open-2018/5ba2a628be21a.png","8");
INSERT INTO news VALUES("941","2-Bundesliga-ndash-OOE-Derby","2. Bundesliga – OÖ Derby","2","Bundesliga||Top-News||","<h2>2. Bundesliga – OÖ Derby</h2><p>                <img src=\"/content/news/2-Bundesliga-ndash-OOE-Derby/5ba2a67b515f6.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>In der zweiten Bundesliga konnte am Samstag der BSC 70 Linz das OÖ-Derby gegen UBC Vorchdorf mit 5:3 für sich entscheiden. Im zweiten OÖ-Derby zwischen BC Raiffeisen Alkoven und Union Ohlsdorf gab es ein 6:2 für die Ohlsdorfer. Im Spitzenspiel am Sonntag zwischen ASV Pressbaum und Badminton Moving Wr. Neustadt setzten sich die Pressbaumer zu Hause mit 7:1 durch.<br> Damit halten die Linzer Anschluss an Wr. Neustadt und ein Play-off-Platz ist noch möglich (2 Punkte Abstand).</strong></p><p><strong> </strong></p><p><strong>Nachfolgend die Statements der Vereine: </strong></p><strong> </strong><p></p><p><strong>UBC Vorchdorf</strong><br>„Wir spielen mit den Topteams mit, aber leider reicht es immer wieder nur zu einer knappen Niederlage,“ ist UBC Obmann Harald Starl mit den Leistungen seiner Mannschaft durchwegs zufrieden. In den verbleibenden zwei Runden gastieren die Vorchdorfer noch in Ohlsdorf (3. März) und in Alkoven zu zwei weiteren Derbys.</p><p><strong>BSC 70 Linz</strong><br>„Wir wussten, dass wir das Team aus Vorchdorf keinesfalls unterschätzen dürfen. Wichtig waren die Punkte aus den Doppelspielen. Jetzt können wir von Tabellenplatz 3 vielleicht noch einmal um den Play-off Platz überraschen. Nächste Runde spielen wir in Wiener Neustadt um die letzte Chance. Dennoch haben wir unser Saisonziel mit dem dritten Platz im fest im Focus. Deshalb können wir befreit aufspielen.“ hofft Obmann Reinhard Hechenberger doch noch Wr. Neustadt Richtung Aufstiegs-Play-off unter Druck setzen zu können.</p><p><strong>BC Raiffeisen Alkoven</strong><br>Es will einfach nicht sein. Wie bereits in einigen Spielen der laufenden Saison halten die Alkovener Badmintonspieler/innen mit ihren Gegnern mit, verlieren dann aber doch die engen Partien. Auch im OÖ-Derby gegen Union Ohlsdorf verliefen die meisten Spiele auf hohem Niveau und sehr spannend. Mit einer neuen Aufstellungsvariante musste sich der BC Raiffeisen Alkoven am Ende mit 2:6 geschlagen geben. Die junge Mannschaft aus dem Salzkammergut präsentierte sich sehr stark und konnte am Ende doch verdient beide Punkte für sich verbuchen. Nur Simon Rebhandl konnte mit seinen zwei Siegen überzeugen. Im 2.Herreneinzel besiegte er Thomas Wimmer klar in 2 Sätzen. Noch deutlicher war der Erfolg im Mixed mit Partnerin Iris Freimüller gegen die sonst sehr erfolgreiche Paarung Haas/Schausberger. Da auch Union Vorchdorf erfolglos blieb, steht das Alkovener Team weiterhin mit 3 Punkten Abstand an vorletzter Stelle der Tabelle.<br><strong><br> [Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-02-21","/content/news/2-Bundesliga-ndash-OOE-Derby/5ba2a67b515f6.png","4");
INSERT INTO news VALUES("942","Badminton-Schulcup","Badminton Schulcup","2","Nachwuchs||Top-News||","<h2>Badminton Schulcup</h2><p>                <img src=\"/content/news/Badminton-Schulcup/5ba2a6a0898bd.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Schulcup.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Schulcup-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Schulcup-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Badminton Schulcup Oberösterreich am 1. Februar 2018</strong></p><p><strong> </strong></p><p><strong>Am 1. Februar 2018 fand der Badminton Schulcup in Linz statt. An diesem Tag kämpften insgesamt 24 Mannschaften in 3 Bewerben um Medaillen. Im Unterstufenbewerb nahmen 15 Mannschaften, im Oberstufenbewerb der Burschen 6 und beim Bewerb der Mädchen in der Oberstufe 3 Mannschaften teil. Somit waren an diesem Tag um die 120 SchülerInnen aus 14 verschiedenen Schulen im Einsatz. Es gab hochklassige Spiele zu sehen, da einige Mannschaften auf Vereinsspieler zurückgreifen konnten. Es wurden 220 Spiele in 44 Begegnungen ausgetragen, bis schließlich um 15:00 Uhr nach 6 Stunden Badmintonsport die Sieger gekürt werden konnten. </strong></p><p>Das BORG Linz konnte sich – wie im Vorjahr – den Sieg im Oberstufenbewerb der Burschen sichern. Beim Oberstufenbewerb der Mädchen gewann das Stiftsgymnasium Wilhering. Im Unterstufenbewerb hatte das BG Gmunden die Nase  hauchdünn vorne und gewann in einem spannenden Finale gegen das BRG Fadingerstraße im Entscheidungsspiel 21:20!<br>Die Landessieger sind für die Badminton Schul Olympics (Bundesmeisterschaften der Schulen) startberechtigt und werden vom 9.-11. April in St. Pölten ihr Bestes geben. Alles Gute und viel Erfolg, aber auch schöne und erlebnisreiche Tage!</p><p>Ein großes Dankeschön geht an das Europagymnasium Auhof, wo wir in einer schönen Dreifachturnhalle auf 9 Feldern unser Turnier durchführen durften. Ein weiterer Dank geht an die Sparkasse OÖ, die wie jedes Jahr Urkunden, Medaillen und Pokale zur Verfügung stellte. Weiters bekamen alle Mannschaften je eine Dose Bälle von der Firma Babolat geschenkt. Weitere Sponsoren, die das Turnier großzügig unterstützten sind die Firmen: Victor und Axenda. Und mit finanzieller Hilfe des OÖBV konnten noch weitere Preise angeschafft werden. Jeder Teilnehmer des Turniers bekam für den sportlichen Einsatz eine süße Belohnung.<br>Das Turnier verlief sehr ruhig und diszipliniert und zum Glück ohne Verletzungen ab. Ein großer Dank gilt auch den BetreuerInnen, den TeilnehmerInnen und der Turnierleitung, die alle dazu beigetragen haben, dass dieses Turnier ein Erfolg wurde!</p><p><strong>Ergebnisse:</strong></p><p><strong> </strong></p><p><strong>Oberstufe Mädchen:</strong><br>1. Stiftsgymnasium Wilhering<br>2. Khevenhüller Gymnasium – Linz<br>3. Brucknergymnasium Wels</p><p><strong>Unterstufe:</strong><br>1. BG Gmunden<br>2. BRG Fadingerstraße – Linz<br>3. Stiftsgymnasium Wilhering<br>4. NMS Neukirchen/Altmünster<br>5. SMS Schärding<br>6. NMS Vorchdorf<br>7. BRG Schloss Traunsee 1<br>8. BRG Schloss Traunsee 2<br>9. Khevenhüller Gymnasium 1 – Linz<br>10. NMS Vöcklabruck 1<br>11. NMS Stadl-Paura 1<br>12. Khevenhüller Gymnasium 2 – Linz<br>13. NMS Vöcklabruck 2<br>14. Brucknergymnasium Wels<br>15. NMS Stadl-Paura 2</p><p><strong>Oberstufe Burschen:</strong><br>1. BORG Linz<br>2. HTL Vöcklabruck<br>3. HTL Leonding<br>4. Stiftsgymnasium Wilhering<br>5. Khevenhüller Gymnasium-Linz<br>6. Brucknergymnasium Wels</p><p><strong>[Bericht: Tina Füreder – Schulsportreferentin]</strong></p>","2018-02-12","/content/news/Badminton-Schulcup/5ba2a6a0898bd.png","4");
INSERT INTO news VALUES("943","U15--Jgd-Ranglistenturnier-in-Ohlsdorf","U15 / Jgd. Ranglistenturnier in Ohlsdorf","2","Nachwuchs||Top-News||","<h2>U15 / Jgd. Ranglistenturnier in Ohlsdorf</h2><p>                <img src=\"/content/news/U15--Jgd-Ranglistenturnier-in-Ohlsdorf/5ba2a6d1c1caf.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_20180210_154600_HDR1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180210_154600_HDR1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180210_154600_HDR1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii\" width=\"317\" height=\"180\">                                                        </p><p><strong>Bericht zum U15 / Jgd. – Ranglistenturnier in Ohlsdorf am 10. Februar 2018</strong></p><p><strong> </strong></p><p><strong>Am 10. Februar fand in Ohlsdorf das erste OÖBV-U15/Jgd.-Ranglisten-Turnier der neuen Saison in Ohlsdorf statt.<br> Insgesamt fanden 31 Teilnehmer den Weg in die kleine Halle nach Ohlsdorf, was das Veranstalterteam rund um Hermann Schausberger aber keineswegs vor Probleme stellte. Das Turnier konnte ohne Probleme und Verletzungen durchgeführt werden, sodass um kurz nach 15 Uhr die Sieger in den 4 Bewerben feststanden.</strong></p><p>Im Herren U15 Bewerb (9 Teilnehmer) war wieder einmal Jonas Windauer (Union Ohlsdorf) eine Klasse  für sich. Er entschied sämtliche Partien ohne Satzverlust und holte sich in souveräner Manier den Titel vor Elias Spitzhofer (Askö Traun) und Marco Stockinger (Askö Traun). Im stark besetzten Damen U15 Bewerb (10 Teilnehmer) machte es Kira Dlapka (Union Ohlsdorf) ihrem Vereinskollegen nach und gewann ebenfalls ohne Satzverlust den Bewerb. Zweiter wurde hier Lara Stockinger (Askö Traun) und den dritten Platz konnte sich Kiras Schwester Sarah Dlapka (Union Ohlsdorf) sichern, die sogar eine Altersklasse nach oben spielte.<br>Im Herren U19 Bewerb (8 Teilnehmer) konnte sich Kai Niederhuber (UBC Neuhofen) den Titel sichern. Er gewann  im Finale gegen Jannik Auberger (Askö Traun) in einem tollen Match in 3 Sätzen. Dritter wurde in diesem Bewerb Erik Ofner (Union Kirchdorf). Im Damen U19, der leider mit nur 4 Teilnehmerinnen spärlich besetzt war, gewann die topgesetzte Nora Lungenschmied (Union Kirchdorf) ohne Probleme und Satzverlust den Titel vor Sara Maric (Askö Traun) und Olivia Orr UBC Neuhofen).</p><p>Abschließend noch einmal die Sieger auf einen Blick:</p><p>Herren U15:    1. Jonas Windauer     2. Elias Spitzhofer    3. Marco Stockinger<br>Damen U15:    1. Kira Dlapka        2. Lara Stockinger    3. Sarah Dlapka<br>Herren U19:    1. Kai Niederhuber    2. Jannik Auberger    3. Erik Ofner<br>Damen U19:    1. Nora Lungenschmid    2. Sara Maric        3. Olivia Orr</p><p><strong>[Bericht: Stephan Dlapka (Union Ohlsdorf)]</strong></p>","2018-02-12","/content/news/U15--Jgd-Ranglistenturnier-in-Ohlsdorf/5ba2a6d1c1caf.png","7");
INSERT INTO news VALUES("944","1-Bundesliga-ndash-Traun-weiter-ungeschlagen","1. Bundesliga – Traun weiter ungeschlagen!","2","Bundesliga||Top-News||","<h2>1. Bundesliga – Traun weiter ungeschlagen!</h2><p>                <img src=\"/content/news/1-Bundesliga-ndash-Traun-weiter-ungeschlagen/5ba2a6ed6151d.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42197.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat in der Doppelrunde der 1. Bundesliga seinen Vorsprung weiter ausgebaut. Die Trauner blieben wieder ungeschlagen und schickten askö kelag Kärnten mit 6:2 und UBSC Wolfurt mit 5:3 wieder nach Hause. </strong></p><p>Das kurze Statement der Trauner: </p><p>Mit einem 5:3 Sieg gegen dem amtierenden Meister aus Wolfurt konnte die Teilnahme im Play-Off Halbfinale fixiert werden. Das Team rund um Routinier Jürgen Koch bleibt auch nach dieser Doppelrunde ohne Punktverlust.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-02-12","/content/news/1-Bundesliga-ndash-Traun-weiter-ungeschlagen/5ba2a6ed6151d.png","8");
INSERT INTO news VALUES("945","2-Bundesliga-ndash-Teams-aus-NOE-bleiben-tonangebend","2. Bundesliga – Teams aus NÖ bleiben tonangebend!","2","Bundesliga||Top-News||","<h2>2. Bundesliga – Teams aus NÖ bleiben tonangebend!</h2><p>                <img src=\"/content/news/2-Bundesliga-ndash-Teams-aus-NOE-bleiben-tonangebend/5ba2a713e45b9.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/40172628392_d732b0d9e1_z.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/40172628392_d732b0d9e1_z-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/40172628392_d732b0d9e1_z-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Zum Start der Rückrunde gab es in der 2. Bundesliga eine Doppelrunde.<br> Die Teams aus Oberösterreich versuchten dabei aber vergeblich Punkte auf die zwei NÖ-Top-Teams gut zu machen. ASV Pressbaum und Badminton Moving Wr. Neustadt konnten mit ihrem gesamten Kader inkl. Legionäre antreten und blieben wieder siegreich. In den OÖ-Derbys konnte sich der BSC 70 Linz zu Hause zweimal knapp gegen BC Raiffeisen Alkoven und Union Ohlsdorf jeweils mit 5:3 durchsetzen. </strong></p><p><em>Foto: Natalia Peshekhonova (BSC 70 Linz)</em></p><p><strong>Die Stimmen zu den Begegnungen: </strong></p><p><strong> </strong></p><p><strong>BSC 70 Linz</strong><br>„Diese beiden Siegen tun sehr gut. Nachdem wir in dieser Saison gleich beide Top Spielerinnen verloren haben (Anmerkung: Staatsmeisterin Sonja Langthaler (Karriereende) und Ana-Marija Setina (Hüft- u. Knieprobleme) ist es vor allem im Damenbereich ganz und gar nicht einfach. Natalie Hofinger und Natalia Peshekhonova zeigen aber tolle Leistungen und helfen dem Team sehr gut. Bei den Herren war Daniel Walchshofer Spieler des Wochenende. Er holte die ganz entscheidenden Matches unter starkem Druck. Nächste Woche folgt mit Vorchdorf der Tabellenletzte.“  berichtet Obmann Reinhard Hechenberger erfreut nach diesem Bundesliga Wochenende.</p><p><strong>UBC Vorchdorf</strong><br>Keine Trendwende beim Vorchdorfer Badminton Team – auch zum Start der Rückrunde bleiben die UBC-ler sieglos und hüten weiterhin das Ende der Tabelle der 2. Bundesliga. Gegen Wiener Neustadt kämpften die Vorchdorfer lange auf Augenhöhe mit dem Favoriten – letztlich gab es wie so oft eine unglückliche 2 : 6 Heimniederlage. Nach dem üblichen Rückstand nach den Herrendoppel Spielen konnten Martina Nöst / Tina Riedl mit ihrem Sieg vorerst verkürzen. Durch die Niederlagen von Primoz Flis und Erik Seiwald erhöhten die Niederösterreicher auf 4 : 1. Dominik Kronsteiner konnte abermals mit einem knappen 21:14, 25:23 Sieg verkürzen. Martina Nöst führte im Entscheidungssatz gegen die Kroatische U17 Doppel Europameisterin Galenic schon mit 18:12, ehe sie doch mit 19:21 verlor. Im abschließenden Mixed verloren Dominik Kronsteiner / Zita Banhegyi ihre weiße Weste – sie unterlagen in zwei Sätzen. In der Sonntags Matinee gegen Leader Pressbaum ging den Vorchdorfern regelrecht die Luft aus. Lediglich Martina Nöst und Manuel Weber / Zita Banhegyi konnten bei der 0 : 8 Heimschlappe einen Satzgewinn verbuchen. Damit bleibt UBC Vorchdorf auch nach 7 Runden punktelos am Tabellenende der 2. Bundesliga.</p><p><strong>BC Raiffeisen Alkoven</strong><br>Töchterchen Marie ist erst 4 Monate alt, trotzdem entschloss sich Iris Freimüller auf den Badmintoncourt zurück zu kehren. Sie spielte an der Seite von Simon Rebhandl trotz Trainingsrückstands ausgezeichnet und siegte in ihren beiden Einsätzen.Leider konnte sie damit aber die beiden Niederlagen ihrer Mannschaft BC Raiffeisen Alkoven in der Doppelrunde der 2.Bundesliga nicht verhindern. Leider stand wegen der Grippewelle nicht der vollständige Kader zur Verfügung.Am Samstag hätten sich die Alkovener in Linz gegen den BSC 70 zumindest einen Punkt verdient, leider waren am Ende die Linzer aber bei ihrem 5:3 Sieg glücklicher. Die Punkte für Alkoven holten Lukas Rebhandl, Maria Steinmann und Iris Freimüller/Simon Rebhandl.Im Heimspiel am Sonntag bekamen die beiden Alkovener Nachwuchshoffnungen Lukas Mittermayr und Michael Scheinecker eine Chance im Team. Sie rechtfertigten das Vertrauen mit tollen Spielen. Noch reichte es nicht ganz zu vollen Erfolgen, aber beide konnten wertvolle Erfahrungen sammeln. Die Gäste aus Wr. Neustadt erwiesen sich letztendlich zu stark und siegten verdient mit 6:2. Für Alkoven punkteten Simon Rebhandl/Michael Scheinecker im Doppel und Iris Freimüller/Simon Rebhandl im Mixed.<br>Alkovens Obmann Fritz Freimüller: Obwohl es nicht zu Punkten reichte, bin ich mit den Leistungen sehr zufrieden. Die beiden jungen Spieler präsentierten sich ausgezeichnet und zeigten, dass sie nahe dran sind. Auch die Rückkehr von Iris Freimüller ins Team war ein Erfolg. Wir sind zwar noch immer im Abstiegskampf, haben aber weiterhin als Vorletzter 3 Punkte Vorsprung gegenüber Union Vorchdorf.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-02-12","/content/news/2-Bundesliga-ndash-Teams-aus-NOE-bleiben-tonangebend/5ba2a713e45b9.png","4");
INSERT INTO news VALUES("946","Vorberichterstattung-Doppelrunde-1-Bundesliga-3","Vorberichterstattung Doppelrunde 1. Bundesliga","2","Bundesliga||Top-News||","<h2>Vorberichterstattung Doppelrunde 1. Bundesliga</h2><p>                <img src=\"/content/news/Vorberichterstattung-Doppelrunde-1-Bundesliga/5ba2a743b3482.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42264.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42264-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42264-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>In der ersten österr. Bundesliga versucht der überlegene Tabellenführer Askö Traun in einer Doppelrunde seine Gegner auf Abstand zu halten. Zu Besuch in Traun werden am Samstag askö kelag Kärnten und am Sonntag UBSC Wolfurt sein. </strong></p><p><strong> </strong></p><p><strong>Nachfolgend der Vorbericht von Askö Traun: </strong></p><p>In den Reihen der 4 Mannschaften stehen zahlreiche Sieger  und Medaillengewinner  aus der am vergangenen Wochenende ausgetragenen Staatmeisterschaft. Spitzenbadminton der Sonderklasse ist jedenfalls garantiert.</p><p>Die Trauner Mannschaft will die führende Position aus der Hinrunde verteidigen, oder möglicherweise sogar ausbauen, um eine optimale Ausgangsposition für das Semifinale zu erreichen. Mit der Unterstützung unseres Publikums sieht das Team gute Chancen, bereits nach 7 von 10 Runden, die Qualifikation für das Semifinale zu fixieren.</p><p>Die ersten 4 Mannschaften aus dem Grunddurchgang bestreiten die Semifinal- Spiele, die Sieger daraus stehen dann  im Finale um den österr. Meistertitel. Die besser platzierte Mannschaft aus dem Grunddurchgang hat in den Entscheidungsspielen das Heimrecht.<br><strong><br> [Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-02-09","/content/news/Vorberichterstattung-Doppelrunde-1-Bundesliga/5ba2a743b3482.png","10");
INSERT INTO news VALUES("947","Vorberichterstattung-Doppelrunde-2-Bundesliga-3","Vorberichterstattung Doppelrunde 2. Bundesliga","2","Bundesliga||Top-News||","<h2>Vorberichterstattung Doppelrunde 2. Bundesliga</h2><p>                <img src=\"/content/news/Vorberichterstattung-Doppelrunde-2-Bundesliga/5ba2a76ed1c75.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am Wochenende findet eine Doppelrunde in der 2. österr. Bundesliga statt. Es ist gleichzeitig der Start der Rückrunde. Und die Teams aus Oberösterreich werden versuchen Boden auf die beiden Tabellenführer ASV Pressbaum und Badminton Moving Wr. Neustadt gut zu machen. </strong></p><p><strong> </strong></p><p><strong>Nachfolgend die Stimmen vor dem Spiel:</strong><br><strong><br> UBC Vorchdorf: </strong></p><p>Vorchdorf empfängt Topteams</p><p>Mit einer Doppelrunde startet in der Badminton Bundesliga die Rückrunde. Zum Auftakt empfangen die Vorchdorfer die beiden Leader Pressbaum und Wiener Neustadt.<br>Keine leichte Aufgabe wartet auf das Tabellenschlusslicht – mit den beiden bislang noch ungeschlagenen Teams aus Ostösterreich kommen zwei harte Brocken in die Marktgemeinde. „Wir brauchen dringend Punkte – aber gegen die beiden Leader wird es verdammt schwer werden, zu punkten,“ hofft UBC Obmann Harald Starl auf eine Sensation.</p><p>Abgesehen von kleineren Blessuren können die Heimischen in Bestbesetzung antreten. Für einen Erfolg werden abermals die Doppelspiele entscheidend sein. „<em>Da ist noch viel Luft nach oben!</em>“, so Starl.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-02-09","/content/news/Vorberichterstattung-Doppelrunde-2-Bundesliga/5ba2a76ed1c75.png","9");
INSERT INTO news VALUES("948","3-Medaillen-fuer-OOEBV-bei-den-61-Staatsmeisterschaften-in-Feldkirch","3 Medaillen für OÖBV bei den 61. Staatsmeisterschaften in Feldkirch","2","OEM||Top-News||","<h2>3 Medaillen für OÖBV bei den 61. Staatsmeisterschaften in Feldkirch</h2><p>                <img src=\"/content/news/3-Medaillen-fuer-OOEBV-bei-den-61-Staatsmeisterschaften-in-Feldkirch/5ba2a7d75c737.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung2018_HerrenEinzel.jpeg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung2018_HerrenEinzel-160x90.jpeg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung2018_HerrenEinzel-317x180.jpeg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Insgesamt starteten 14 TeilnehmerInnen aus Oberösterreich in Feldkirch, ein Titelgewinn blieb dieses Jahr leider aus. Die Medaillen holten Katharina Hochmeir (Union Ohlsdorf) und Wolfgang Gnedt (BSC 70 Linz). Katharina Hochmeir verlor im Dameneinzel-Semifinale im 3. Satz gegen Katrin Neudolt (Badminton Mödling) und holte damit die Bronze-Medaille. Im Damendoppel erreichte sie ebenso einen 3. Platz gemeinsam mit Carina Meinke (ASV Pressbaum). Wolfgang Gnedt holte mit Silber im Herreneinzel die 3. Medaille für den OÖBV. Er musste sich im Finale dem an Nr.1 gesetzten Luka Wraber (ASKÖ Neudörfl) geschlagen geben. Vor allem der 2. Satz war mit 23:21 eine enge Angelegenheit. Weiters konnten noch einige Viertelfinalplätze erspielt werden, wo durchaus einige Chancen vorhanden waren weitere Medaillen zu holen.</strong></p><p><strong>Alle Medaillengewinner auf einen Blick:</strong></p><p><strong>Herren Einzel:</strong><br>1.    Luka Wraber (ASKÖ Neudöfl)<br>2.    <strong>Wolfgang Gnedt (BSC 70 Linz)</strong><br>3.    Leon Seiwald (ATSV Graz) und Rüdiger Gnedt (SFC Wimpassing)<br><strong><br> Damen Einzel:</strong><br>1.    Jenny Ertl (ASKÖ Kelag Kärnten)<br>2.    Katrin Neudolt (Badminton Mödling)<br>3.    <strong>Katharina Hochmeir (UNION Ohlsdorf)</strong> und Carina Meinke (ASV Pressbaum)<br><strong><br> Herren Doppel:</strong><br>1.    Roman Zirnwald / Daniel Graßmück (ASV Pressbaum / Badminton Mödling)<br>2.    Philip Birker / Dominik Stipsits (ASV Pressbaum / Badminton Mödling)<br>3.    Rene Nichterwitz / Fabian Steurer (UBSC Wolfurt / SV Lochau) und Philip Drexler / Jakob Sorger (Drop In Graz / ASV Pressbaum)</p><p><strong>Damen Doppel:</strong><br>1.    Serena Au Yeong / Sabrina Herbst (BMC Feldkirch)<br>2.    Elisabeth Baldauf / Antonia Meinke (UBC Egg / ASV Pressbaum)<br>3.    Reka Sarosi / Bianca Schiester (Badminton Mödling) und <strong>Katharina Hochmeir</strong> / Carina Meinke (UNION Ohlsdorf / ASV Pressbaum)</p><p><strong>Mixed:</strong><br>1.    Roman Zirnwald / Elisabeth Baldauf (ASV Pressbaum / UBC Egg)<br>2.    Dominik Stipsits / Antonia Meinke (Badminton Mödling / ASV Pressbaum)<br>3.    Kilian Meusburger / Sabrina Herbst (BC Wolfurt / BCM Feldkirch) und Philip Katsaros / Nina Sorger (ASV Pressbaum)</p><p><strong>[Bericht: Peter Zauner]</strong></p>","2018-02-05","/content/news/3-Medaillen-fuer-OOEBV-bei-den-61-Staatsmeisterschaften-in-Feldkirch/5ba2a7d75c737.png","11");
INSERT INTO news VALUES("949","1-Bundesliga-Traun-gewinnt-Grunddurchgang","1. Bundesliga: Traun gewinnt Grunddurchgang","2","Bundesliga||Top-News||","<h2>1. Bundesliga: Traun gewinnt Grunddurchgang</h2><p>                <img src=\"/content/news/1-Bundesliga-Traun-gewinnt-Grunddurchgang/5ba2a7f63cc64.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42197.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat in der ersten Badminton-Bundesliga souverän den Grunddurchgang gewonnen. Die Trauner spielten am letzten Spieltag gegen WBH Wien ein 4:4 Unentschieden.<br> Im Play-off treffen die Trauner nun auf BC Feldkirch. Das zweite Halbfinale bestreiten UBSC Wolfurt und Askö kelag Kärnten. </strong></p><p><em>Hier die Ergebnisse auf <a href=\"http://obv.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=1\"><em><strong>Tournamentsoftware</strong></em></a></em></p><p><strong>Statement von Askö Traun (Roland Gindelhumer)</strong><br><em>Gegen den Tabellenletzten aus Wien feierte Peter Zauner nach seiner langen Verletzunspause sein Comeback. Beim 4:4 gegen den Tabellenletzten wurde noch für das anstehende Halbfinale getestet.</em></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-26","/content/news/1-Bundesliga-Traun-gewinnt-Grunddurchgang/5ba2a7f63cc64.png","5");
INSERT INTO news VALUES("950","2-Bundesliga-Union-Ohlsdorf-holt-dritten-Platz","2. Bundesliga: Union Ohlsdorf holt dritten Platz","2","Bundesliga||Top-News||","<h2>2. Bundesliga: Union Ohlsdorf holt dritten Platz</h2><p>                <img src=\"/content/news/2-Bundesliga-Union-Ohlsdorf-holt-dritten-Platz/5ba2a870301cc.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2016-10-29_IMG_1634.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/2016-10-29_IMG_1634-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2016-10-29_IMG_1634-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>In der zweiten Badminton-Bundesliga fand vergangenes Wochenende die letzte Runde im Grunddurchgang statt. Im Fernduell um den dritten Platz konnte sich Union Ohlsdorf mit 7:1 gegen den Tabellenzweiten Wr. Neustadt durchsetzen, während der direkte Konkurrent um den dritten Platz BSC 70 Linz gegen Tabellenführer ASV Pressbaum chancenlos blieb. Die Ohlsdorfer überholen daher die Linzer noch und sind damit bestes OÖ-Team in der zweiten Bundesliga. Zum Derby kam es in der letzten Runde ebenfalls. BC Raiffeisen Alkoven trat nicht in der besten Besetzung auf und musst sich knapp gegen UBC Vorchdorf geschlagen geben. Der Sieg hilft den Vorchdorfern allerdings nichts mehr, sie müssen ins Abstiegs-Play-off. Ob es überhaupt Landesmeister gibt, die versuchen wollen in die zweite Bundesliga aufzusteigen wird sich am 12. Mai 2018 zeigen.</strong></p><p><strong> </strong></p><p><strong>Mit dem Aufstieg hatten die OÖ-Teams diese Saison nichts zu tun. Die beiden Teams aus Niederöstereich ASV Pressbaum und Badminton Moving Wr. Neustadt hatten in ihrem Kader einige starke Legionäre und haben daher auch sicherlich im Aufstiegs-Play-off gute Chancen den Sprung in die erste Bundesliga zu schaffen. Sie müssen sich gegen WBH Wien und AS Logistik Mödling behaupten. </strong></p><p><em>Hier die Ergebnisse auf <a href=\"http://obv.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=2\"><em><strong>Tournamentsoftware</strong></em></a></em></p><p><strong>Nachfolgend die Stimmen zu den Begegnungen: </strong></p><p><strong> </strong></p><p><strong>UBC Vorchdorf (Harald Starl)</strong><br>Ende gut – fast alles gut! In der letzten Runde der 2. Badminton Bundesliga kamen die Vorchdorfer im Derby gegen Alkoven zum ersten Saisonsieg. UBC siegte auswärts mit 5 : 3.<br>Mit Manuel Weber und Dominik Kronsteiner mussten die Vorchdorfer auf zwei Stammspieler verzichten, während Alkoven in Bestbesetzung antreten konnte. Zur Überraschung aller konnte Erik Seiwald / Primoz Flis einen der wenigen Doppelsiege feiern. Das Damenduo Martina Nöst / Zita Banhegyi legte mit einem Zweisatzsieg nach.<br>Flis feiert Premierensieg<br>Sieben Mal traf bislang Primoz Flis auf seinen Angstgegner Lukas Rebhandl – beim achten Mal klappte es endlich mit dem ersten Sieg. Flis siegte mit 21:14, 26:24 und steuerte so wie Erik Seiwald (2 : 0 gegen Simon Rebhandl) zwei Punkte bei. Schwerer als erwartet tat sich Martina Nöst – letztlich siegte sie aber in zwei Sätzen und fixierte damit den ersten Saisonsieg für Vorchdorf.<br>„<em>Wir haben heute erstmals auch die engen Partien für uns entscheiden können,</em>“ freute sich UBC Obmann Harald Starl über den gelungenen Abschluss. Als Tabellenschlusslicht muss nun UBC Vorchdorf in die Relegation mit den aufstiegswilligen Landesliga Meistern. Wahrscheinlich wird ein Wiener Team mit Vorchdorf um den Verbleib in der Badminton Bundesliga kämpfen. Die Relegationsspiele finden am 12. Mai 2018 statt.</p><p><strong>BC Raiffeisen Alkoven (Simon Rebhandl]</strong><br>Aufgrund der Tabellensituation konnten wir unseren jungen Spielern ein Chance geben und verzichteten auf Verstärkung aus Wien. Deshalb konnten wir auch noch eine Aufstellungsvariante in den Doppelspielen versuchen, die uns allerdings kein Glück brachte. Die knappe 3:5 Niederlage geht natürlich so in Ordnung. Trotzdem freuen wir uns riesig über den Klassenerhalt und auf eine weitere Saison in der zweiten Bundesliga. </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-28","/content/news/2-Bundesliga-Union-Ohlsdorf-holt-dritten-Platz/5ba2a870301cc.png","7");
INSERT INTO news VALUES("951","2-OEBV-A-RLT","2. ÖBV A-RLT","2","OEBV-RLT||Top-News||","<h2>2. ÖBV A-RLT</h2><p>                <img src=\"/content/news/2-OEBV-A-RLT/5ba2a88c99e50.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Das zweite A-RLT in Pressbaum brachte für die Spieler/innen aus OÖ einige Top-Platzierungen. Besonders Florian Baumgartner (Union Ohlsdorf) spielte sich dabei in den Mittelpunkt. </strong></p><p><em>Foto: Florian Baumgartner (links) beim Bundesliga-Doppel mit Michael Schausberger</em></p><p>Er konnte das Mixeddoppel mit Alexandra Mathis gewinnen. Auf dem dritten Platz landeten Nadine Reiter und Michael Schausberger (Union Ohlsdorf). Im Damendoppel konnte leider keine OÖ-Paarung vorne mitspielen. Der Turniersieg ging an Sabrina Herbst und Alexandra Mathis. Im Herrendoppel war es wieder Florian Baumgartner der mit Partner Philipp den zweiten Platz erspielen konnte. Weiters am Podest Simon und Lukas Rebhandl (Sportunion Windischgarsten) auf dem dritten Platz. Das Dameneinzel wurde, in Abwesenheit von Katharina Hochmeier und Jana Haas, ohne Podestplatz für OÖ beendet. Beste Spielerin war Nadine Reiter (Union Ohlsdorf) mit dem guten 8. Platz. Im Herreneinzel holte sich wiederum Florian Baumgartner den zweiten Platz. Er konnte sich souverän bis ins Final vorspielen indem er aber leider nicht mehr zulegen konnte und sich schlussendlich Kilian Meusburger (UBSC Wolfurt) geschlagen geben musste. Hierbei wieder erwähnenswert die gute mannschaftliche Leistung (viele Spieler unter den Top 16). 5. Lukas Rebhandl, 7. Andrej Serov, 9. Michael Schausberger, 11. Simon Rebhandl und 15. Markus Ratzenböck. </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-21","/content/news/2-OEBV-A-RLT/5ba2a88c99e50.png","3");
INSERT INTO news VALUES("952","2-U19-RLT-in-Weiz","2. U19-RLT in Weiz","2","OEBV-RLT||Top-News||","<h2>2. U19-RLT in Weiz</h2><p>                <img src=\"/content/news/2-U19-RLT-in-Weiz/5ba2a8b85af4a.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/17-18_2018-Weiz-Gruppe-U19-2_RLT.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/17-18_2018-Weiz-Gruppe-U19-2_RLT-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/17-18_2018-Weiz-Gruppe-U19-2_RLT-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Von 17. bis 18. März fand das 2. Jugendranglistenturnier statt. Viele aus dieser Klasse spielen aufgrund ihrer guten Leistung bereits bei den B bzw. A Turnieren, wodurch immer mehr jüngere Spieler/innen aufrücken und der Altersdurchschnitt sinkt.</strong></p><p>Die 15 Oberösterreicher/innen konnten einen Turniersieg, sowie drei 3. Plätze verbuchen:<br>Die Ältesten, Eva Rebhandl (UNION Windischgarsten) und Jan-Matteo Brüggenwerth (ASKÖ Linz), waren dabei am erfolgreichsten. Sie konnten den Mixedbewerb sogar ohne Satzverlust gewinnen. Im Einzel und im Doppel mit ihrer Partnerin Helena Mairhofer (ABV Wels) sicherte sich Eva den 3. Rang. Auch Jan-Matteo durfte sich ein weiteres Mal auf das Stockerl begeben: Zusammen mit Jannik Auberger (ASKÖ Traun) belegte er den 3. Platz.</p><p>Nun wird es besonders für die älteren Spieler/innen darauf ankommen sich im Erwachsenenbadminton zu behaupten und sich in den diversen C, B oder A Turnieren weiter zu verbessern. </p><p>Vielen Dank an die Betreuer für die Organisation und die Unterstützung an diesem Wochenende.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-21","/content/news/2-U19-RLT-in-Weiz/5ba2a8b85af4a.png","5");
INSERT INTO news VALUES("953","2-RLT-Durchgang-OEsterr-Schuelerturnier-in-Voecklabruck","2. RLT-Durchgang: Österr. Schülerturnier in Vöcklabruck","2","OEBV-RLT||Top-News||","<h2>2. RLT-Durchgang: Österr. Schülerturnier in Vöcklabruck</h2><p>                <img src=\"/content/news/2-RLT-Durchgang-OEsterr-Schuelerturnier-in-Voecklabruck/5ba2a9104eb57.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerehrung-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am 10./11. März 2018 fand das 2. Österreichranglistenturnier der Schüler (U13 und U15) statt, in dem die Sieger der Bewerbe Damen- und Herreneinzel, Mixed, Damen- und Herrendoppel gekürt wurden.<br> Austragungsort war zum ersten Mal die Bezirkssporthalle in Vöcklabruck, in der insgesamt 8 Spielfelder und 1 Trainingsfeld zur Verfügung standen. Als Veranstalter fungierte der Verein von Union Ohlsdorf, der nicht nur eine schöne Halle, sondern auch ein tolles Buffet vorzuweisen hatte.</strong></p><p>Die größte Anzahl an Spielern bei der geringen Teilnehmeranzahl stellte Oberösterreich. Die Turnierleitung wickelte das Turnier ohne Probleme ab, sodass am Sonntag um 13.00 Uhr die Sieger in allen Bewerben die Pokale, welche von der Partnerschule HTL Vöcklabruck zur Verfügung gestellt wurden, entgegennehmen konnten. In der abschließenden Verlosung konnten dann auch noch zusätzlich einige Preise der Firma VICTOR gewonnen werden.<br>Sportlich lief es für Oberösterreich sehr gut, 4 Titel und insgesamt weitere 20 Podestplätze unserer Nachwuchssportler zeigen, dass wir auf einem guten Weg sind.<br>Besonders hervorzuheben ist die Leistung der Union Ohldorf-Spielerin Kira Dlapka, die in allen Bewerben den ersten Platz erspielte, im Doppel mit ihren Trauner Partnerin Ronja Auberger, im Mixed mit ihrem Vereinskollegen Jonas Windauer. Den vierten Titel für Oberösterreich holte Kiras Schwester Sarah Dlapka mit ihrer Vorarlberger Partnerin im Damendoppel.</p><p>Die genauen Ergebnisse können unter folgendem Link nachgelesen werden: <a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=9FF6D719-798D-4436-816D-3A2F11E8285B\"><em><strong>2. ÖBV U13/U15 RLT 2018</strong></em></a></p><p><strong>[Bericht: Union Ohlsdorf – Stephan Dlapka]</strong></p>","2018-03-19","/content/news/2-RLT-Durchgang-OEsterr-Schuelerturnier-in-Voecklabruck/5ba2a9104eb57.png","6");
INSERT INTO news VALUES("954","SPORTampFUN-Messe-Ried","SPORT&FUN Messe Ried","2","Nachwuchs||Top-News||","<h2>SPORT&FUN Messe Ried</h2><p>                <img src=\"/content/news/SPORTampFUN-Messe-Ried/5ba2a931a9bce.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Sport-und-Fun.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Sport-und-Fun-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Sport-und-Fun-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>OÖVB Badmintonstand SPORT&FUN Sportmesse Ried</strong></p><p><strong> </strong></p><p><strong>Am Wochenende hat der OÖBV, vertreten durch Union Neuhofen, wie alljährlich den OÖBV-Badmintonstand auf der SPORT&FUN Sportmesse Ried betrieben.</strong></p><p>Am Freitag war Schultag auf der Messe, hier waren RABEL Andreas und RATHENBÖCK Elisabeth im Einsatz und haben den Schüler/-innen den Badmintonsport etwas näher gebracht.</p><p>Am Samstag gab es ein Freundschaftsmatch im Meisterschaftsmodus gegen Sportunion Schlierbach mit SATTELBERGER Szilvia, SATTELBERGER Gerhard, JUNGWIRTH Philipp, JUNGWIRTH Manuela, WEILHARTNER Lydia und RABEL Andreas.</p><p>Am Sonntag war Peter Zauner mit seinen BORG-Schülern am Messestand vertreten.</p><p><strong>Danke an alle Beteiligten insbesondere Andreas Rabel für die Durchführung!</strong></p><p><strong> </strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-15","/content/news/SPORTampFUN-Messe-Ried/5ba2a931a9bce.png","4");
INSERT INTO news VALUES("955","1-Bundesliga-ndash-Traun-verliert","1. Bundesliga – Traun verliert","2","Bundesliga||Top-News||","<h2>1. Bundesliga – Traun verliert</h2><p>                <img src=\"/content/news/1-Bundesliga-ndash-Traun-verliert/5ba2a962c35ef.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat am Wochenende im Ländle gegen BC Feldkirch mit 1:7 verloren. Die Trauner hatten aber nicht den kompletten Kader zur Verfügung und setzten deshalb auch Nachwuchsspieler ein. Die Niederlage ist daher sicherlich zu verschmerzen weil auch der erste Platz im Grunddurchgang bereits fixiert ist. Für das Play-Off sollten die Trauner wieder auf alle Stammkräfte zurückgreifen können. </strong></p><p><strong> </strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-05","/content/news/1-Bundesliga-ndash-Traun-verliert/5ba2a962c35ef.png","9");
INSERT INTO news VALUES("956","2-Bundesliga-ndash-Ohlsdorf-gewinnt-OOE-Derby","2. Bundesliga – Ohlsdorf gewinnt OÖ-Derby","2","Bundesliga||Top-News||","<h2>2. Bundesliga – Ohlsdorf gewinnt OÖ-Derby</h2><p>                <img src=\"/content/news/2-Bundesliga-ndash-Ohlsdorf-gewinnt-OOE-Derby/5ba2a98024300.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2017-10-22__MG_1433-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Union Ohlsdorf hat am Wochenende das OÖ-Derby Zuhause gegen UBC Vorchdorf gewonnen. Die Begegnung war hart umkämpft, das Ergebnis mit 7:1 allerdings sehr klar. Alle vier 3-Satz-Partien gingen dabei an die nervenstarken Gastgeber. BC Raiffeisen Alkoven musste sich dem überlegenen Tabellenführer ASV Pressbaum ebenfalls Zuhause mit 2:6 geschlagen geben. Bitter die Niederlage des BSC 70 Linz, die im direkten Duell um die Play-Off-Plätze gegen Badminton Moving Wr. Neustadt mit 2:6 den Kürzeren zogen.<br> Damit stehen mit Pressbaum und Wr. Neustadt die beiden Play-Off Teilnehmer fest. </strong></p><p><strong>Statement BSC 70 Linz (Reinhard Hechenberger)</strong></p><p>Minimalziel der Saison wäre damit erreicht<br>Wir auch zuletzt musste, wenn wir eine kleine Chance haben wollen, Siege über die Doppel-Spiele gehen.<br>Heute konnten wir leider nur 1 Doppel gewinnen. Das 2. Doppel ging trotz Matchball im 2. Satz dann im 3. Satz an die Wr. Neustädter.</p><p>Das Damen Doppel hielt lange Zeit das Spiel auch offen musste sich aber schlussendlich mit 21:17 21:16 geschlagen gegeben.</p><p>Statement des Obmanns des BSC 70 Linz  nach dem Spiel gegen Wr. Neustadt<br>„<em>Dass wir nun wegen dem Satzergebnis „nur“ an 4. Stelle stehen schmerzt etwas. Leider war die Hinrunde nicht ganz wie erhofft. Nächste Runde spielen wir gegen Tabellenführer Pressbaum um eventuell den dritten Platz in der Tabelle zurückzuholen</em>“</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-03-05","/content/news/2-Bundesliga-ndash-Ohlsdorf-gewinnt-OOE-Derby/5ba2a98024300.png","5");
INSERT INTO news VALUES("957","Start-in-die-Best-off-3-Serie-mit-Sieg-im-Auswaertsspiel","Start in die Best-off-3 Serie mit Sieg im Auswärtsspiel!","2","Bundesliga||Top-News||","<h2>Start in die Best-off-3 Serie mit Sieg im Auswärtsspiel!</h2><p>                <img src=\"/content/news/Start-in-die-Best-off-3-Serie-mit-Sieg-im-Auswaertsspiel/5ba2a99f627eb.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42197.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Spannung pur beim Auftakt zum Badminton- Bundesliga Finale in Vorarlberg. ASKÖ Traun startete am Samstag den 28.4. mit einem knappen 4:3 Erfolg gegen Titelverteidiger UBSC Wolfurt in die Best-of-3 Serie um den Österreichischen Meistertitel. Dabei wurden 5 der 7 Spiele erst im 3. Satz, und das zum Teil denkbar knapp, entschieden.</strong></p><p>Mit dem Sieg im Ländle liegen die Oberösterreicher in der Serie mit 1:0 in Führung und könnten bereits im 1. Heimspiel am <strong>5.5.2018 um 16 Uhr</strong> in Traun den 13 Titel fixieren. Der letzte Erfolg stammt aus dem Jahr 2011. Ein allenfalls erforderliches 3. Spiel käme dann am Sonntag den 6.5.2018, ebenso in Traun, zur Austragung. Allerdings bedarf es einer abermaligen Spitzenleistung um gegen den Titelverteidiger bestehen zu können.</p><p><strong>Kommentar nach dem Spiel:</strong><br>„<em>Dieses Mal waren wir am Ende der spannenden Begegnungen  die Glücklicheren. Die Revanche für die vorjährige Auswärtsniederlage ist vorerst geglückt. Die Stimmung in der Halle war teilweise so laut, dass man das eigene Wort nicht verstand. Das sehr fachkundige und  faire Heim-Publikum trieb ihre Vorarlberger Mannschaft zu Höchstleistungen, unsere Mannschaft  konnte aber äußerst erfolgreich dagegen halten.<br> In einer Woche rechnen wir beim Heimspiel mit einer ähnliche Unterstützung, sodass das Heimrecht beim 2. und wenn erforderlich beim 3. Spiel, ein kleiner Vorteil für uns sein kann. Die O.Ö. Badmintonfans werden sich dieses Spitzenereignis nicht entgehen lassen. Schließlich wird eine Trauner bzw. eine O.Ö. Mannschaft nicht so schnell Staatsmeister. Die gesamte Mannschaft freut sich auf das Badmintonereignis des Jahres</em>“</p><p>Die Detailergebnisse können auf der <a href=\"http://obv.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=6\"><em><strong>Tournamentsoftware</strong></em></a> nachgelesen werden. </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-04-30","/content/news/Start-in-die-Best-off-3-Serie-mit-Sieg-im-Auswaertsspiel/5ba2a99f627eb.png","8");
INSERT INTO news VALUES("958","6-OOEBV-MD-RLT-in-Andorf","6. OÖBV-MD-RLT in Andorf","2","OOEBV-RLT||Top-News||","<h2>6. OÖBV-MD-RLT in Andorf</h2><p>                <img src=\"/content/news/6-OOEBV-MD-RLT-in-Andorf/5ba2a9bca7b60.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_4529-1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_4529-1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_4529-1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>6. OÖBV-MD-RLT in Andorf</strong></p><p><strong> </strong></p><p><strong>Am 22.04.2018 fand bei sommerlichen Temperaturen das sechste OÖBV Doppel-RLT MD statt, ein Turnier das der ATV Andorf zum ersten Mal ausrichtete und mit zwanzig Mixed-Doppeln aus Oberösterreich, Salzburg und Bayern ein tolles Nennergebnis erzielte. Nach spannenden Spielen und einem tollen Finale standen gegen 16:00 Uhr die Sieger fest. Nach drei hart umkämpften Sätzen konnten sich Gaby und Christian Götzinger vom TSV Freilassing gegen den   Lokalmatador Christoph Hajek mit Partnerin Denise Sendlhofer (BC Windischgarsten) durchsetzen, den dritten Platz belegten Reifetshamer Michela/Jürgen Schmidt vom UBC Neuhofen vor Andrea Schned (BC Pasching) mit Partner Thomas Leierzopf (ASK Nettingsdorf).</strong></p><p>Alle Ergebnisse sind auf der <a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=EDB45DE0-EA80-4CE7-A63D-32D19437C59A\"><em><strong>Tournamentsoftware</strong></em></a> nachzulesen. </p><p><em>Ein spannendes Turnier mit toller Atmosphäre, das nach einer Wiederholung im nächsten Jahr verlangt, wir freuen uns auf ein Wiedersehen.</em></p><p><strong>[Bericht: Christina Hofinger]</strong></p>","2018-04-23","/content/news/6-OOEBV-MD-RLT-in-Andorf/5ba2a9bca7b60.png","9");
INSERT INTO news VALUES("959","6-Senior-Masters-in-Traun","6. Senior Masters in Traun","2","OOEBV-RLT||Top-News||","<h2>6. Senior Masters in Traun</h2><p>                <img src=\"/content/news/6-Senior-Masters-in-Traun/5ba2a9ded05e8.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Ohne-Titel-1-Kopie.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Ohne-Titel-1-Kopie-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Ohne-Titel-1-Kopie-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun veranstaltet am 12. und 13. Mai 2018 das 6. Senior Masters. Auch heuer wird wieder einiges geboten (Details und Ausschreibung bekommen alle Vereine per E-Mail zugesendet). </strong></p><p><strong> </strong></p><p><strong>Neu in diesem Jahr: Training am Freitag-Abend mit Erbeerbowle, Freitag, 11. Mai 2018, 19.30 bis 21.30 im BundesschulzentrumTraun – keine Teilnahmegebühr, Bälle werden von der Fa. Babolat gestellt. Begrenzte Teilnehmerzahl, eine Anmeldung für das Training ist erbeten. Nach dem Training sind alle Gäste zu einer Erdbeerbowle eingeladen.</strong></p><strong> <p>Nennschluss ist der 07. Mai 2018!</p> </strong><p></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-04-19","/content/news/6-Senior-Masters-in-Traun/5ba2a9ded05e8.png","8");
INSERT INTO news VALUES("960","Askoe-Traun-zieht-souveraen-ins-Bundesliga-Finale-ein","Askö Traun zieht souverän ins Bundesliga Finale ein!","2","Bundesliga||Top-News||","<h2>Askö Traun zieht souverän ins Bundesliga Finale ein!</h2><p>                <img src=\"/content/news/Askoe-Traun-zieht-souveraen-ins-Bundesliga-Finale-ein/5ba2aa0117e37.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DM42197.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DM42197-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat sich am Wochenende vor Heimpublikum die Teilnahme am Bundesligafinale gesichert. Die Trauner, die den Grunddurchgang dominierten, setzten sich gegen BC Monfort Feldkirch mit 6:1 durch. Die wie immer starken Einzelleistungen Trauns setzten den Grundstein für den Erfolg. Wolfgang Gnedt, Jürgen Koch (Foto), Collins-Valentine Filimon und Lisa Heidenreich konnten ihre Einzel klar gewinnen. Das bewährte Herrendoppel Jürgen Koch / Peter Zauner und das Mixeddoppel Collins-Valentine Filimon / Janine Lais fixierten das 6:1. Das 2. Herrendoppel kam nicht mehr zur Austragung. </strong></p><p>Damit kommt es wie im Vorjahr zum Finalduell mit dem UBSC Wolfurt – also Vizemeister gegen Meister. Im Grunddurchgang konnten sich die Trauner jeweils mit 5:3 durchsetzen. Auch hier sehr auffällig die 4 gewonnen Einzelpartien der Trauner. Sollte es Wolfurt dieses Jahr nicht gelingen eines der Einzel für sich zu entscheiden wird es ganz schwer Traun zu besiegen. Und mit dem Comeback von Peter Zauner wurden auch die Herrendoppel wieder gestärkt. Sollten bei Traun also alle Spieler/innen fit bleiben gehen sie wohl als leichte Favoriten in die am Samstag, 28. April 2018 beginnende „Best of Three – Serie“. </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-04-16","/content/news/Askoe-Traun-zieht-souveraen-ins-Bundesliga-Finale-ein/5ba2aa0117e37.png","6");
INSERT INTO news VALUES("961","OOE-Jugendturnier-in-Kirchdorf","OÖ Jugendturnier in Kirchdorf","2","Nachwuchs||Top-News||","<h2>OÖ Jugendturnier in Kirchdorf</h2><p>                <img src=\"/content/news/OOE-Jugendturnier-in-Kirchdorf/5ba2aa1ebacc1.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/sieger-alle-rlt-kirchdorf-2018-04-06-Kopie.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/sieger-alle-rlt-kirchdorf-2018-04-06-Kopie-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/sieger-alle-rlt-kirchdorf-2018-04-06-Kopie-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Mit 51 Teilnehmern war das letzte Schüler und Jugendturnier der Saison 2017/18 trotz strahlendem Sonnenschein ein schöner Nennerfolg.</strong></p><p><strong> </strong></p><p><strong>Mit Jannik Auberger(ASKÖ Traun) konnte sich der Favorit der Jugend gegen Carle Brüggenwerth(ASKÖ Linz Badminton) und Stefan Schausberger (Sportunion Ohlsdorf) durchsetzen. In der Jugend der Damen siegte Kira Dlapka(Sportunion Ohlsdorf) in einem spannenden 3-Satz-Finale  vor ihrer Vereinskollegin Sandra Stadlmayr (Sportunion Ohlsdorf). Den dritten Platz erreichte Carolina Mittermayr (ATV Andorf). </strong></p><p>Im Herreneinzel U15 konnte Elias Spitzhofer (ASKÖ Traun) in spannenden Spielen gegen seinen Vereinskollegen Marco Stockinger (ASKÖ Traun) und Sebastian Huber (Union Ohlsdorf) gewinnen.<br>Der erste Platz DE U15 geht ebenfalls an die Sportunion Ohlsdorf, Sarah Dlapka gewann vor Lara Stockinger (ASKÖ Traun) und Tabea Stierberger (BC Raiffeisen Alkoven).<br>HE U13 Sieger im Gruppenspiel ist Lorenz Windauer (Sportunion Ohlsdorf). Den zweiten Platz erreichte Benjamin Maier (BC Raiffeisen Alkoven) vor Phillipp Klambauer (Union Kirchdorf).<br>Bei den U13 Damen siegte Hanna Gillesberger (Sportunion Ohlsdorf) vor Raffaella Frühauf (BC Raiffeisen Alkoven) und Emma Manjic (BC Raiffeisen Alkoven).<br>Bei unseren Jüngsten in der U11, wurde Eric Hayböck aus Windischgarsten Erster, der zweite und dritte Platz gehen an Sportunion Ohlsdorf mit Puschl Alexander und Kreiseder Florian.    </p><p>Zusammengefasst ein tolles Turnier mit spannenden Spielen dass in gewohnt reibungsloser Art in Kirchdorf ausgerichtet wurde. Die Gewinner wurden um ca. 14 Uhr mit Pokalen, Medaillen und Urkunden von der Turnierleitung belohnt.  </p><p><strong>Danke an mein tolles Team für die Unterstützung!</strong></p><p><strong> </strong></p><p><strong>[Bericht: Sandra Kranzl – Union Kirchdorf]</strong></p>","2018-04-10","/content/news/OOE-Jugendturnier-in-Kirchdorf/5ba2aa1ebacc1.png","5");
INSERT INTO news VALUES("962","Bundesliga-Semifinale","Bundesliga Semifinale","2","Bundesliga||Top-News||","<h2>Bundesliga Semifinale</h2><p>                <img src=\"/content/news/Bundesliga-Semifinale/5ba2aa577bc54.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>ASKÖ Traun starten mit überzeugendem 5:1 Auswärtssieg</strong></p><p>ASKÖ Traun besiegte im ersten Spiel der best-of -3 um den Einzug ins Endspiel der diesjährigen Titelentscheidung BC Feldkirch. Die Trauner waren bereits nach 6 von 8 möglichen Spielen uneinholbar mit 5:1 in Führung und stellten damit in der Serie auf 1:0.</p><p>Es war vom ersten Spiel an eine überzeugende Leistung, sodass der Sieger an diesem Tag nicht in Frage stand. Jetzt heißt  es für das Rückspiel am nächsten Samstag  die Vorbereitung  so konsequent wie in der Vorwoche weiter zu betreiben um die Finalteilnahme zu sichern.</p><p>Im 2. Halbfinale besiegte Vorjahresmeister UBSC Wolfurt Kelag Kärnten in Klagenfurt mit 5:3</p><p>Kommentar nach dem Spiel in Vorarlberg:</p><p><em>„Wir sind mit einer klaren Vorstellung nach Feldkirch gereist und haben unser Konzept konsequent umgesetzt. Das Comeback des langzeitverletzten Peter Zauner im Herren- Doppel mit Jürgen Koch ist gelungen. Damit sind unsere  Möglichkeiten auch für die nächsten Begegnungen bei der  Aufstellung deutlich besser. Alle anderen Mannschaftsmitglieder haben die in sie gesetzten Erwartungen total erfüllt. Wir freuen uns bereits auf das Retourspiel in einer Woche im Trauner Stadion und hoffen, mit einer erneut  starken Leistung, den Finaleinzug zu fixieren. Unterschätzen werden wir die ambitionierten Vorarlberger sicher nicht.“</em></p><p><strong>2. Spiel der Best of 3 Serie:</strong></p><p><strong> </strong></p><p><strong>ASKÖ Traun gegen BC Feldkirch</strong></p><strong> </strong><p></p><p><strong>Samstag 14. April 2018 um 16 Uhr im Sportzentrum Traun</strong></p><p>wenn erforderlich 3. Spiel:</p><p>Sonntag 15 April 2018 um 12 Uhr ebenso im Sportzentrum Traun</p><p>[Bericht: Askö Traun]</p>","2018-04-08","/content/news/Bundesliga-Semifinale/5ba2aa577bc54.png","5");
INSERT INTO news VALUES("963","1-Halbfinale-der-Play-off-Serie","1. Halbfinale der Play-off Serie","2","Bundesliga||Top-News||","<h2>1. Halbfinale der Play-off Serie</h2><p>                <img src=\"/content/news/1-Halbfinale-der-Play-off-Serie/5ba2aa7471082.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/ASKÖ-Traun-gegen-WBH-Wien-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>ASKÖ Traun startet mit Auswärtsspiel in die Titelentscheidung!</strong></p><p>Am 7.4.2018 beginnt die Halbfinal- Best- of -3 Serie um den Titel des österr. Mannschaftsmeisters 2018 mit einem Auswärtsspiel in Vorarlberg. ASKÖ Traun trifft  als  Sieger des Grunddurchganges auf die 4. platzierte Mannschaft aus Vorarlberg.</p><p>BC Feldkirch gegen ASKÖ Traun<br>Termin:7.April 2018<br>Zeit:  15 Uhr<br>Ort:   Oberauhalle Feldkirch</p><p>Das 2. Spiel  und wenn erforderlich eine 3. Begegnung, findet eine Woche später im Trauner Sportzentrum statt.</p><p>Im 2. Halbfinale stehen sich in Klagenfurt  ASKÖ Kelag Kärnten und der Titelverteidiger UBSC Wolfurt gegenüber.</p><p><strong>Einschätzung von Manager Herbert Koch vor der Begegnung:</strong></p><p><em>Im Grunddurchgang haben wir gegen die Vorarlberger einmal gewonnen und einmal verloren. Wenn bis zum Wochenende alle unsere Mannschaftsmitglieder fit bleiben, können wir zum ersten Mal komplett antreten. Die interessante Mischung aus Routiniers wie Jürgen Koch und Peter Zauner, Lisa Heidenreich und Jakob Ostermann, sowie die Nachwuchskräfte wie Wolfgang Gnedt, Collins Filimon, Lena Zinganell, Laura Hauser und Janine Lais lassen ein spannendes Spitzenspiel  erwarten. Der Aufsteiger BC Feldkirch verfügt über eine talentierte, junge Mannschaft, die uns total fordern wird. Wir wollen im Auswärtsspiel eine gute Basis für das Rückspiel in einer Woche in Traun schaffen. Am Samstag ist der  in den letzten Trainingseinheiten gezeigte Einsatz und die hohe Motivation  erforderlich, um in Feldkirch bestehen zu können. Vielleicht gelingt uns der nächste Schritt zum 13. Meistertitel.</em></p><p>[Bericht: Askö Traun]</p>","2018-04-05","/content/news/1-Halbfinale-der-Play-off-Serie/5ba2aa7471082.png","4");
INSERT INTO news VALUES("964","7-OOEBV-Doppel-RLT-DD-HD-MD-in-Haid","7. OÖBV Doppel-RLT (DD, HD, MD) in Haid","2","OOEBV-RLT||Top-News||","<h2>7. OÖBV Doppel-RLT (DD, HD, MD) in Haid</h2><p>                <img src=\"/content/news/7-OOEBV-Doppel-RLT-DD-HD-MD-in-Haid/5ba3e36db5612.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_7_OÖBV_Doppel-RLT_27.05.2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Am Sonntag den 27. Mai, bei sonnigem und warmen Sommertemperaturen, war abermals die Sporthalle Haid der Austragungsort für ein Turnier der OÖBV-Doppel-Turnier-Serie. Die Entscheidung bei diesem Mischturnier auf kurze Sätze mit Verlängerung bis maximal 20 Punkte zu spielen hat sich bewährt und macht Sinn. </strong></p><p>Unter den 56 Teilnehmer/Innen aus 19 verschiedenen Vereinen waren einige junge sowie viele junggebliebene mit Begeisterung beim Matchen. 8 Damen-Doppel, 18 Herren-Doppel und ebenfalls 18 Mixed-Doppel lieferten sich auf 6 Spielfeldern schweißtreibende, spannende und leider nicht ganz verletzungsfreie Spiele. Auf diesem Wege eine baldige Genesung für Tina Plank und Gaby Götzinger.<br>Das Turnier startete um 10:00 Uhr und wurde mit der Mixed-Siegerehrung um 18:30 Uhr beendet. Alle Gewinner/Innen sind in der <a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=EFD2F585-D638-4E1A-9FE1-E6D4BA4786AA\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p><em>Ein herzliches und großes DANKE, an alle Teilnehmer/Innen sowie an meine Helferlein Roswitha, Kerstin, Klaus und Josef vom ASK Nettingsdorf-Badminton/Racketlon für den guten Turnierablauf. Die Turnieranmeldung per PC kurz „TA“ genannt oder die „TA-App“ für Smartphone, IOS oder Android wird für die nächsten Turniere im Herbst so Mitte September wieder aktiv geschaltet sein.</em></p><p><strong>[Bericht: Peter Krenmayr]</strong></p>","2018-05-30","/content/news/7-OOEBV-Doppel-RLT-DD-HD-MD-in-Haid/5ba3e36db5612.png","7");
INSERT INTO news VALUES("965","Mitgliederversammlung-2018","Mitgliederversammlung 2018","2","Top-News||Verbandsintern||","<h2>Mitgliederversammlung 2018</h2><p>                <img src=\"/content/news/Mitgliederversammlung-2018/5ba3e38e98e58.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_0946.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_0946-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_0946-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Die Mitgliederversammlung 2018 war heuer sehr gut besucht. 19 Vereine (teilweise in mit großer Abordnung) diskutierten über die letzten 3 Jahre und über zukünftige Themen. Auch ÖBV Präsident Harald Starl kam direkt von den Thomas & Uber Cup Finals zur Mitgliederversammlung. Er konnte in seinem sehr interessanten Kurzvortrag von den (nicht beschlossenen) Regeländerungen der Generalversammlung des BWF in Bangkok berichten. Außerdem gab er Eindrücke vom Thomas & Uber Cup an die Teilnehmer der Mitgliedersammlung weiter. </strong></p><p>Folgende Themen wurden besprochen:</p><p>Genehmigung des Protokolls der letzten Jahreshauptversammlung – einstimmig (31 Stimmen)<br>Ehrung der Mannschaftsmeister der Saison 2017-2018 der Ligen<br>Rechenschaftsbericht des Verbandsvorstandes Bericht der Kontrolle, Entlastungsantrag und Abstimmung<br>Behandlung satzungsmäßig vorliegender Anträge<br>Bericht des Wahlkomitees mit Durchführung der Wahl des Verbandsvorstandes, der Kontrolle und der Mitglieder des Schiedsgerichtes<br>Vorschau auf die nächste Saison<br>Allfälliges</p><p><strong>Es wurden neue Mitglieder in den Vorstand gewählt und der bisherige Vorstand erneut gewählt. Der neue Vorstand ist bereits auf der Homepage veröffentlicht. Neu im Team sind Peter Krenmayr (Breitensportreferent), Stephan Dlapka (Nachwuchsreferent), Markus Eckersberger (Schiedsrichterreferent) und Peter Schwarzmann (Marketing). </strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-05-28","/content/news/Mitgliederversammlung-2018/5ba3e38e98e58.png","7");
INSERT INTO news VALUES("966","UBC-Vorchdorf-sagt-nach-25-Jahren-ade-ndash-Relegation-knapp-verloren","UBC Vorchdorf sagt nach 25 Jahren ade – Relegation knapp verloren","2","Bundesliga||Top-News||","<h2>UBC Vorchdorf sagt nach 25 Jahren ade – Relegation knapp verloren</h2><p>                <img src=\"/content/news/UBC-Vorchdorf-sagt-nach-25-Jahren-ade-ndash-Relegation-knapp-verloren/5ba3e3a93bc60.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20170211-UBC_Vorchdorf-0297-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>UBC Vorchdorf verliert das Aufstiegsturnier 2018/2019</strong></p><p><strong> </strong></p><p><strong>Schade! UBC Vorchdorf muss nach 25 Jahren Bundesliga erstmals absteigen – die Vorchdorfer verloren das Relegationsspiel gegen VRC Badminton Vienna knapp mit 3:5. Vorchdorf konnte in Bestbesetzung gegen die Wiener Legionärstruppe antreten und von Anfang an war klar, dass vor allem die vier kroatischen Spieler in den Reihen der Wiener der „Knackpunkt“ sein werden.</strong></p><p>Ausgeglichen gestaltete sich der Start – nach den beiden Herrendoppel stand es 1 : 1, wobei Dominik Kronsteiner / Erik Seiwald für Vorchdorf punkteten. Die ansonsten erfolgsverwöhnten Vorchdorfer Damen konnten den beiden kroatischen Ex-Teamspielerinnen nichts entgegen setzen und verloren klar.UBC Youngster Zalar überragendDas Topeinzel zwischen Tilen Zalra und Igor Cimbur war wohl eines der besten Topeinzelpartien der letzten Jahre – in einem Marathonspiel konnte sich der 20-jährige UBC-Neuling Zalar mit 21:16, 18:21, 21:18 duchsetzen und abermals ausgleichen. Primoz Flis kämpfte aufopfernd, musste sich aber in drei Sätzen knapp geschlagen geben. Den „Todesstoss“ setzte die Niederlage von Martina Nöst gegen Drvodelic. Zwar konnte Erik Seiwald noch einmal mit einem 2 : 0 Satzsieg verkürzen, ehe die Mixedniederlage von Dominik Kronsteiner / Zita Banhegyi den 3 : 5 Endstand bedeutete. Damit muss UBC Vorchdorf nach 25 Jahren Bundesliga Zugehörigkeit in die OÖ. Landesliga absteigen.</p><p><strong>Kommentar von UBC Vorchdorf Manager Harald Starl: </strong><br>Beste Saisonleistung war zu wenig. Besonders ärgerlich ist aus Vorchdorfer Sicht die Tatsache, dass ausgerechnet die beste Saisonleistung zum Abstieg führte. Speziell bei den Damen waren die Wiener überragend. „<em>Das war der Schlüssel,</em>“ schmerzt UBC Obmann Harald Starl die Niederlage besonders. „<em>Mit dieser „Retorten-Truppe“ werden die Wiener sicher ganz vorne mitspielen.</em>“ Quo vadis UBC? UBC Vorchdorf wird in der kommenden Saison in der 1. OÖ. Landesliga antreten. Dazu muss sich der Verein nun neu aufstellen, da die Bundesligamannschaft auf keinen Fall gehalten werden kann. „<em>Wir haben nun einige Monate Zeit, eine konkurrenzfähige Mannschaft aufzustellen und dann werden wir sehen, ob ein Wiederaufstieg angestrebt wird,</em>“ so Harald Starl, der 25 Jahre lang die Bundesliga Aktivitäten der Vorchdorfer managte.</p><p>Die Ergebnisse gibt es auf <a href=\"https://obv.tournamentsoftware.com/sport/teammatch.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&match=110\"><em><strong>Tournamentsoftware</strong></em></a> zum Nachlesen.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-05-14","/content/news/UBC-Vorchdorf-sagt-nach-25-Jahren-ade-ndash-Relegation-knapp-verloren/5ba3e3a93bc60.png","5");
INSERT INTO news VALUES("967","Askoe-Traun-holt-Titel-nach-Oberoesterreich","Askö Traun holt Titel nach Oberösterreich!","2","Bundesliga||Top-News||","<h2>Askö Traun holt Titel nach Oberösterreich!</h2><p>                <img src=\"/content/news/Askoe-Traun-holt-Titel-nach-Oberoesterreich/5ba3e3c6325dc.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Askö Traun hat am Wochenende die Meisterschaft der 1. Österreichischen Bundesliga gewonnen und den Titel damit zurück nach Oberösterreich geholt. Es ist der 13. Titel für die Trauner, die mit dem Finalsieg Revanche an UBSC Wolfurt nehmen konnten, denen sie im Vorjahr noch knapp unterlegen waren. </strong></p><p><strong> </strong></p><p><strong>Die spannende „Best of Three“ – Serie</strong></p><p>In der spannenden „Best of Three“ – Serie legten die Trauner um Jürgen Koch und Peter Zauner den Grundstein für den Erfolg auswärts mit einem knappen 4:3 Erfolg. Mit unveränderter Aufstellung konnte danach im zweiten Spiel der Titel nicht fixiert werden (3:5). Es kam also, wie im Vorjahr, zum alles entscheidenden Spiel 3 tags darauf. Hier gab es eine Veränderung in der Trauner Aufstellung während die Wolfurter auf die gleiche Besetzung vertraute. Wie in den Partien zuvor konnte sich das erste Herrendoppel Jürgen Koch / Peter Zauner durchsetzen. Danach ging überraschend auch das Damendoppel die Traunerinnen (22:20 im dritten Satz). Das erste Herreneinzel und Dameneinzel gingen dann aber wieder zugunsten der Wolfurter aus – Zwischenstand 2:2. Das neu formierte Mixeddoppel Peter Zauner / Janine Lais brachte Traun mit einem zwei Satz Erfolg wieder in Führung. Das dritte Herreneinzel war danach eine klare Angelegenheit für Collins-Valentine Filimon. Somit lag es an Altmeister Jürgen Koch den Titel nach Traun zu holen. Er konnte sich erstmals in dieser Serie gegen Matevz Bajuk durchsetzen und den Meistertitel fixieren.</p><p>Die Ergebnisse der „Best of Three“ – Serie gibt es <a href=\"http://obv.tournamentsoftware.com/sport/draw.aspx?id=8B5B8973-84CA-40D2-9450-1277233E3172&draw=6\"><em><strong>Tournamentsoftware</strong></em></a> auf zum Nachlesen.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-05-08","/content/news/Askoe-Traun-holt-Titel-nach-Oberoesterreich/5ba3e3c6325dc.png","4");
INSERT INTO news VALUES("968","Badminton-Bundesliga-Finale-2018","Badminton Bundesliga Finale 2018","2","Bundesliga||Top-News||","<h2>Badminton Bundesliga Finale 2018</h2><p>                <img src=\"/content/news/Badminton-Bundesliga-Finale-2018/5ba3e3e931c71.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/PlayOffs1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>ASKÖ Traun strebt den  13. Titel an!</strong></p><p><strong> </strong></p><p><strong>Am  kommenden Wochenende findet in Traun das 2. Spiel der Best of 3 Serie um den Staatsmeistertitel 2018 statt. Die erste Begegnung haben die Oberösterreicher denkbar knapp mit 4:3 für sich entscheiden können. Damit könnte bereits am Samstag mit einem neuerlichen Erfolg der Mannschaft um Jürgen Koch und Peter Zauner die Entscheidung zu ihren Gunsten fallen. Aufgrund der Erkenntnis aus dem Hinspiel im Ländle wird allerdings eine Top- Leistung erforderlich sein, um den 13. Meistertitel wieder nach Traun zu holen.</strong></p><p><strong>Die 12 Titel wurden in den Jahren zwischen 1995 bis 2011 gewonnen, der letzte ist demnach bereits 7 Jahre aus.</strong></p><p><strong> </strong></p><p><strong>Kommentar vor der Begegnung:</strong></p><p>„<em>Aus dem Hinspiel wissen wir, dass die Serie noch längst nicht entschieden ist. Ein wichtiger Faktor wird sein, ob unsere Fans eine ähnliche Unterstützung  für unsere Mannschaft sind, wie die Vorarlberger ihr Team im Auswärtsspiel angefeuert haben. Einigermaßen zuversichtlich stimmt uns das Heimergebnis aus dem Vorjahr, es gab damals einen klaren 5:0 Erfolg. Allerdings hat sich seither die Personalie bei beiden Mannschaften geändert. Jedenfalls werden beide Mannschaften für einen hochklassigen und spannenden Sportnachmittag sorgen und vielleicht sogar den Einen oder Anderen zum Nachmachen anregen. Wir freuen uns auf eine tolle Stimmung in der Halle und eine tolle Show für die Zuschauer.</em>“</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-05-04","/content/news/Badminton-Bundesliga-Finale-2018/5ba3e3e931c71.png","5");
INSERT INTO news VALUES("969","Meraner-Fruehlingsturnier","Meraner Frühlingsturnier","2","Nachwuchs||Top-News||","<h2>Meraner Frühlingsturnier</h2><p>                <img src=\"/content/news/Meraner-Fruehlingsturnier/5ba3e4120a0b4.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_20180429_143219125.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180429_143219125-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20180429_143219125-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Meraner Frühlingsturnier – Huber Sebastian (Ohlsdorf) gewinnt U11 Einzel.</strong></p><p><strong> </strong></p><p><strong>Sechs OÖ Vereine (Andorf, Askö Linz, Kirchdorf, BC Windischgarsten, Ohlsdorf und Traun) schickten am 28./29. April Nachwuchsspieler zum Meraner Frühlingsturnier. Das zeigt, dass sich wieder was tut am Nachwuchssektor in OÖ. </strong></p><strong> <p>Mit Huber Sebastian von Ohlsdorf konnte sogar ein Sieg (U11 HE) verbucht werden. Im Finale U15 Einzel stand auch Jannik Auberger von Traun. Er musste aber hier leider wegen starker Knieschmerzen wo. geben. Einen zweiten Platz erkämpfte Sarah Dlapka (Ohlsdorf). Dritte Plätze gab es für Hanna Gillesberger, Stefan Schausberger (Ohlsdorf) und Carle Brüggenwerth (Askö Linz).</p> </strong><p></p><p><strong>[Bericht: Josef Retschitzegger]</strong></p>","2018-05-03","/content/news/Meraner-Fruehlingsturnier/5ba3e4120a0b4.png","4");
INSERT INTO news VALUES("970","Nachwuchs-spielt-mit-Bundesliga-Turnier-in-Ohlsdorf","Nachwuchs spielt mit Bundesliga Turnier in Ohlsdorf","2","Nachwuchs||Top-News||","<h2>Nachwuchs spielt mit Bundesliga Turnier in Ohlsdorf</h2><p>                <img src=\"/content/news/Nachwuchs-spielt-mit-Bundesliga-Turnier-in-Ohlsdorf/5ba3e4479210b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/2018-06-09__MG_9993.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/2018-06-09__MG_9993-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/2018-06-09__MG_9993-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Ein Turnier der besonderen Art – Nachwuchs spielt gemeinsam mit Bundesligaspielern</strong></p><p>Am 9. Juni 2018 fand in Ohlsdorf bereits zum zweiten Mal ein Nachwuchsturnier der besonderen Art statt. Bei diesem Turnier der Union Ohlsdorf durften nämlich die Nachwuchsspieler des Vereins mit ihren Vorbildern aus der Bundesliga gemeinsam spielen, was natürlich für besondere Motivation bei den jungen Spielern sorgte. </p><p>Um die Motivation noch mehr zu erhöhen, durften dabei die Nachwuchsspieler ihre Idole selbst aussuchen. Bei der anschließenden Siegerehrung und einem gemütlichen Beisammensitzen wurde nicht nur gegrillt, sondern auch noch das Turnier gemeinsam analysiert und diverse Spiele gemeinsam gespielt. </p><p>Eine wirklich gelungene Veranstaltung, die hoffentlich von vielen Vereinen nachgeahmt wird!!! Vielleicht gelingt es uns auf diese Weise, wieder mehr Kinder für den Leistungssport Badminton zu begeistern! Ein herzliches Dankeschön auch an alle teilnehmenden Bundesligaspieler, die sich Zeit nahmen, mit dem Nachwuchs zu spielen!</p><p><strong>[Bericht: Stephan Dlapka]</strong></p>","2018-06-13","/content/news/Nachwuchs-spielt-mit-Bundesliga-Turnier-in-Ohlsdorf/5ba3e4479210b.png","6");
INSERT INTO news VALUES("971","Familienglueck-perfekt-ndash-Peter-Zauner-heiratet-seine-Bianca","Familienglück perfekt – Peter Zauner heiratet seine Bianca!","2","Top-News||","<h2>Familienglück perfekt – Peter Zauner heiratet seine Bianca!</h2><p>                <img src=\"/content/news/Familienglueck-perfekt-ndash-Peter-Zauner-heiratet-seine-Bianca/5ba3e724157dc.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/image002-1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/image002-1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/image002-1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Herzliche Glückwünsche zur Hochzeit!</strong></p><p><strong> </strong></p><p><strong>Am Samstag, den 14. Juli 2018, gaben sich der Badmintonsportler und Trainer Peter Zauner und die Judosportlerin Bianca Rechberger in der vollbesetzten Pfarrkirche in Hellmondsödt   das „Jawort“. Zahlreiche Gäste aus der Sportfamilie waren ins Mühlviertel gekommen, um das glückliche Paar bei der Trauung zu begleiten. Peter überraschte seine Braut und die anwesenden Gäste mit einer gekonnten Präsentation des Liedes „all you Need is Love“. In einer Kirche, nicht alle Tage üblich, brausten nach der mutigen und gekonnten Einlage Standing -Ovationen auf. Die Überraschung ist jedenfalls perfekt gelungen.</strong></p><p>Es war eine richtige Sportlerhochzeit. Die Trauung wurde vom Klagenfurter Badminton- Sportfreund und Diakon Prof. Dr. Ludwig Trojan zelebriert. Eindrucksvoll stellte er in seiner interessanten und sinnlichen Messe immer wieder den Bezug zwischen dem Sport und der Partnerschaft in einer Ehe her. Mit vielen Beispielen erklärte er, das zahlreiche Eigenschaften, sowohl im täglichen Leben, wie auch im Sport, gleichermaßen erforderlich sind, um dort und da erfolgreich zu sein.</p><p>Bei der anschließenden Hochzeitsfeier, die bis weit nach Mitternacht andauerte, wurde in einem idyllischen Landgasthaus mit ausgezeichneter Bewirtung, Musik und Tanz gefeiert.</p><p>Wir wünschen der jungen Familie genau so viel gute Stimmung und Fröhlichkeit auf ihrem weiteren Lebensweg.</p><p>Mit der festlichen Trauung in der Kirche und bei der anschließenden Festveranstaltung war der erste Tag in der Ehe jedenfalls ein verheißungsvoller Auftakt für viele gemeinsame, schöne Jahre.</p>","2018-07-19","/content/news/Familienglueck-perfekt-ndash-Peter-Zauner-heiratet-seine-Bianca/5ba3e724157dc.png","5");
INSERT INTO news VALUES("972","Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018-2","Trainingstagebuch – Jinan, Provinz Shandong China 2018","2","International||Nachwuchs||Top-News||","<h2>Trainingstagebuch – Jinan, Provinz Shandong China 2018</h2><p>                <img src=\"/content/news/Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018/5ba3e7563a94d.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_1954.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1954-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1954-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Oberösterreichs Tischtennis- und Badmintonnachwuchs trainiert bei den besten der Welt in China</strong></p><p><strong> </strong></p><p><strong>Bereits zum 2. Mal trainieren Oberösterreichs Tischtennis- und Badmintontalente in der chinesischen Millionen-Stadt Jinan (Provinz Shandong). Diese einmalige Chance einer Sportkooperation ergab sich durch die wirtschaftliche Kooperation des Sportland OÖ und der Provinz Shandong. </strong></p><p>Kommentar der beiden Landestrainer Phillipp Aistleitner (Tischtennis) und Peter Zauner (Badminton):</p><p>„<em>Wir sind jetzt schon zum 2. Mal in Jinan. Für uns ist es jeden Tag beeindruckend mit welcher Professionalität und Einstellung hier gearbeitet wird. Wir versuchen zusammen mit unseren jungen Talenten die Atmosphäre hier aufzusaugen uns sie so gut es geht im österreichischen Trainingsalltag einzubauen.</em>“</p><p><strong>Trainingstagebuch von Jannik Auberger:</strong></p><p>Die Reise ging am 14.8. um 13:30 Uhr los. Am Anfang der langen Anreise nach China gab es schon Komplikationen wegen eines Koffers, der ohne Besitzer am Flughafen stand. Nach einer kurzen Verzögerung durch die großräumige Absperrung konnten wir uns dann Richtung Gate begeben. Der Flug hob pünktlich ab und die Flugzeit betrug 8h 40 min. Während des Fluges gab es einige kleine Turbulenzen, doch sonst war er sehr angenehm.</p><p>Als wir in China angekommen sind haben wir den Bus genommen Richtung Bahnhof. Wir machten einen kurzen Halt in einem Restaurant und wir nahmen die erste Mahlzeit in China ein. Den Schnellzug nahmen wir um 11:40 und wir fuhren ein bisschen mehr als zwei Stunden.<br>Am Bahnhof in Jinan wurden wir von den Trainern abgeholt und fuhren dann mit dem Bus ins Hotel. Den Rest des Tages haben wir uns ausgeruht, am Abend besichtigten wir dann die Trainingshalle. </p><p>Beim Frühstück gab es traditionelles chinesisches Frühstück. Am Anfang mussten wir uns daran gewöhnen doch inzwischen finden es alles lecker.</p><p>Das Training fing am nächsten Tag um 8:00 Uhr in der Früh an. Das Mittagessen war, wie an jedem Tag, um 12.00 Uhr. Nachdem hatten wir eine Mittagspause, wo wir uns meisten ausgeruht haben und wenn wir nicht gerade eine Pause gemacht haben, gingen wir meistens in die Stadt. </p><p>Im Nachmittagstraining hatten wir bis jetzt zumeist eine Fitnesseinheit.</p><p>Bis jetzt kann man sagen, dass das Trainingslager sehr gelungen ist und natürlich auch überaus anstrengend.</p><p><strong>Programm der ersten Tage:</strong></p><p><strong> </strong></p><p><strong>Montag:</strong><br>8:15-11:30<br>30 min aufwärmen<br>60min: Krafttraining: 4 Stationen 2er Teams, Kniebeugen, Ausfallschritt, Bizeps, Handgelenk, Bank drücken-am Ende 100 schnelle kurze Wh.<br>30 min. Clear Drop<br>20 min. pro Spieler 1:1 ,4 Ecken über Service Linie, 2. Spieler vorne ganzes Feld<br>10 min Stretching<br>15:00-18:00<br>30 min aufwärmen<br>15 Min. Drive<br>2×15 min. Angriff vs. Verteidigung 1:1<br>40 min. Koordinations-Zirkel<br>10 min Stretching</p><p><strong>Dienstag:</strong><br>8:15-11:30<br>30 min. aufwärmen<br>50 min. Ballmaschine: 5 Runden 4 Übungen mit 20 Bällen: Smash Netz, Verteidigung Zuwurf, China Sprung Li-Re, ganzes Feld<br>50 min. Rallies 1:1<br>10 min. Stretching<br>15:00-18:00<br>30 min. Aufwärmen<br>10 min Einspielen<br>70 min. Match ohne Punkte<br>50 min. Doppelsprünge, 1,2,3 min<br>10 min. Stretching</p><p><strong>Mittwoch</strong><br>8:15-11:30<br>30 min. aufwärmen<br>90 min. Krafttraining 3 Serien, 9 Übungen<br>75 min. Ballmaschine 1 Aufspieler, 1 Übender: kurz, schieben, Angriff , kurz<br>10 min. Stretching<br>15:00-17:30<br>30 min. aufwärmen<br>110 min. Matches 2 Runden<br>10 min. Stretching </p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-08-29","/content/news/Trainingstagebuch-ndash-Jinan-Provinz-Shandong-China-2018/5ba3e7563a94d.png","8");
INSERT INTO news VALUES("973","Mit-neuem-Schwung-in-die-Saison-2018-19-2","Mit neuem Schwung in die Saison 2018-19","2","Nachwuchs||Top-News||","<h2>Mit neuem Schwung in die Saison 2018-19</h2><p>                <img src=\"/content/news/Mit-neuem-Schwung-in-die-Saison-2018-19/5ba3e79e88be3.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/image001.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/image001-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/image001-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Der Präsident des OÖBV Kons. Herbert Koch mit seinem Statement zur Saison 2018-19:</strong></p><p><strong> </strong></p><p><strong>Die Vorbereitungen auf die Saison 2018-19 sind weitgehend abgeschlossen. Die Auslosungen für die Mannschaftsmeisterschaften, von der Bundesliga bis zur 2.Klasse, stehen fest und sind auf der   Tournament-Software eingearbeitet. Der Terminplan für die österr.- und oberösterreichischen Turniere ist ebenfalls veröffentlicht. </strong></p><p>Termingerecht haben fast alle Vereine die Ranglisten für die einzelnen Mannschaften abgegeben. Die administrative Vorbereitung auf die kommende Saison wurde, wie in den letzten Jahren, von unserer Schriftführerin Karin Burger tadellos erledigt. Auch die Melde-Disziplin der Vereine hat sich wieder deutlich verbessert. Der im Mai neugewählte Verbandsvorstand hat seine erste Bewährungsprobe hinter sich. Ich möchte mich bei allen Beteiligten für den Einsatz herzlich bedanken. </p><p>In einigen Wochen geht es dann so richtig los. Am 12. September startet die O.Ö. Mannschaftsmeisterschaft. Bereits am 8. und 9. September finden die Bundesmeisterschaften der Dachverbände statt. Unser Bundesland ist in den beiden Bundesligen, die am 6.10.2018 starten, heuer mit 4 von 12 Mannschaften vertreten. Spannende Auseinandersetzungen sind dabei in beiden Ligen zu erwarten. Die zahlreichen Lokalderbys haben dabei einen besonderen Reiz. Wir können gespannt sein, wie sich die Meisterschaften in den div. O.Ö. Ligen entwickeln. Vielleicht gelingt es einer Mannschaft den Aufstieg in die Bundesliga zu schaffen. </p><p>Ein Teil unserer BORG-Sportler ist gerade dabei, sich gemeinsam mit den Tischtennis – SportlerInnen des O.Ö. Kaders auf einem Trainingslager in China, in Begleitung des Landestrainers Peter Zauner, auf die Saison vorzubereiten. Bereits im August wurde in der Landessportschule in Linz ein Trainingskurs für den Nachwuchs und teilweise der allgemeinen Klasse abgehalten. Die neu gestaltete Landessportschule hat dabei eine besondere Motivation bei den Beteiligten ausgelöst. </p><p>Der in der letzten Saison gegründete Nachwuchsarbeitskreis hat ein umfangreiches Trainings- und Turnierprogramm entwickelt. Einige neue Funktionäre haben in der Diskussion um den Nachwuchs neue Ideen eingebracht. Das Gemeinsame wird deutlich mehr in den Vordergrund gestellt. </p><p>Ich bin überzeugt, dass die Basis für eine spannende und interessante Saison geschaffen ist. Unsere Sportlerinnen und Sportler können sich auf eine faire und hoffentlich verletzungsfreie Saison, mit vielen Terminen für sportliche Auseinandersetzungen freuen.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-08-28","/content/news/Mit-neuem-Schwung-in-die-Saison-2018-19/5ba3e79e88be3.png","7");
INSERT INTO news VALUES("974","OOEBV-Nachwuchs-Sommerkurs-2","OÖBV Nachwuchs Sommerkurs","2","Nachwuchs||Top-News||","<h2>OÖBV Nachwuchs Sommerkurs</h2><p>                <img src=\"/content/news/OOEBV-Nachwuchs-Sommerkurs/5ba3e7d6da0be.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_1506.jpeg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1506-160x90.jpeg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_1506-317x180.jpeg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>OÖBV-Nachwuchs Sommerkurs</strong></p><p><strong> </strong></p><p><strong>Von 28.7.-1.8.2018 fand im neu renovierten Olympiazentrum in Linz der alljährliche OÖBV-Sommerkurs statt. Unter der Leitung von Peter Zauner, Jürgen Koch, Daniel Walchshofer und Tobias Baumgartner trainierten die jungen Badminton-Talente aus Oberösterreich und bereiteten sich so optimal auf die neue Saison 2018/19 vor. Trainiert wurde in 2 Gruppen – Schüler/Jugend.</strong></p><p>Ziel des Kurses war es die Freude am Sport zu vermitteln und trotzdem eine hohe Trainingsqualität zu erreichen. Diese Qualität gilt es jetzt in den Trainingseinheiten im Verein einzubauen. Weiters diente der Kurs auch als Überprüfung des OÖBV-Nachwuchskaders-Status.<br>Als Trainingspartner standen Wolfgang Gnedt, Filimon Collins und Alexander Serov zur Verfügung. In einigen gemeinsamen Einheiten wurde versucht junge und ältere Spieler miteinander trainieren zu lassen, um voneinander zu profitieren zu können. Die Stimmung war den gesamten Kurs über sehr positiv. Der dadurch entstandene Teamgeist lässt auf eine erfolgreiche Saison hoffen. Der OÖBV wird versuchen den Schwung dieses Kurses mitzunehmen und mehrere Kurse dieser Art über die gesamte Saison einzubauen und dadurch ein größere Anzahl und bessere Nachwuchsspieler zu entwickeln. </p><p><strong>[Bericht: Peter Zauner]</strong></p>","2018-09-15","/content/news/OOEBV-Nachwuchs-Sommerkurs/5ba3e7d6da0be.png","12");
INSERT INTO news VALUES("975","Askoe-Bundesmeisterschaften-2018","Askö Bundesmeisterschaften 2018","2","OEM||Top-News||","<h2>Askö Bundesmeisterschaften 2018</h2><p>                <img src=\"/content/news/Askoe-Bundesmeisterschaften-2018/5ba3e817356fb.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DSC_1309.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DSC_1309-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DSC_1309-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>ASKÖ Bundesmeisterschaften 2018</strong></p><p><strong> </strong></p><p><strong>Zum Saisonauftakt fanden Anfang September die ASKÖ Bundesmeisterschaften für Badminton, diesmal im schönen Wolfsberg statt.<br> Die ASKÖ OÖ war mit einer großen Delegation vertreten. 5 Vereine mit zahlreichen Sportlerinnen und Sportler haben sich auf dem Weg nach Kärnten gemacht. Darunter waren insgesamt 15 Nachwuchstalente, die in vielen Bewerben die Medaillen abräumten. Die ASKÖ Traun war mit 16 SpielerInnen Oberösterreichischs Verein mit den meisten TeilnehmerInnen.</strong></p><p>Insgesamt haben die O.Ö.Vereine 29 Medaillen errungen:</p><p>ASKÖ Traun  17 (1 davon mit Windischgarsten und 2 mit Nettingsdorf)<br>Nettingsdorf  7 (2 davon mit Traun)<br>ASKÖ Alkoven  4<br>Windischgarsten  2 (1 davon mit Traun)<br>BSC Linz 2 </p><p>5 Bundesmeister-Titel gingen dieses Jahr nach Oberösterreich (alle ASKÖ Traun):<br>Dameneinzel U15:   Anita Fobian<br>Damendoppel U15:  Lara Stockinger und Anita Fobian<br>Mixed U17:   Jannik Auberger und Sarah Maric<br>Herrendoppel U19:  Luca Froschauer und Jannik Auberger<br>Herreneinzel 40: „Jonny“ Szöke</p><p>Das Turnier war geprägt von sportlicher Fairness und freundschaftlichem Umgang miteinander und auch der Spaßfaktor kam nicht zu kurz.<br>Wir gratulieren allen Sportlerinnen und Sportler zu diesem gemeinsamen großen Erfolg!</p><p><strong>[Bericht: Maj- Britt Fobian]</strong></p>","2018-09-15","/content/news/Askoe-Bundesmeisterschaften-2018/5ba3e817356fb.png","7");
INSERT INTO news VALUES("976","Trainingslager-China-Teil-2","Trainingslager China Teil 2","2","Nachwuchs||Top-News||","<h2>Trainingslager China Teil 2</h2><p>                <img src=\"/content/news/Trainingslager-China-Teil-2/5ba3e837e030c.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_2147.jpeg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_2147-160x90.jpeg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_2147-317x180.jpeg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Kai Niederhuber berichtet vom Anfang der 2. Trainingswoche beim OÖBV-Trainingslager aus Jinan (CHN)</strong></p><p><strong> </strong></p><p><strong>Donnerstag:<br> In der Mitte der ersten Woche ging das sehr anstrengende und auch sehr vielfältige Training um 8:00 Uhr los. Gestartet wurde mit einem sehr ausführlichen 20-Minütigen Aufwärmen. Danach spielten wir uns 20 Minuten ein worauf hin wir mit 30 Minuten Drive fortfuhren. Darauf 2 mal 25 Minuten Drive Angriff und Verteidigung.</strong></p><p>Glücklicher weise hatten wir am Nachmittag Zeit zum Regenerieren für den morgigen Tag.</p><p>Freitag:<br>Aufgestanden um 6:45 mit anschließendem Frühstück begann das Training um 8:15 Uhr</p><p>Angefangen mit täglichem Aufwärmen begannen wir das Frühtraining mit 50 Minuten Kraftkammer worauf hin wir 70 Minuten Drive (neutral, defensiv, offensiv) und danach ein 10-Minütiges Dehnprogramm absolvierten.</p><p>Danach gab es ein gemeinsames Mittagsessen. Um 15 :00 Uhr startete das Training wie immer mit dem Aufwärmen. Dann spielten wir ca. 1 Stunde Matches wobei sich 2 Runden ausgingen. Dann kam eine sehr fordernde Ballmaschine zuerst Smash, Netz und Töten danach stand der Trainer auf einer Bank um uns für die Verteidigung auf zu spielen. Danach wieder 10 Minuten Dehnen.</p><p>Am Abend war wieder Regeneration.</p><p>Samstag:<br>Trainingsstart wie gewohnt mit Aufwärmen woraufhin wir 110 Minuten Matches also 3 Runden spielten. Anschließend 10-Minütiges Dehnen. Nachmittagstraining startete wieder mit dem gewohnten ausführlichen Aufwärmen 10 Runden auf einer Strecke von 400m mit 70% Intensität. Danach 10 Minuten Dehnen.</p><p>Sonntag:<br>Genügend Zeit zum Shoppen Massieren etc. was die meisten Spieler ausgenützt haben.</p><p>Das Training hier ist wirklich sehr hart und anstrengend. Am Anfang der Woche ist es schwer vorstellbar wie man die Woche überstehen soll. Wenn man sich aber Tag für Tag neu motiviert merkt man jedoch, wie man sich langsam an die Belastungen gewöhnt und immer besser mit den Chinesen mithalten kann. Vor allem die Kraft und das Ballgefühl werden im Laufe der Zeit immer besser. Ich hoffe, die letzten Tage noch gut zu überstehen und den Schwung in die neue Saison mitnehmen zu können. Von den letzten Trainingstagen wird euch dann Luca Froschauer berichten.</p><p>Ni Hao aus Jinan !!</p>","2018-09-15","/content/news/Trainingslager-China-Teil-2/5ba3e837e030c.png","12");
INSERT INTO news VALUES("977","Toptalent-Wahl-ndash-Luca-Froschauer-nominiert","Toptalent Wahl – Luca Froschauer nominiert","2","Nachwuchs||Top-News||","<h2>Toptalent Wahl – Luca Froschauer nominiert</h2><p>                <img src=\"/content/news/Toptalent-Wahl-ndash-Luca-Froschauer-nominiert/5ba3e855d40a1.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Froschauer.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Froschauer-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Froschauer-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\" width=\"317\" height=\"180\">                                                        </p><p><strong>Das neue Volksblatt veranstaltet dieses Jahr eine Toptalente Wahl. Vom oberösterreichischen Badmintonverband wurde Luca Froschauer nominiert. </strong></p><p><strong> </strong></p><p><strong>Und jeder kann ihm helfen diese Wahl zu gewinnen. Einfach online <a href=\"http://toptalent.at/index.php?id=56\"><em><strong>hier für Luca abstimmen</strong></em></a> – und das am besten jeden Tag. </strong></p><strong> <p>Vielen Dank für eure Unterstützung!</p> </strong><p></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-09-04","/content/news/Toptalent-Wahl-ndash-Luca-Froschauer-nominiert/5ba3e855d40a1.png","8");
INSERT INTO news VALUES("978","Ankuendigung-OOEBV-U11U13-RLT-RookieAdvanced","Ankündigung OÖBV U11/U13 RLT Rookie/Advanced","2","Nachwuchs||Top-News||","<h2>Ankündigung OÖBV U11/U13 RLT Rookie/Advanced</h2><p>                <img src=\"/content/news/Ankuendigung-OOEBV-U11U13-RLT-RookieAdvanced/5ba3e8830d4f4.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\" width=\"135\" height=\"180\">                                                        </p><p><strong>Union Ohlsdorf veranstaltet am 15. September 2018 das erste OÖBV U11/U13 RLT Rookie/Advanced Turnier. Alle wichtigen Informationen dazu gibt es auf unserer Homepage unter der Rubrik Termine –> Zentralausschreibung. </strong></p><p><strong> </strong></p><p><strong>Nennschluss ist  Donnerstag der 13. September 2018. </strong></p><strong> </strong><p></p><p><strong><strong>[Bericht: Redaktion – Lukas Rebhandl] </strong></strong></p>","2018-09-04","/content/news/Ankuendigung-OOEBV-U11U13-RLT-RookieAdvanced/5ba3e8830d4f4.png","9");
INSERT INTO news VALUES("993","OOEBV-U15JGD-RLT-Windischgarsten","OÖBV U15/JGD RLT Windischgarsten","22","Nachwuchs||OOEBV-RLT||Top-News||","<h2>OÖBV U15/JGD RLT Windischgarsten</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/OOEBV-U15JGD-RLT-Windischgarsten/5be08bb738e5b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/RLT-U15_U19-WDG-16_09_2018-Sieger.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/RLT-U15_U19-WDG-16_09_2018-Sieger-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/RLT-U15_U19-WDG-16_09_2018-Sieger-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 16. September trafen sich 30 Spieler in Windischgarsten, um wieder um wertvolle Ranglistenpunkte zu kämpfen. Spannenden und fairen Spielen stand nichts im Weg. Allerdings musste leider im Vorfeld das Dameneinzel U19 wegen zu weniger Nennungen abgesagt werden.</strong></p><p>Im Dameneinzel U15 gewann Kira Dlapka (UNION Ohlsdorf) vor Lara Stockinger (ASKÖ Traun) und ihrer Vereinskollegin Hanna Gillesberger (UNION Ohlsdorf).</p><p>Im Herreneinzel U15 gewann nach hartem Kampf Elias Spitzhofer (ASKÖ Traun). Zweiter wurde Sebastian Huber (UNION Ohlsdorf), vor Lorenz Windauer (UNION Ohldorf).</p><p>Schlussendlich setzte sich im Herreneinzel U19 der Favorit Jannik Auberger (ASKÖ Traun) vor seinen Kontrahenten Stefan Schausberger (UNION Ohlsdorf) und Adrian Schwarzmann (BC Windischgarsten) durch.</p><p><strong>[Bericht: BC Windischgarsten]</strong></p>","2018-09-26","/content/news/OOEBV-U15JGD-RLT-Windischgarsten/5be08bb738e5b.png","2");
INSERT INTO news VALUES("994","U11U13-Turnier-in-Ohlsdorf","U11/U13 Turnier in Ohlsdorf","22","Nachwuchs||Top-News||","<h2>U11/U13 Turnier in Ohlsdorf</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/U11U13-Turnier-in-Ohlsdorf/5be08c107ab6d.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf-1.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf-1-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf-1-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Mit 25 Spielern traf sich ein kleines, aber feines Grüppchen von oberösterreichischen Nachwuchsspielern am Samstag, den 15.9.2018, in Ohlsdorf, um sich beim U11/U13 Turnier miteinander zu messen.</strong></p><p>Nach ca. 5 Stunden Spielzeit in der kleinen Ohlsdorfer Halle, wo aber eine gute Atmosphäre durchgehend herrschte, wurden schließlich nach spannenden und guten Spielen, die Sieger und alle, die ebenfalls ihr bestes gegeben haben, in den vier Disziplinen gekürt. Im HE U11 dominierte Eric Hayböck vom BC Windischgarsten, ebenso wie bei den Damen in U11 Xenia Frühauf vom BC Alkoven. Im HE U11 lieferten sich die beiden Ohlsdorfer Sebastian Huber und Lorenz Windauer ein spannendes Drei-Satz Finale, in dem Sebastian Huber schlussendlich als Sieger hervorging. Mit Hanna Gillesberger ging im Dameneinzel U13 ebenfalls ein weiterer Sieg an die Ohlsdorfer. Doch auch ein Lob an all die jungen Talente, die bei ihren ersten Turniererfahrungen hoffentlich auch genug Freude am Badminton hatten.</p><p><strong>[Bericht: Union Ohlsdorf – Stefan Schausberger]</strong></p>","2018-09-26","/content/news/U11U13-Turnier-in-Ohlsdorf/5be08c107ab6d.png","7");
INSERT INTO news VALUES("1014","3-Schueler-OE-RLT-in-Weiz-am-222392018","3. Schüler Ö-RLT in Weiz am 22/23.9.2018","22","Nachwuchs||OEBV-RLT||Top-News||","<h2>3. Schüler Ö-RLT in Weiz am 22/23.9.2018</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/3-Schueler-OE-RLT-in-Weiz-am-222392018/5be098d5740be.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/weizSept2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/weizSept2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/weizSept2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 22/23.9.2018 fand in Weiz das 3-Schüler Ö-RLT statt. Gut 60 junge Badmintonspieler waren angetreten, um ihre Position in der Österreichrangliste zu verbessern. Auch Oberösterreich war dabei mit 18 Spielerinnen und Spielern stark vertreten. Und diese 18 Spieler aus den 3 Vereinen Alkoven, Ohlsdorf und Traun taten ihr Möglichstes, um ihr Bundesland würdig zu vertreten und das gelang ihnen recht eindrucksvoll.</strong></p><p>Von den 10 Bewerben gewannen die Oberösterreicher 4 Bewerbe, dazu gab es noch 5 zweite Plätze und 6 dritte Plätze.<br>Besonders erwähnenswert ist natürlich wieder die Leistung von Kira Dlapka (Union Ohlsdorf), die schon wie beim letzten Turnier die Titel in allen 3 Disziplinen in der Altersklasse U15 abräumte.<br>Sehr schön anzuschauen war auch aus oberösterreichischer Sicht das Siegerbild bei den U15 Damen im Einzel, bei dem am Siegerbild auch noch Lara Stockinger und Anita Fobian (beide Askö Traun) zu sehen waren. Diese drei jungen Damen waren auch die drei, die das Damendoppel dominierten. Hier war auch noch Tabea Stierberger (BC Alkoven) auf Rang 3 zu finden. Anita war übrigens auch auf dem Siegerfoto im Mixed U15 mit ihrem Grazer Partner auf Platz 2 zu finden.<br>Auch bei den U13 Damen ist Oberösterreich im Damendoppel sehr stark vertreten, neben der Siegerin Sarah Dlapka (Union Ohlsdorf) standen auch noch Hanna Gillesberger (Union Ohlsdorf) mit Raffaela Frühauf (BC Alkoven). Sarah und Hanna erreichten noch dazu mit ihren Vereinskollegen Lorenz Windauer und Sebastian Huber im Mixed U13 die Plätze 2 und 3.<br>Bei den Herren wurden auch sehr gute Ergebnisse erreicht, so erreichte Jonas Windauer neben seinem Sieg im Mixed U15 mit seiner Vereinskollegen Kira im Herreneinzel noch dazu den 3.Platz und mit seinem Doppelpartner aus Traun Elias Spitzhofer im Doppelbewerb ebenfalls den 3.Platz.<br>Bei den Herren im U13 erreichte Lorenz Windauer den 3. Platz, mi Herrendoppel U13 scheiterte er erst im Finale mit seinem Partner und Vereinskollegen Sebastian Huber.</p><p><em>Es war also wirklich sportlich ein sehr erfolgreiches Turnier für Oberösterreich!<br>Jetzt bleibt zu hoffen, dass diese jungen Talente entsprechend weitertrainieren,, damit vielleicht dann auch bei den Österreichischen Meisterschaften die eine oder andere Medaille erkämpft werden kann. Besonders erwähnenswert außer den Ergebnissen ist auch wieder der tolle Teamgeist, der sich auch bei den vielen intensiven Besprechungen außerhalb des Platzes gezeigt hat.</em></p><p><strong>[Bericht: Stephan Dlapka (Union Ohlsdorf)]</strong></p>","2018-09-26","/content/news/3-Schueler-OE-RLT-in-Weiz-am-222392018/5be098d5740be.png","2");
INSERT INTO news VALUES("1015","OOE-Landesmeisterschaften-der-Senioren-ndash-Nennschluss-29-Okt-2018","OÖ-Landesmeisterschaften der Senioren – Nennschluss 29. Okt. 2018!","22","OOEM||Top-News||","<h2>OÖ-Landesmeisterschaften der Senioren – Nennschluss 29. Okt. 2018!</h2><p><img width=\"135\" height=\"180\" src=\"/content/news/OOE-Landesmeisterschaften-der-Senioren-ndash-Nennschluss-29-Okt-2018/5be098fb61757.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Erinnerung: Nennschluss für die OÖ-Landesmeisterschaften am 03. / 04. November 2018 ist der 29. Oktober 2018! Nachfolgend die wichtigsten Informationen dazu:</strong></p><p>Ausschreibung der OÖ. Landesmeisterschaften Senioren am 03. / 04. November 2018 in der Sporthalle Haid</p><p>Turnierinfos: ÖBV-Gruppenraster für Einzel und Doppelbewerbe / minimal 3 Spiele und maximal 5 Spiele</p><p>Stichtag für die Altersklasse ist der 31.12.2017</p><p>Vier Personen ist die kleinste Gruppe, gibt es nur ein oder zwei Nennungen in einer Altersklasse dann werden diese mit der nächst jüngeren Altersklasse zu einer Gruppe zusammengefasst. Ist dieses nicht möglich entfallen die Altersklassen. Der Altersunterschied von über 10 Jahren in einer Seniorengruppen ist nicht sinnvoll.</p><p>Am Samstag ab 10:00 Uhr werden nur die DE und HE von O35 bis O65 fertig gespielt.<br>Am Sonntag ab 10:00 Uhr werden nur die DD, HD und MD von O35 bis O65 fertig gespielt.</p><p>Falls der Zeitrahmen von 10 Stunden pro Tag durch die Teilnehmerzahl und Anzahl der Spiele gesprengt werden würde, gibt es eine Verkürzung der Sätze auf 15 Punkte mit Verlängerung bis max. 21 Punkte. Anwesenheit und persönliche Anmeldung bei der Turnierleitung am Turniertag sollte immer so 30 Minuten vor seinem ersten Spiel sein. Die Raster mit Zeitplan werden am Freitagmorgen vorm Turniertag online gestellt. Es werden die Anmeldungen bis zum Anmeldeschluss immer am Abend jeden Tages online gestellt, somit ist man informiert wer bei diesem OÖ.-Senioren-Event dabei sein möchte.</p><p><strong><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=713D194D-BF74-4E50-A87C-CCEB690F064C\"><em><strong>Online-Anmeldung</strong></em></a><br>Meldeschluss: Montag, 29. Oktober 2018 um 23:59 Uhr</strong></p><p>Nenngeld: Lt. OÖBV –Finanzordnung</p><p>Auslosung: Mittwoch, 31. Oktober 2018, 19:00 Uhr in der Sporthalle Haid.</p><p>Haftung:Der Veranstalter und der Ausrichter übernehmen keine Unfall-oder Schadenhaftung. Der Turnierveranstalter ASK Nettingsdorf-Badminton/Racketlon freut sich über DEINE Turnierteilnahme.</p><p>—BUFFET zu Freundschaftspreisen ist vorhanden —</p>","2018-10-01","/content/news/OOE-Landesmeisterschaften-der-Senioren-ndash-Nennschluss-29-Okt-2018/5be098fb61757.png","2");
INSERT INTO news VALUES("1016","3-Jugend--Ranglistenturnier-in-Traun","3. Jugend- Ranglistenturnier in Traun","22","Nachwuchs||OEBV-RLT||Top-News||","<h2>3. Jugend- Ranglistenturnier in Traun</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/3-Jugend--Ranglistenturnier-in-Traun/5be09920ded56.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DSC_0450.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DSC_0450-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DSC_0450-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>3 Erste Plätze für O.Ö. Teilnehmer</strong></p><p><strong>Am vergangenen Wochenende wurde im Bundesschulzentrum Traun der 3. und letzte Durchgang für das Jahr 2018 durchgeführt. Leider kamen nur 22 Burschen und 11 Mädchen, um sich wichtige Punkte für die Ranglisten zu erspielen. Unter den Teilnehmern waren auch zahlreiche Burschen und Mädchen die eigentlich noch in den Schülerklassen spielberechtigt sind. Eine genaue Analyse über die Umstände der geringen Teilnahme ist jedenfalls angebracht. Einer von einigen Gründen könnte die ungünstige Terminplanung sein.</strong></p><p>Die Anwesenden Sportlerinnen und Sportler zeigten durchwegs enormen Kampfgeist und große Disziplin am Spielfeld. Auch die Leistungen konnten sich sehen lassen.</p><p>Erfolgreichster Teilnehmer war der Lokalmatador Jannik Auberger aus Traun. Er konnte sowohl im Herren Einzel, wie auch im Mix- Doppel mit seiner Partnerin Alina Kopetzky, alle seine Spiele ohne Satzverlust, für sich entscheiden.</p><p>Das Damen- Doppel Kira Dlapka / Sandra Stadlmayr ( Union Ohlsdorf ) konnte den 3. Titel nach spannenden Spielen für Oberösterreich entscheiden.</p><p>Weitere OÖBV Platzierungen:</p><p>Damen Einzel:<br>2. Kira Dlapka,( Union Ohlsdorf)<br>4. Lara Stockinger( ASKÖ Traun)</p><p>Mix – Doppel:<br>3. Stefan Schausberger/ Sandra Stadlmayr (Union Ohlsdorf)</p><p>Herren- Einzel B:<br>2. Alexander Huber( Union Ohlsdorf)<br>3. Elias Spitzhofer ( ASKÖ Traun)</p><p><strong>[Bericht: Askö Traun]</strong></p>","2018-10-03","/content/news/3-Jugend--Ranglistenturnier-in-Traun/5be09920ded56.png","4");
INSERT INTO news VALUES("1017","3-Ranglistendurchgang","3. Ranglistendurchgang","22","OEBV-RLT||Top-News||","<h2>3. Ranglistendurchgang</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/3-Ranglistendurchgang/5be0994a96993.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Ohlsdorf2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>An den vergangenen Wochenenden fand in den jeweiligen Klassen der dritte Ranglistendurchgang statt. Die oberösterreichischen Teilnehmer/innen präsentierten sich dabei in ausgezeichneter Form.</strong></p><p><strong>B-RLT in Innsbruck</strong><br>Das B-Turnier in Innsbruck wurde von Kai Niederhuber (Union Neuhofen) dominiert. Er konnte sich in allen 3 Disziplinen durchsetzen. Im Herreneinzel gewann er das Finale gegen Emanuel Haselberger klar in 2 Sätzen. Auch im Doppel holte er den ersten Platz mit Michael Tomic, hier ebenfalls am Podest (3. Platz) Michael Scheinecker/Ricard Wan und Lukas Mittermayr/Tobias Rudolf (BC Raiffeisen Alkoven). Im Damendoppel holten Eva Rebhandl/Christine Stadlmayr (Union Windischgarsten/Union Ohlsdorf) den dritten Platz. Im abschließenden Mixeddoppel gab es wieder Podestplatzierungen: 1. Platz Kai Niederhuber/Karoline Pottendorfer und 3. Platz Lukas Mittermayr/Jasmin Hofer.</p><p><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=23214EB5-FEB5-42D4-BBF3-1D0A8700BD7C\"><em><strong>Ergebnisse auf Tournamentsoftware</strong></em></a></p><p><strong>A-RLT in Pressbaum</strong><br>Florian Baumgartner (Union Ohlsdorf) erfolgreichster Spieler! Beim A-Turnier in Pressbaum konnte sich Florian Baumgartner im Mixed mit Partnerin Alexandra Mathis und auch im Herrendoppel mit Partner Philip Katsaros durchsetzen. Im Herreneinzel musste er sich knapp im Finale Christian Hartner geschlagen geben. Wie schon so oft stellte Oberösterreich einen großen Teil der Top-Herreneinzel-Spieler. Mit Florian Baumgartner, Lukas Rebhandl, Michael Schausberger und Andrej Serov stellten die Oberösterreicher vier Spieler unter den Top 8.</p><p><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=88413F5B-54A1-4288-A43F-2B7851413DC1\"><em><strong>Ergebnisse auf Tournamentsoftware</strong></em></a></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-10-03","/content/news/3-Ranglistendurchgang/5be0994a96993.png","8");
INSERT INTO news VALUES("1018","1-Bundesliga-ASKOE-Traun-siegt-zum-Auftakt-in-Moedling-53","1. Bundesliga: ASKÖ Traun siegt zum Auftakt in Mödling 5:3","22","Bundesliga||Top-News||","<h2>1. Bundesliga: ASKÖ Traun siegt zum Auftakt in Mödling 5:3</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/1-Bundesliga-ASKOE-Traun-siegt-zum-Auftakt-in-Moedling-53/5be09974031e5.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/xx12.png 485w, http://www.badminton-ooe.at/wp-content/uploads/xx12-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/xx12-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Zum Auftakt der 1. Bundesliga besiegte der regierende Meister ASKÖ Traun die Niederösterreicher mit 5:3. Nach der ersten Runde ist Traun erster Tabellenführer. Die beiden anderen Spiele in der ersten Runde, UBSC Feldkirch gegen ASV Pressbaum und UBSC Wolfurt gegen ASKÖ Klagenfurt endeten jeweils 4:4 unentschieden.</strong></p><p>Der Auftakt der heurigen Meisterschaft war durch den schweren Verkehrsunfall. vorige Woche, auf dem Heimweg von den Tschechien-Open von großer Trauer und inniger Anteilnahme gegenüber den Betroffenen begleitet.</p><p><strong>Spielertrainer Jürgen Koch nach dem Spiel:</strong></p><p>„<em>Wir sind mit dem Auftaktspiel zufrieden. Lediglich die Verletzung von Filimon Collins macht uns einige Sorgen. Er hat sich bereits im Doppel, dass er mit Wolfgang Gnedt noch gewinnen konnte, durch einen Sturz auf der linken Schulter verletzt und musste im Einzel aufgeben.</em></p><p><em></em></p><p><em>Gesamt gesehen können wir mit der Leistung aller Mannschaftsmitglieder sehr zufrieden sein. Die beiden neuen Rumänischen Damen haben die in sie gesteckten Erwartungen erfüllt. Wolfgang Gnedt, Alexander Serov bewiesen bereits Jetzt eine gute Form. Vor allem Alexander konnte durch eine tadellose kämpferische Leistung sein Einzel für uns entscheiden. Wolfgang war nach anfänglichen Schwierigkeiten der übliche Garant für die erforderlichen Punkte. Ich selbst konnte im 8. und letzten Spiel gemeinsam mit der Rumänin Constantinescu den entscheidenden 5. Punkt zum Sieg beisteuern.</em></p><p></p><p><em>Wir hoffen, dass die Verletzung von Collins bis nächste Woche soweit wieder ausgeheilt ist, dass er bei der Doppelrunde, zu Hause gegen Klagenfurt und Wolfurt, dabei sein kann.</em>“</p>","2018-10-09","/content/news/1-Bundesliga-ASKOE-Traun-siegt-zum-Auftakt-in-Moedling-53/5be09974031e5.png","2");
INSERT INTO news VALUES("1019","2-Bundesliga-Ohlsdorf-und-Linz-gewinnen","2. Bundesliga: Ohlsdorf und Linz gewinnen","22","Bundesliga||Top-News||","<h2>2. Bundesliga: Ohlsdorf und Linz gewinnen</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/2-Bundesliga-Ohlsdorf-und-Linz-gewinnen/5be0999c5971f.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_7051.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_7051-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_7051-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Die Saison 2018/2019 in der 2. Bundesliga startete mit einem OÖ-Derby. Der BSC 70 Linz empfing in der Solar City BC Raiffeisen Alkoven. Die Linzer konnten sich in der Heimhalle klar mit 8:0 durchsetzen. Die Neuzugänge des BSC überzeugten dabei und Alkoven hatte ersatzgeschwächt nichts zu melden. Union Ohlsdorf konnte zuvor ebenfalls Zuhause Absteiger WBH Wien knapp mit 5:3 besiegen. Im dritten Spiel setze sich Badminton Moving Wr. Neustadt gegen Aufsteiger Union VRC Badminton mit 6:2 durch.</strong></p><p><strong>Die Statements der Teams:</strong></p><p><strong>BSC 70 Linz (Reinhard Hechenberger)</strong></p><p><em>Perfekter Saisonauftakt für den BSC 70 Linz.<br>Mit einem nicht erwarteten Sieg in dieser Höhe steigt der BSC 70 Linz in der 2. Bundesliga an die Spitze der Tabelle.<br>Mit einem 8:0 Kantersieg wurde BC Alkoven in eigener Halle bezwungen.</em></p><p><em></em></p><p><em>Neue Spieler setzen von Beginn an Akzente<br>Teammanager Harald Hochgatterer hatte ein gutes Gespür für die heutige Aufstellung. Das Team war top motiviert und er fand den richtigen Mix für die Aufstellung.</em></p><p><em>Die neuen Spieler Gasper Krivec und Jerca Bajuk bei den Damen konnten sofort ihre Erwartungen erfüllen und gewannen ihre 2 Spiele.<br>Alle übrigen Linzer zeigten eine tolle Leistung zum Beginn der Saison Alkoven ging in dieser Begegnung unter, wurde aber sicherlich unter ihrem Wert geschlagen.</em></p><p><em>Aufgrund der neuen Punkteregel für die Ergebnisse (8:0, 7:1 >> 4 Punkte, 6:2, 5:3 >> 3 Punkte; 4:4 >> 2 Punkte; 3:5, 2:6 >> 1 Punkt) gehen wir in der Tabelle in Führung und gehen sind um 1 Punkt vorne.</em></p><p></p><p><em>Nächstes Wochenende wartet auf uns eine Doppelrunde wo beide Spiele auswärts zu bestreiten sind.</em></p>","2018-10-09","/content/news/2-Bundesliga-Ohlsdorf-und-Linz-gewinnen/5be0999c5971f.png","5");
INSERT INTO news VALUES("1020","Slovak-Youth-U17-2018","Slovak Youth U17 2018","22","International||Nachwuchs||Top-News||","<h2>Slovak Youth U17 2018</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Slovak-Youth-U17-2018/5be099c0e0a8f.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/42858330_2264230753652067_7914910503531446272_n.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/42858330_2264230753652067_7914910503531446272_n-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/42858330_2264230753652067_7914910503531446272_n-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Von 28.-30.09.2018 nahm Niederhuber Kai (UBC Neuhofen) als Teil des ÖBV-Nachwuchskaders am Slovak Youth U17 2018, welches Teil des BEC U17 Circuits ist, in Zamarovce – Trencin (Slowakei) teil.</strong></p><p>Nach guten Leistungen in allen drei Bewerben, gewann er am Schluss seine erste U17-Medaille bei einem internationalen Turnier in Bronze und zwar im Doppel mit seinem Mödlinger Partner Michael Tomic.<br>„<em>Im Doppel mit Michael Tomic gelang mir mein bisher größter Erfolg, wir gewannen im Viertelfinale gegen die auf 3 gesetzten Polen in 3 Sätzen, scheiterten aber leider im Halbfinale gegen die auf Nummer 1 gesetzten und späteren Turniersieger aus Serbien knapp in zwei Sätzen (21:19/21:19).</em>“</p><p>Im Mixed-Bewerb mit seiner Wolfurter Partnerin Anna Maria Schneider war in der zweiten Runde denkbar knapp gegen die späteren Drittplatzierten Tschechen Endstation.</p><p>Im Herreneinzel kam er in die dritte Runde nachdem er in der zweiten Runde den Nr. 10 gesetzten Ungarn klar besiegte. In der dritten Runde verlor er dann in zwei Sätzen gegen den späteren Drittplatzierten Ukrainer.<br>„<em>Im Einzel gewann ich gegen ich gegen den als Nummer 10 gesetzten Ungarn Kristof Toth, was mich sehr freute.</em>“</p><p><strong>Turnierergebnisse:</strong><br><a href=\"http://www.tournamentsoftware.com/sport/player.aspx?id=CE645196-9107-490C-AC96-6BB809D65766&player=133\"><em><strong>Ergebnisse auf Tournamentsoftware</strong></em></a></p><p><strong>[Bericht: UBC Neuhofen – Daniela Kreindl]</strong></p>","2018-10-12","/content/news/Slovak-Youth-U17-2018/5be099c0e0a8f.png","5");
INSERT INTO news VALUES("1021","Bericht-zur-Nachwuchsarbeitskreissitzung-am-2692018-in-Linz","Bericht zur Nachwuchsarbeitskreissitzung am 26.9.2018 in Linz","22","Nachwuchs||Top-News||","<h2>Bericht zur Nachwuchsarbeitskreissitzung am 26.9.2018 in Linz</h2><p><img width=\"135\" height=\"180\" src=\"/content/news/Bericht-zur-Nachwuchsarbeitskreissitzung-am-2692018-in-Linz/5be099e4c1551.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 26.9.2018 trafen sich die Vertreter des Nachwuchsarbeitskreises am Olympiazentrum auf der Gugl zu einer Besprechung, wie es im oberösterreichischen Badmintonnachwuchs weitergeht. Geleitet wurde die Sitzung vom Landestrainer Peter Zauner und vom neuen Nachwuchsreferenten<br>Stephan Dlapka.</strong></p><p>Im Detail wurde besprochen, mit welchen Maßnahmen wir unseren Badminton-Nachwuchs nicht nur stärken, sondern auch vergrößern wollen. Hierbei soll es mit vermehrten Kadertrainings, Camps und regelmäßigen Besuchen des Landestrainers in den Vereinen zu einer Verbesserung des Leistungslevels der jungen Spielerinnen und Spieler kommen.</p><p>Außerdem wird sich Peter Zauner mit seinem Trainerteam darum bemühen, auf der Homepage des Oberösterreichischen Badmintonverbandes eine Übungssammlung mit den Übungen anzubieten, die im Regiotraining bzw. in den diversen Kadertrainings geübt werden. Durch diese Maßnahme sollen auch nicht so badmintonversierte Nachwuchstrainer bzw. Eltern eine Möglichkeit haben, mit ihren Kindern oder im Verein badmintonspezifisch zu trainieren.</p><p>Damit man als Vereinsverantwortlicher weiß, wann welcher Termin stattfindet, wird ein Terminplan erstellt, der auf der Homepage des Oberösterreichischen Badmintonverbandes einzusehen ist. Darin werden alle Termine Turniere und Trainings betreffend enthalten sein.</p><p>Des weiteren wurde auch Tobias Baumgartner zum neuen Landestrainer-Stellvertreter gewählt, der im Abwesenheitsfall von Peter Zauner dessen Agenden übernehmen soll.</p><p>Abschließend wurde auch noch ein neues Turniersystem entwickelt, welches bei den Ranglistenturnieren gleichwertige Spiele zur Folge haben soll. Dieses System wird dann schon bei den nächsten Ranglistenturnieren ausprobiert und bei der Landesmeisterschaft im November 2018 den Spielerinnen und Spielern vorgestellt werden.</p><p>Nach über 4 Stunden Besprechung wurde die Sitzung beendet und wir hoffen, dass die besprochenen<br>Maßnahmen bald umgesetzt werden.</p>","2018-10-12","/content/news/Bericht-zur-Nachwuchsarbeitskreissitzung-am-2692018-in-Linz/5be099e4c1551.png","9");
INSERT INTO news VALUES("1022","Doppelrunde-in-der-1-Bundesliga-fuer-Askoe-Traun","Doppelrunde in der 1. Bundesliga für Askö Traun","22","Bundesliga||Top-News||","<h2>Doppelrunde in der 1. Bundesliga für Askö Traun</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Doppelrunde-in-der-1-Bundesliga-fuer-Askoe-Traun/5be09a3c7852a.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Froschauer.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Froschauer-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Froschauer-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am Samstag den 13. und am Sonntag den 14. Oktober ist in der 1. Badminton Bundesliga eine Doppelrunde auf dem Programm. An diesen beiden Tagen ist Badminton der Spitzenklasse angesagt. Die Begegnung gegen die Klagenfurter steht noch immer im Zeichen des schweren Verkehrsumfalles der Staatsmeisterin Jenny Ertl. Diesbezügliche Meldungen lassen für die Junge Athletin hoffen, dass sie Ihren geliebten Sport wieder ausüben können wird. Wir wünschen ihr vom ganzen Herzen alles Gute für die Zukunft.</strong></p><p><strong>1. Spiel: vs. Askö kelag Kärnten</strong><br>Die Kärntner sind trotz des Ausfalles von der Staatsmeisterin Jenny Ertl ein starkes Team. Den Beweis für ihre Stärke haben sie am vergangenen Wochenende beim Auswärtsspiel in Feldkirch mit einem 4:4 erbracht. Aber auch unsere Mannschaft ist mit einem Auswärtssieg in Mödling sehr gut gestartet. Hoffentlich wird die dabei erlittene Verletzung bei Collins Filimon soweit abklingen, dass er am Wochenende seine Mannschaft wieder verstärken kann. Sollte das nicht der Fall sein, werden voraussichtlich unsere Nachwuchsspieler nachrücken und eine Chance bekommen.</p><p>Bei den Damen werden wir erstmals in der neuen Saison in vorläufig stärkster Besetzung antreten können. Neben der in der Vorwoche erfolgreichen Rumänin Florentina Constantinescu wir dieses Mal wieder unsere Nr.1 Dame Lisa Heidenreich (GER) zum Einsatz kommen.</p><p><strong>2. Spiel: vs. UBSC Wolfurt</strong><br>Diese Auseinandersetzung mit unserem Gegner beim letzten Finale 2017/2018 um den Staatsmeistertitel wird für beide Mannschaften zur Standortbestimmung. In der best-off- 3 Serie im Frühjahr waren alle 3 Begegnungen erforderlich, um den Meister zugunsten von Traun zu entscheiden. Beide Mannschaften haben Ihren Kader punktuell verändert, sodass die Ausgangssituation offen ist. Der Heimvorteil könnte ein nicht zu unterschätzender Vorteil für uns sein, den wir hoffentlich entsprechend nutzen können. Eine ungewisse Situation ist noch, ob die Verletzung von Collins Filimon einen Einsatz an beiden Tagen ermöglicht. Auch bei diesem Spiel kann es sein, dass aus unseren Talente- Trio Froschauer, Niederhuber und Auberger der Eine oder der Andere in die Mannschaft nachrücken werden.</p><p>Wir hoffen auf entsprechende Unterstützung unserer Fans. Jedenfalls freuen wir uns auf 2 Badminton- Tage auf höchsten österr. Niveau.</p>","2018-10-12","/content/news/Doppelrunde-in-der-1-Bundesliga-fuer-Askoe-Traun/5be09a3c7852a.png","3");
INSERT INTO news VALUES("1023","1-Bundesliga-Traun-mit-guter-Doppelrunde","1. Bundesliga: Traun mit guter Doppelrunde","22","Bundesliga||Top-News||","<h2>1. Bundesliga: Traun mit guter Doppelrunde</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/1-Bundesliga-Traun-mit-guter-Doppelrunde/5be09a6ce0999.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/31945643_1694592000627852_8255631783836516352_n-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Askö Traun konnte am Wochenende in der 1. Bundesliga einen Sieg und ein Unentschieden erspielen. Der Rekordmeister konnte askö kelag Kärnten knapp mit 5:3 besiegen. Im Duell mit dem Vizemeister des Vorjahres UBSC Wolfurt konnten die Trauner nicht ganz vollständig antreten. Das 4:4 Unentschieden ist deshalb sehr hoch einzuschätzen.</strong></p><p>Askö Traun rangiert nach der Doppelrunde mit 8 Punkten punktegleich mit dem Tabellenführer Pressbaum auf dem zweiten Platz. Die nächste Runde führt die Trauner nach Vorarlberg zum BC Feldkirch.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-10-15","/content/news/1-Bundesliga-Traun-mit-guter-Doppelrunde/5be09a6ce0999.png","14");
INSERT INTO news VALUES("1024","2-Bundesliga-Linz-weiter-erfolgreich","2. Bundesliga: Linz weiter erfolgreich","22","Bundesliga||Top-News||","<h2>2. Bundesliga: Linz weiter erfolgreich</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/2-Bundesliga-Linz-weiter-erfolgreich/5be09a90498fc.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Petra_Polanc_c-.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Petra_Polanc_c--160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Petra_Polanc_c--317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Die Doppelrunde in der 2. Bundesliga brachte jeweils Samstag und Sonntag ein OÖ-Derby. Am Samstag trennten sich Union Ohlsdorf und der BC Raiffeisen Alkoven in einem knappen Spiel unentschieden 4:4. Am Sonntag setzte sich BSC 70 Linz in Ohlsdorf mit 6:2 durch. Damit rangieren die Linzer einen Punkt hinter dem Tabellenführer Wr. Neustadt auf Rang 2.</strong></p><p><strong></strong></p><p><strong>Union Ohlsdorf belegt, nach dem Unentschieden und Niederlage, den vierten Platz. Der BC Raiffeisen Alkoven hält unverändert die rote Laterne.</strong></p><p></p><p><strong>Die Stimmen zur Doppelrunde:</strong></p><p><strong>Josef Retschitzegger (Ohlsdorf)</strong><br><em>Was uns in der ersten Runde gelungen ist, nämlich die knappen Spiele zu gewinnen, haben wir diesmal leider nicht geschafft. Vor allem gegen Alkoven wäre wesentlich mehr drinnen gewesen. Sehr positiv war, das trotz des schönen Herbstwetters an beiden Tagen sehr viele Zuseher gekommen waren, und unsere Mannschaft unterstützt haben.</em></p><p><strong>Reinhard Hechenberger (Linz)</strong><br><em>Talent Daniel Witzmann (Bild) mit Bundesligapremiere gegen VRC<br>Durch einen LKW Brand auf der Wiener Autobahn kam es zu einem sehr starken Rückstau von 1,5 h Wartezeit wodurch die Begegnung, in Abstimmung mit dem Heimverein, später angefangen hat.</em></p><p><em></em></p><p><em>Aufgrund der Wartezeit und der Reisebelastung – und der sofortige Antritt zur Begegnung gingen die Spiele in eine – für uns – falsche Richtung.<br>VRC war in allen Belangen, an diesem Tag, überlegen und gewann mit 6:2.<br>Trotzdem gab es auch Positives an diesem Tag….<br>das Positivste war auch jeden Fall der Antritt im 3. Einzel des gerade 17 Jahre alt gewordenen Daniel Witzmann.<br>Er bekam am gestrigen Tag die Chance im 3. Herren Einzel sein Talent und Können zu zeigen. Sein 1. Antreten in der Badminton Bundesliga…</em></p><p><em>Nach nervösen Beginn spielte Daniel immer effektiver und stellte den Mannschaftsführer von VRC, Markus Hinz, vor immer größere Probleme.<br>Nach dem 1. Satz und einer kleiner Taktikumstellung fand Dani das Rezept um gegen erfahrene Spieler bestehen zu können und gewann den 2. Satz.<br>Im Entscheidungssatzung mit Führung im Rücken kämpfte sich Daniel Punkt für Punkt voran und konnte bei 20:19 sogar einen Matchball für sich verbuchen. Genau in dieser Phase war ihm das Glück des Tüchtigen nicht hold, eine knappe Entscheidung an der Linie gegen ihn stellte auf 20:20. Der erfahrene Markus Hinz nütze diese Chance und holte sich die Entscheidung mit 22:20.</em></p><p><em>Dennoch, auch wenn für Daniel Witzmann seine 1. Bundesligapartie so unglücklich geendet hat, hat der BSC 70 Linz ein neues Talent im Kader was wir nun behutsam an die weiteren Aufgaben heranführen werden.</em></p><p><em>Heute: OÖ Derby gegen Union Ohlsdorf</em></p><p><em>Nach den Strapazen am gestrigen Tag, wurde das Spiel bei einem gemütlichen Abendessen besprochen… Am heutige Tag sahen wir wieder das Team des BSC 70 Linz das auch die Vereinsführung kennt.</em></p><p><em>Mit einem 6:2 auswärts holten wir uns wieder unser Selbstvertrauen zurück.</em></p><p><em>Strafverifizierung des Spiels Wr. Neustadt gg. WBH Wien.</em></p><p><em>Ursprünglich ein gerechtes Unentschieden, wobei das Nachspiel dieser Begenung am Tag dannach am grünen Tisch entschieden wurde. WBH Wien hat bei der Doppelaufstellung einen Fehler gemacht und damit gehen die betroffenen Spiele zugunsten des Gegners aus.<br>Damit gewinnt Wr. Neustadt und ist neuer Tabellenführer, nachdem sie auch das heutige Match gewonnen hatten.</em></p><p><em>„Schade, dass wir uns gestern aufgrund der Anreiseprobleme, nicht so zeigen konnten wie wir es wollten. Das Jungtalent Daniel Witzmann hat seine Feuertaufe in der Bundesliga abgelegt und kann hoffentlich viel für die nächste Zeit mitnehmen. Ihm gehört sicherlich die Badmintonzukunft. Ihn werden wir weiter behutsam auf die nächsten Aufgaben vorbereiten. Die Niederlage gegen VRC tut etwas weh, wobei wir hoffen, dass diese Mannschaft auch in den nächsten Runden komplett antritt um ein echtes Bild der Teamstärke abzubilden. In der 1. Runde fehlten alle Gastspieler!. Im heutigen Spiel gegen Ohlsdorf sahen wir wieder tollen Sport und der BSC 70 Linz setzte sich schlussendlich durch. Wir freuen uns, wenn wir ab der nächsten Runde auch unsere Nr. 1 Dame, nach der Jugend Olympiade, Petra Polanc im Team begrüßen können. Im Spiel gegen den Tabellenführer und die nächsten Aufgaben wird uns das mit Sicherheit helfen“ analysiert Obmann Reinhard Hechenberger die Situation nach der Doppelrunde.</em></p><p></p><p><em>Nächste Runde am 10.11.2018 empfängt der BSC 70 Linz den Tabellenführer Wr. Neustadt in der Solar City Halle.</em></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-10-15","/content/news/2-Bundesliga-Linz-weiter-erfolgreich/5be09a90498fc.png","12");
INSERT INTO news VALUES("1025","8-OOEBV-Doppel-RLT","8. OÖBV Doppel RLT","22","OOEBV-RLT||Top-News||","<h2>8. OÖBV Doppel RLT</h2><p><img width=\"314\" height=\"180\" src=\"/content/news/8-OOEBV-Doppel-RLT/5be09acc0bf93.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/P1010176.jpg 480w, http://www.badminton-ooe.at/wp-content/uploads/P1010176-157x90.jpg 157w, http://www.badminton-ooe.at/wp-content/uploads/P1010176-314x180.jpg 314w\" sizes=\"(max-width: 314px) 100vw, 314px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 21. Oktober veranstaltete ASKÖ Linz Badminton das 8. OÖBV Doppel RLT in der Rennerschule in Linz. Es war das erste Turnier dieser beliebten Spielserie und so kämpften insgesamt 22 Herren- und 10 Damendoppel um Ranglistenpunkte.</strong></p><p>Gespielt wurde auf sechs Feldern mit hervorragender Stimmung dank der angrenzenden Tribüne. Sowohl SpielerInnen als auch Zuseher kamen in hochwertigen Spielen, welche nicht zu selten erst im dritten Satz entschieden wurden, in den Genuss von Badminton.</p><p>Am Ende konnten sich bei den Damen Lisa Dober und Tanja Edlacher und bei den Herren Bernhard Gruber und Rene Höller durchsetzen.<br>Die weiteren Podestplätze gingen an Sarah Anleitner / Denise Sendlhofer und Michaela Reifetshammer / Lydia Weilhartner sowie Nikita Arnold und Philipp Della-Rosa.</p><p>Das Turnier war wieder ein Beweis wie gut die Atmosphäre, wie groß der Spaß und wie schön die Freude sein kann.<br>Daher hoffen wir natürlich bei den weiteren Turnieren wieder viele bekannte Gesichter und auch neue SpielerInnen zu sehen.</p><p>Wir wünschen auf diesem Wege dem verletzten Klaus Baumann gute Besserung und hoffen auf ein baldige Genesung.</p><p><strong>[Bericht: Askö Linz – Philipp Stelzmüller]</strong></p>","2018-10-23","/content/news/8-OOEBV-Doppel-RLT/5be09acc0bf93.png","19");
INSERT INTO news VALUES("1026","Einladung-Infoabend","Einladung Infoabend","22","Nachwuchs||Top-News||","<h2>Einladung Infoabend</h2><p><img width=\"135\" height=\"180\" src=\"/content/news/Einladung-Infoabend/5be09b04af36f.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>TALENTEZENTRUM Sportland OÖ</strong></p><p><strong></strong></p><p><strong>Das Talentzentrum Sportland OÖ veranstaltet am 12. November 2018 einen Infoabend für alle interessierten Sportler/innen und Eltern.</strong></p><p><strong>DATUM: 12. November 2018, 18.00 Uhr</strong></p><p><strong>ORT: Auf der Gugl 30, 4020 Linz</strong></p><p><strong>RAUM: Olympiaforum (erster Stock)</strong></p><p><strong>TEILNEHMER: Interessierte SportlerInnen, Eltern</strong></p><p></p><p><strong>KOOPERATIONSPARTNER: BORG Honauerstraße;HAS Rudigierstraße; Georg von Peuerbach-Gymnasium; Internat Haus Don Bosco – Kolping Olympia</strong></p><p><strong>Anmeldung bis 08. November 2018 an <a href=\"mailto:office@talentezentrum-ooe.at\">office@talentzentrum-ooe.at</a></strong></p><p>(office@talentzentrum-ooe.at)</p>","2018-11-01","/content/news/Einladung-Infoabend/5be09b04af36f.png","21");
INSERT INTO news VALUES("1027","TEM-Slovenia-Junior-International","TEM Slovenia Junior International","22","International||Nachwuchs||Top-News||","<h2>TEM Slovenia Junior International</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/TEM-Slovenia-Junior-International/5be09b3add346.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-10-25-at-15.19.57.jpeg 485w, http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-10-25-at-15.19.57-160x90.jpeg 160w, http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-10-25-at-15.19.57-317x180.jpeg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Von 19-21. Oktober fand in Mirna (SLO) das TEM Slovenia Junior International statt. Von unserem Verein war Luca Froschauer gemeinsam mit dem Jugendnationalteam unterwegs.</strong></p><p>In seinem ersten Spiel gewann er gegen Marcell Csobod aus Ungarn klar mit 21:9 21:14. Am Tag darauf wartete jedoch bereits der zweitgesetzte und späterer Finalist Enrico Baroni aus Italien. Luca konnte im erstem Satz äußerst gut mithalten und verlor nach 2 vergeben Satzbällen knapp auf 24:22. Auch im zweiten Satz schien es, dass er gut dagegenhalten kann, doch nach 11:10 Rückstand fehlte die nötige Kraft um das hohe erforderliche Tempo mitzuhalten. Er verlor den Satz auf 13. Nach äußerst kurzer Pause (25 Minuten) bestritt er dann das Herrendoppel mit Partner Lenny Sudarma (Mödling) gegen zwei Ungar. Die beiden konnten leider nur selten ihre Taktik umsetzen und verloren leider knapp auf 21:17 16:21 21:18.</p><p><strong>Fazit Luca:</strong> „<em>Ich bin mit meiner Leistung sehr zufrieden. Ich konnte in meinem ersten Match meinen Spielplan ohne viele Fehler gut durchziehen, ebenso im zweiten Einzel gelang mir dies. Gegen den Jugendweltranglisten 37 konnte ich wirklich gut mithalten und hatte auch, vor allem im ersten Satz, die Chance einen Satz zu gewinnen. Aber trotzdem bin ich mit dem Match äußert zufrieden. Im Doppel fiel es mir schwer mich zu konzentrieren und deshalb machte ich einige leichte Fehler, die zu vermeiden waren. Im Großen und Ganzen bin ich aber glücklich mit meinen Leistungen.</em>“</p><p><strong>[Bericht: Peter Zauner]</strong></p>","2018-11-03","/content/news/TEM-Slovenia-Junior-International/5be09b3add346.png","12");
INSERT INTO news VALUES("1029","Ankuendigung-Nachwuchs-Landesmeisterschaften","Ankündigung Nachwuchs Landesmeisterschaften","25","Nachwuchs||Top-News||","<h2>Ankündigung Nachwuchs Landesmeisterschaften</h2><p><img width=\"135\" height=\"180\" src=\"/content/news/Ankuendigung-Nachwuchs-Landesmeisterschaften/5c2d034e561cf.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/OÖBV.jpg 194w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-67x90.jpg 67w, http://www.badminton-ooe.at/wp-content/uploads/OÖBV-134x180.jpg 134w\" sizes=\"(max-width: 135px) 100vw, 135px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Askö Traun veranstaltet am 17. und 18. November 2018 die Nachwuchs Landesmeisterschaften. In folgenden Klassen kann genannt werden: U11, U13, U15, U17, U19 und U22.<br>Genauere Informationen zum Turnier findet ihr in der Rubrik „Zentralausschreibung“</strong></p><p><strong></strong></p><p><strong>Nennschluss ist der 11. November 2018!</strong></p><p></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-11-06","/content/news/Ankuendigung-Nachwuchs-Landesmeisterschaften/5c2d034e561cf.png","2");
INSERT INTO news VALUES("1030","OOE-Senioren-Landesmeisterschaft-2018-in-Haid","OÖ. Senioren Landesmeisterschaft 2018 in Haid","25","OOEBV-RLT||Top-News||","<h2>OÖ. Senioren Landesmeisterschaft 2018 in Haid</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/OOE-Senioren-Landesmeisterschaft-2018-in-Haid/5c2d037cdf965.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/DD_O35_OÖ_Senioren_LM_2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/DD_O35_OÖ_Senioren_LM_2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/DD_O35_OÖ_Senioren_LM_2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am Samstag den 3. und Sonntag den 4. November war die Sporthalle Haid der Austragungsort für die oberösterreichische Senioren Landesmeisterschaft 2018. Dieser Event war ein Pilotprojekt mit der Aufteilung der Bewerbe an zwei Tagen und statt dem üblichen KO-System wurde generell das ÖBV-Gruppensystem gespielt.</strong></p><p>Am Samstag wurden alle Einzelbewerbe ausgespielt und am Sonntag wurden alle Doppel und Mixed Bewerbe ausgespielt. 29 Spieler/Innen aus 9 Vereinen nahmen sich die Zeit um sich spielerisch und gesellschaftlich von der besten Seite zu zeigen. Das Turnier startete an beiden Tagen pünktlich um 10:00 Uhr und wurde jeweils mit der Siegerehrung der gespielten Bewerbe und einem netten Grinsen der Sieger/Innen beendet. Der Siegerpreis für die ersten drei war ein Flascherl Wein zum Genießen des Erfolges. Anbei die Auflistung der OÖ. Landesmeister/Innen, alle anderen Platzierungen sind in der <a href=\"http://obv.tournamentsoftware.com/sport/events.aspx?id=713D194D-BF74-4E50-A87C-CCEB690F064C\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p><strong>Samstag: </strong><br>HE – O35 Rene Höller<br>HE – O45 Peter Krenmayr<br>HE – O55 Alfred Rebhandl</p><p><strong>Sonntag:</strong><br>DD – O35 Kerstin Knogler / Carola-Bianca Mauhart<br>HD – O35 Rene Höller / Wolfgang Zeiml<br>HD – O50 Josef Handlechner / Peter Krenmayr<br>MD – O35 Christina Wu / Nikita Arnold<br>MD – O50 Elisabeth Pröll / Karl Pröll</p><p>Ein herzliches und großes DANKE an alle Teilnehmer/Innen sowie an die helfenden Hände von Roswitha Ben Ahmed die aus der Ferne kam um das Buffet zu schaukeln und an Klaus Hubner der die Turnierleitung an beiden Tagen souverän über die Bühne brachte. Da die OÖBV Urkunden für den Einzug eines Standard-Laserjet zu schwer ist und der Druck versetzt ist geht ein besonderes DANKE auch an Michael Peter Giel der seine selbst kreierten Urkunden zur Verfügung stellte.</p><p><strong>[Bericht: Peter Krenmayr]</strong></p>","2018-11-06","/content/news/OOE-Senioren-Landesmeisterschaft-2018-in-Haid/5c2d037cdf965.png","1");
INSERT INTO news VALUES("1031","2-Bundesliga-2-Unentschieden-und-1-Niederlage-fuer-OOE-Teams","2. Bundesliga: 2 Unentschieden und 1 Niederlage für OÖ-Teams","25","Bundesliga||Top-News||","<h2>2. Bundesliga: 2 Unentschieden und 1 Niederlage für OÖ-Teams</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/2-Bundesliga-2-Unentschieden-und-1-Niederlage-fuer-OOE-Teams/5c2d03aea7f74.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Polanc_Petra_und_Pehsekhonova_Natalia_2018_2019.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Polanc_Petra_und_Pehsekhonova_Natalia_2018_2019-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Polanc_Petra_und_Pehsekhonova_Natalia_2018_2019-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>In der 2. Badminton Bundesliga kam es am Wochenende zu Begegnungen zwischen Teams aus OÖ und den Teams aus Wien. Der BSC 70 Linz holte ein Unentschieden gegen Wr. Neustadt. Union Ohlsdorf konnte auswärts ebenso 4:4 Unentschieden gegen Union VRC Badminton erspielen. Das Tabellenschlusslicht BC Raiffeisen Alkoven musste sich Zuhause WBH Wien 2:6 geschlagen geben.</strong></p><p>Die Tabelle wird somit nach wie vor von Wr. Neustadt angeführt. Dahinter mit nur einem Punkt Abstand folgen BSC 70 Linz, Union VRC Badminton und Union Ohlsdorf. WBH Wien und der BC Raiffeisen Alkoven kommen mit jeweils zwei Punkten Abstand dahinter.</p><p><strong>Die Statements der Teams:</strong></p><p><strong>BSC 70 Linz </strong><br>„<em>Schade, dass wir uns gestern nicht den Sieg gegen den Tabellenführer nicht einfahren konnten. Mit 3 knappen Spielen (alle leider verloren im 3. Satz) wäre auch ein Sieg möglich gewesen. Am 1.12.2018 geht es für uns im Auswärtsspiel in Wien um den Weiterverbleib am 2. Tabellenplatz. Die Wiener, die zuletzt mit starken Leistungen wiedererstarkt sind, werden uns das Leben am Platz so schwer wie möglich machen.</em>“ analysiert Obmann Reinhard Hechenberger die Situation vor dem Ende der Hinrunde.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-11-12","/content/news/2-Bundesliga-2-Unentschieden-und-1-Niederlage-fuer-OOE-Teams/5c2d03aea7f74.png","3");
INSERT INTO news VALUES("1032","1-Bundesliga-Askoe-Traun-neuer-Tabellenfuehrer","1. Bundesliga: Askö Traun neuer Tabellenführer","25","Bundesliga||Top-News||","<h2>1. Bundesliga: Askö Traun neuer Tabellenführer</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/1-Bundesliga-Askoe-Traun-neuer-Tabellenfuehrer/5c2d0416cc49b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20181110_150045.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20181110_150045-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20181110_150045-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>In der 1. Badminton Bundesliga musste Askö Traun am Wochenende in Richtung Vorarlberg aufbrechen. Die Oberösterreicher konnten dabei auf einen guten Kader zurückgreifen und Feldkirch mit 8:0 besiegen. Sie ließen dabei nicht einmal einen Satzgewinn der Feldkircher zu und übernahmen damit die Tabellenführung. In den anderen Begegnungen konnte sich UBSC Wolfurt Zuhause gegen kelag Kärnten mit 7:1 durchsetzen und ASV Pressbaum besiegte Badminton Mödling mit 5:3.</strong></p><p><strong>Statement von Askö Traun (Herbert Koch)</strong><br>Mit der maximalen Ausbeute kehrte die Bundesligamannschaft der ASKÖ Traun vom Auswärtsspiel beim UBSC Feldkirch aus dem Ländle zurück. Mit 8:0 Punkten gelang der Mannschaft, um Kapitän Jürgen Koch, ein überzeugender Sieg ohne Satzverlust. Aufgrund der seit heuer geltender neuer Regelung schlug sich der Sieg mit 4 Punkten in der Tabelle, und damit mit der vorläufigen Tabellenführung, nieder.</p><p>„Wir haben aus Deutschland eine neue Regelung übernommen. Aufgrund dieser Bestimmungen gibt es seit heuer bei einem 8:0 oder 7:1 Sieg 4 Punkte, bei einem 6:2 oder 5:3 Erfolg aber nur 3 Punkte. Die Spitzenmannschaften können es sich fast nicht wirklich leisten, verschiedentlich dem bereitstehenden Nachwuchs eine Chance in der Bundesliga-Mannschaft zu geben. Die Änderungen sollen anderseits bei einer 5 Punkte-Führung die Spannung in einer Begegnung bis zum Schluss aufrechterhalten. Beide Überlegungen haben etwas auf sich. Eine Diskussion darüber vor der nächsten Saison ist sinnvoll.</p><p>Um für die Finalphase eine optimale Ausgangsbasis zu schaffen, die besser platzierte Mannschaft nach dem Grunddurchgang hat im Semifinale das Heimrecht, müssen die Clubs dieses Ziel immer mit berücksichtigen. Ein Experiment bei der Zusammenstellung der Mannschaft ist damit fast nicht möglich. Die Entwicklungsmöglichkeit der Talente wird dadurch möglicherweise eingeschränkt. Diesen Umstand haben wir bei der Bundesliga-Reform möglicherweise zu wenig berücksichtigt.</p><p>Natürlich sind wir mit der Leistung der gesamten Mannschaft sehr zufrieden. Ein Aufwärtstrend aller unserer Teammitglieder ist klar ersichtlich. Das Projekt „Titelverteidigung“ ist aufgrund der starken Gegenwehr unserer Konkurrenz nicht leicht, aber ein großes, mögliches Saisonziel. Am 1. Dezember kommt es im Trauner Stadion zum Spitzenspiel gegen den ASV Pressbaum.“</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-11-12","/content/news/1-Bundesliga-Askoe-Traun-neuer-Tabellenfuehrer/5c2d0416cc49b.png","2");
INSERT INTO news VALUES("1033","Fuehrungswechsel-beim-BC-Raiffeisen-Alkoven","Führungswechsel beim BC Raiffeisen Alkoven","25","Bundesliga||Top-News||","<h2>Führungswechsel beim BC Raiffeisen Alkoven</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Fuehrungswechsel-beim-BC-Raiffeisen-Alkoven/5c2d0466717e0.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/NFWA3038.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/NFWA3038-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/NFWA3038-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Führungswechsel beim BC Raiffeisen Alkoven</strong></p><p><strong></strong></p><p><strong>Bei der Mitgliederversammlung des BC Raiffeisen Alkoven wurde ein Wechsel in der Vereinsführung beschlossen.</strong></p><p><strong>Vereinsgründer und Langzeitobmann Kons. Prof. Fritz Freimüller legte seine Funktion als Obmann nach 28 Jahren zurück und übergab den Verein an ein junges engagiertes Team um Obmann DI Ulrich Stoiber.</strong></p><p><strong>In einem Statement beschrieb er die Beweggründe und gab einen Überblick über sein Wirken in den vergangenen 28 Jahren. Er bedankte sich noch einmal für die schöne Zeit, vor allem für den respektvollen und freundschaftlichen Umgang miteinander.</strong></p><p></p><p><strong>Er wünscht der neuen Führung alles Gute.<br>Der neue Vorstand wurde einstimmig gewählt.</strong></p>","2018-11-12","/content/news/Fuehrungswechsel-beim-BC-Raiffeisen-Alkoven/5c2d0466717e0.png","2");
INSERT INTO news VALUES("1034","Austrian-U17-International-2018","Austrian U17 International 2018","25","International||Nachwuchs||Top-News||","<h2>Austrian U17 International 2018</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Austrian-U17-International-2018/5c2d0498c5c3c.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/jannik.jpeg 485w, http://www.badminton-ooe.at/wp-content/uploads/jannik-160x90.jpeg 160w, http://www.badminton-ooe.at/wp-content/uploads/jannik-317x180.jpeg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Von 19- 21. Oktober fanden in Mödling (Aut) die Austrian U17 International 2018 statt. Oberösterreich wurde durch Kai Niederhuber (Sportunion Neuhofen) und Jannik Auberger (Askö Traun) vertreten.</strong></p><p>Kai verlor im Einzel in der ersten Runde, im Mix spielte er mit Emily Wu (Pressbaum) wo er bis in die zweite Runde kam wo sie knapp auf 21-16 12-21 und 19-21 verloren, Kai konnte seine beste Leistung im Herrendoppel mit Michael Tomic (Mödling) erbringen, dort kamen die beiden bis ins Viertelfinale. Jannik gewann ebenfalls im Mix mit Karoline Pottendorfer (Pressbaum) die erste Runde, verloren dann aber ebenfalls in der zweiten. Im Einzel konnte Jannik sein erstes Spiel für sich entscheiden, unterlag aber seinem Gegner im darauffolgenden Spiel. Im Doppel konnte Jannik mit Tobias Bäuerle (Mödling) die erste Runde leider nicht gewinnen.</p><p>Fazit Jannik: <em>Ich konnte bei diesem Turnier meine Leistungen abrufen, jedoch wäre meiner Meinung nach noch mehr im Bereich des Möglichen gewesen. Ich werde versuchen bis zum nächsten Turnier meine Schwächen zu verbessern um dort besser mithalten zu können. Im Großen und Ganzen bin ich aber zufrieden mit meiner Leistung und freue mich schon auf die noch ausstehenden Turniere</em>.</p><p>Fazit Kai: <em>Im Einzel habe ich leider in der ersten Runde gegen den auf Platz 7 Gesetzten Polen verloren. Im Mix sind wir (Emily Wu , ich) in der zweiten Runde in einem hart umkämpften Spiel leider in 3 Sätzen gegen die 6 Gesetzten Tschechen ausgeschieden. Im Doppel sind Michael Tomic und ich bis ins Viertelfinale gekommen wo wir starke Deutsche getroffen sind nach hartem Kampf verloren wir leider (30:29 , 14:21 , 8:21). Im großen und ganzen bin ich mit meiner Leistung zufrieden.</em></p><p><strong>[Bericht: Jannik Auberger]</strong></p>","2018-11-19","/content/news/Austrian-U17-International-2018/5c2d0498c5c3c.png","2");
INSERT INTO news VALUES("1035","OEsterreichische-Meisterschaften-der-Senioren-2018","Österreichische Meisterschaften der Senioren 2018","25","OEM||Top-News||","<h2>Österreichische Meisterschaften der Senioren 2018</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/OEsterreichische-Meisterschaften-der-Senioren-2018/5c2d04c9d0379.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/sen-ms18.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/sen-ms18-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/sen-ms18-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Zahlreiche Medaillen konnten die OÖ-Teilnehmer bei den diesjährigen österreichischen Meisterschaften der Senioren erspielen. Oberösterreichische Siege gab es im HE35 Markus Ratzenböck, DD40 Ursula Edelmüller/Christina Wu, MX40 Ursula Edelmüller/Harald Hochgatterer, HD40 Harald Hochgatterer/Roland Bauer, MX45 Reinhard Hechenberger/Sabine Aberer, HD45 Reinhard Hechenberger/Tarek El-Dabbagh, MX55 Tariq Farooq/Irene Matt und HE60 Tariq Farooq. Sowie unzählige weitere Medaillen.</strong></p><p><strong>Der oberösterreichische Badmintonverband gratuliert allen Medaillengewinnern/innen!!!</strong></p><p>Bericht von UBC Vorchdorf:<br>Sechs Medaillen für UBC-Oldies<br>Bei den Badminton Senioren Staatsmeisterschaften 2018 in Hohenems konnten die UBC Oldies Waltraud Kronsteiner, Rene Höller und Harald Starl sechs Medaillen für Vorchdorf gewinnen. Erfolgreichster UBC-Spieler war Harald Starl mit drei Vize-Staatsmeistertiteln. Starl hatte von allen 90 Teilnehmer die meisten Spiele zu absolvieren – insgesamt 11 mal und gesamt 25 Sätze waren für den „Marathonmann“ des Turniers zu bewältigen. Letztlich zollte Starl der Überbelastung tribut. Im Einzelfinale vergab er zudem gegen den Wiener Luber acht Satzbälle, ehe er mit 24:26, 18:21 unterlag. Im Mixed musste er sich mit Waltraud Kronsteiner dem Duo Farooq / Matt im Finale geschlagen geben, die damit für die Finalniederlage aus dem Vorjahr Revanche nahmen. Und auch im dritten Endspiel musste sich Starl mit Tariq Farooq gegen Steuer / Luber (Lochau / Wien) in drei Sätzen geschlagen geben. Waltraud Kronsteiner sicherte sich nach ihrer Silbermedaille im Mixed im Doppel gemeinsam mit Gina Bräule (Mödling) den dritten Platz. Seine zweite Medaille bei Staatsmeisterschaften konnte Rene Höller im Herrendoppel 35+ mit Wolfgang Zeiml (Neuhofen) gewinnen.</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-11-19","/content/news/OEsterreichische-Meisterschaften-der-Senioren-2018/5c2d04c9d0379.png","4");
INSERT INTO news VALUES("1036","Nachwuchs-LM-Die-OOE-Meister-von-2018-stehen-fest","Nachwuchs LM: Die O.Ö. Meister von 2018 stehen fest!","25","Nachwuchs||Top-News||","<h2>Nachwuchs LM: Die O.Ö. Meister von 2018 stehen fest!</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Nachwuchs-LM-Die-OOE-Meister-von-2018-stehen-fest/5c2d04f3f3265.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG-20181118-WA0000.png 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG-20181118-WA0000-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG-20181118-WA0000-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 17. und 18. November trafen sich 83 Burschen und Mädchen, 10 mehr als im Vorjahr, im Bundesschulzentrum Traun, um die O.Ö. Nachwuchs-Landesmeisterschaften 2018 zu ermitteln. Nicht nur die Meisten, 23 Mädchen und Burschen, sondern auch die erfolgreichsten TeilnehmerInnen kamen von der Union Ohlsdorf.</strong></p><p>Bei der Begrüßung bekundete Präsident Herbert Koch und Nachwuchsreferent Stephan Dlapka große Freude, über die, entgegen dem allg. Trend, gestiegene Teilnehmerzahl. Es wurde auch auf die bevorstehenden österr. Nachwuchsmeisterschaften hingewiesen, wo unser Bundesland durch einen Teil der Anwesenden vertreten sein wird. Aufgrund der gezeigten Leistungen sehen wir den Turnieren zuversichtlich entgegen. Der Nachwuchsreferent berichtete auch über zahlreiche Neuerungen im Trainings- und Spielbetrieb für das kommende Jahr. Dem jüngsten Teilnehmer und der jüngsten Teilnehmerin, beide sind 8 Jahre alt, wurde ein Babolat-Badminton Racket als Geschenk übergeben.</p><p>An den beiden Tagen waren 192 Spiele notwendig, um die Meister in den einzelnen Altersklassen und Bewerben zu ermitteln. Es war eine Freude den Mädchen und Burschen bei den sehr engagierten Matches zuzusehen. Auch die Disziplin und die Fairness am Court war sehenswert. Erfreulich auch die Tatsache, dass sich niemand ernsthaft verletzt hat und somit für die nächsten Ereignisse bereit ist. Zahlreiche TeilnehmerInnen waren in allen drei Bewerben angetreten, im Einzel, Doppel und Mixed, erfolgreich und gewannen alle Disziplinen.</p><p>U11: Haiböck Eric (BC Windischgarsten)<br>U13: Windauer Lorenz (Union Ohlsdorf)<br>U15: Windauer Jonas (Union Ohlsdorf)<br>U17: Niederhuber Kai (Union Neuhofen)<br>U22: Michael Schausberger (Union Ohlsdorf)</p><p>U11: Frühauf Xenia (BC Raiffeisen Alkoven)<br>U13: Dlapka Sarah (Union Ohlsdorf)<br>U15: Dlapka Kira (Union Ohlsdorf)</p><p>Die Siegerehrung wurde vom vielfachen Staatsmeister Jürgen Koch und vom Nachwuchsreferenten Stephan Dlapka durchgeführt. Durchwegs wurden die Medaillen, Pokale und Urkunden mit strahlenden Gesichtern entgegengenommen.</p><p>Alle Ergebnisse können auf <a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=8841FA3C-CDCA-4ED6-B6C6-F9897DB6D05B\"><em><strong>Tournamentsoftware</strong></em></a> nachgelesen werden.</p><p><strong>[Bericht: Askö Traun]</strong></p>","2018-11-19","/content/news/Nachwuchs-LM-Die-OOE-Meister-von-2018-stehen-fest/5c2d04f3f3265.png","2");
INSERT INTO news VALUES("1037","2-Bundesliga-Sieg-Unentschieden-und-Niederlage-fuer-OOE-Teams","2. Bundesliga: Sieg, Unentschieden und Niederlage für OÖ-Teams","25","Bundesliga||Top-News||","<h2>2. Bundesliga: Sieg, Unentschieden und Niederlage für OÖ-Teams</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/2-Bundesliga-Sieg-Unentschieden-und-Niederlage-fuer-OOE-Teams/5c2d0558734aa.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Gasper_IMG_E7084_web.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Gasper_IMG_E7084_web-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Gasper_IMG_E7084_web-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Die letzte Runde der Hinrunde brachte in der zweiten Bundesliga für die Teams aus OÖ gemischte Gefühle. Der BSC 70 Linz (Bild: Gasper Krivec) musste sich auswärts WBH Wien mit 3:5 geschlagen geben. Ebenso auswärts spielte Union Ohlsdorf. Die Ohlsdorfer konnten sich bei eisigen Temperaturen gegen den Tabellenführer Badminton Moving Wr. Neustadt behaupten und ein 4:4 Unentschieden erspielen. Der BC Raiffeisen Alkoven darf sich über einen knappen 6:2 Sieg über Union VRC Badminton (die auf einige Legionäre verzichteten) freuen.</strong></p><p>Damit gehen die Teams aus Oberösterreich mit teilweise sehr guten Positionen in die Rückrunde. Die Liga ist sehr ausgeglichen und wird von Badminton Moving Wr. Neustadt mit 13 Punkten angeführt. Dahinter folgt der BSC 70 Linz mit 11 Punkten sowie Union VRC Badminton und Ohlsdorf mit jeweils 10 Punkten. Im hinteren Drittel der Tabelle finden sich der WBH Wien mit 9 Punkten und BC Raiffeisen Alkoven mit 7 Punkten wieder.</p><p><strong>Statement von Reinhard Hechenberger (BSC 70 Linz)</strong><br>„<em>Nachdem die TOP 3 Mannschaften alle nicht gewinnen konnten schiebt sich die Tabelle eng zusammen und das Rennen um die Play-off Plätze bekommt neue Dynamik. Die Wiener, die schon zuletzt mit starken Leistungen für Aussehen sorgten, machten uns das Leben am Platz, wie auch in den Duellen in der 1. Bundesliga, besonders schwer. Auf Wiener Boden tun wir uns immer sehr schwer.</em>“</p><p><strong>Start der Rückrunde ist der 12. Jänner 2019 mit einem OÖ-Derby zwischen BC Raiffeisen Alkoven und BSC 70 Linz.</strong></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-12-03","/content/news/2-Bundesliga-Sieg-Unentschieden-und-Niederlage-fuer-OOE-Teams/5c2d0558734aa.png","2");
INSERT INTO news VALUES("1038","1-Bundesliga-Askoe-Traun-verteidigt-Tabellenfuehrung","1. Bundesliga: Askö Traun verteidigt Tabellenführung","25","Bundesliga||Top-News||","<h2>1. Bundesliga: Askö Traun verteidigt Tabellenführung</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/1-Bundesliga-Askoe-Traun-verteidigt-Tabellenfuehrung/5c2d05860843b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/1DM45047.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/1DM45047-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/1DM45047-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Im Schlagerspiel der Badminton Bundesliga besiegte der oberösterreichische Tabellenführer Askö Traun den Verfolger ASV Pressbaum. Nach hochklassigen und zum Großteil überaus spannenden Spielen brachte das letzte Spiel, das Mix- Doppel die Entscheidung. Die Trauner beenden damit die Hinrunde mit 15 Punkten als Tabellenführer. Dicht gefolgt mit 14 Punkten lauert der Vizemeister vom Vorjahr UBSC Wolfurt. Danach folgen der ASV Pressbaum mit 12 und Badminton Mödling mit 11 Punkten. Dahinter bereits etwas abgeschlagen askö kelag Kärnten mit 5 bzw. BC Mofort Feldkirch mit 3 Punkten.</strong></p><p><strong>Kommentar Herbert Koch (Askö Traun)</strong><br>„<em>Mit einem Sieg in den beiden Herren Doppel zu Beginn des Spieles hatten wir nicht wirklich gerechnet. Durch die Rückkehr von Peter Zauner ins bewährte Doppel mit Jürgen Koch gelang uns gegen das indonesisch/ englische Paar Pratama/ Stallwood nach spannendem und hochklassigem Verlauf die Führung. Die Leistung erinnerte an die beste Zeit der beiden Routiniers.</em></p><p><em></em></p><p><em>Das 2. HD Wolfgang Gnedt/ Collins Filimon und das Damen – Doppel Lisa Heidenreich/ Florentina Constantinescu bauten die Führung auf 3:0 aus. Das 1. Herren Einzel, Wolfgang Gnedt war erst kurz vor der Begegnung aus Cardiff zurückgekehrt, ging eindeutig an den Indonesier Adi Pratama. Collins Filimon steuerte den 4. Punkt im 2. Herren- Einzel bei. Das Unentschieden war damit mindestens gesichert. Die nächsten Begegnungen ergaben vor dem letzten Spiel, dem MIX- Doppel, eine 4:3 Führung zu unseren Gunsten.</em></p><p></p><p><em>Nach überaus dramatischen Spielverlauf setzte sich schließlich in der letzten Begegnung unser routiniertes Mix-Doppel Jürgen Koch/ Florentina Constantinescu äußerst knapp mit 21:18 und 26:24 durch. Der 5:3 Sieg war damit fixiert und die Tabellenführung verteidigt. Eine starke Leistung der gesamten Mannschaft.</em>“</p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2018-12-03","/content/news/1-Bundesliga-Askoe-Traun-verteidigt-Tabellenfuehrung/5c2d05860843b.png","2");
INSERT INTO news VALUES("1039","Rookie-Nikolaus-Turnier-in-Andorf","Rookie-Nikolaus-Turnier in Andorf","25","Nachwuchs||OOEBV-RLT||Top-News||","<h2>Rookie-Nikolaus-Turnier in Andorf</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Rookie-Nikolaus-Turnier-in-Andorf/5c2d06228065b.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/x12.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/x12-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/x12-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am Samstag den 01.12. veranstaltete der ATV Andorf ein Rookie-Turnier. Diese vom Nachwuchsarbeitskreis erarbeitete Turnierform, in der nun Anfänger<br>ihre ersten Turniererfahrungen machen können, wurde von den Vereinen sehr gut genutzt. So konnten wir in Andorf 36 Kinder aus 7 Vereinen begrüßen.</strong></p><p>Die jüngste Teilnehmerin war erst 6 Jahre alt. Es wurden die Bewerbe U11 Mädchen mit 10 Teilnehmerinnen und U11 Jungen mit 9 Teilnehmern gespielt. Im U13 und U19 Bewerb spielten Mädchen und Jungen gemeinsam so waren hier auch jeweils 9 und 8 Teilnehmer am Start. Die U15 SpielerInnen wurden je nach Spielstärke auf U19 oder U13 aufgeteilt, wobei die Spielstärke sowieso ein Kriterium ist, bei dieser neuen Turnierform, in welcher Altersklasse der Spieler spielt.</p><p>Nach pünktlichem Beginn konnte bereits um 14:30 die Siegerehrung mit folgenden Siegern durchgeführt werden:</p><p><strong>U11 Mädchen </strong><br>1. Dalila Sekeric<br>2. Jasmin Eder<br>3. Dana-Lynn Grafinger</p><p><strong>U11 Jungen</strong><br>1. Matthias Dopf<br>2. Xaver Emprechtinger<br>3. Emil Emprechtinger</p><p><strong>U13 Gemischt</strong><br>1. Alexander Puschl<br>2. Moritz Auberger<br>3. Felix Neuhuber</p><p><strong>U19 Gemischt</strong><br>1. David Engelberger<br>2. Niklas Fichtner (12 Jahre)<br>3. Eric Hayböck (10 Jahre)</p><p>Mit besonderer Freude möchte ich sagen, dass man bereits von den Kindern motivierte, tolle und beeindruckende Spiele gesehen hat. Wir hoffen, dass das Turnier für alle Trainer, Eltern und Kinder zufriedenstellend war und auch viel Spaß gemacht hat.</p><p>Zum Schluss möchte ich allen, im Namen des ATV Andorf, ein schöne besinnliche Adventszeit wünschen.</p><p><strong>[Bericht: Alexander Mittermayr]</strong></p>","2018-12-05","/content/news/Rookie-Nikolaus-Turnier-in-Andorf/5c2d06228065b.png","5");
INSERT INTO news VALUES("1040","9-OOEBV-Doppel-RLT-MD-in-Haid","9. OÖBV Doppel-RLT (MD) in Haid","25","OOEBV-RLT||Top-News||","<h2>9. OÖBV Doppel-RLT (MD) in Haid</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/9-OOEBV-Doppel-RLT-MD-in-Haid/5c2d065a4ca19.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_9_OÖBV_Doppel-RLT_02.12.2018.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_9_OÖBV_Doppel-RLT_02.12.2018-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Siegerfoto_MD_9_OÖBV_Doppel-RLT_02.12.2018-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am Sonntag den 02. Dezember war die Sporthalle Haid der Austragungsort für das letzte Doppelturnier in der Saison 2017/2018. Es waren einige neue Gesichter unter den 25 Doppelpaarungen zu sehen die aus 19 verschiedenen Vereinen kamen. Der Altersdurchschnitt von den 50 Spieler/Innen aus Salzburg, Niederösterreich und Oberösterreich war 35,6 Jahre.</strong></p><p>Das Turnier startete erst um 10:10 Uhr da es ein kleines technisches Problem gab und wurde mit der Siegerehrung um 16:30 Uhr beendet. Zur Begrüßung gab es ein kleines Goody in Form von Duplo und zugleich eine kleine Smiley-Tombola. Die Teilnehmer/Innen lieferten sich auf 6 Spielfeldern spannende und zum Glück auch verletzungsfreie Spiele. Der Spaßfaktor kam auch nicht zu kurz und somit war es wieder ein großer Sieg für den Badmintonsport. Anbei die Auflistung der besten vier Paarungen, alle anderen Platzierungen sind in der <a href=\"http://obv.tournamentsoftware.com/sport/event.aspx?id=F0F63947-9490-44C3-BF16-0796A4D8C9AB&event=12\"><em><strong>Tournamentsoftware</strong></em></a> ersichtlich.</p><p><strong>Mixed-Doppel:</strong><br>1. Platz Alexandra Schwetz / Christoph Hajek<br>2. Platz Lisa Dober / Christian Adler<br>3. Platz Michaela Reifetshammer / Jürgen Schmidt<br>4. Platz Carola-Bianca Mauhart / Bernhard Gruber</p><p>Ein herzliches und großes DANKE, an alle Teilnehmer/Innen sowie an alle helfenden Hände vom ASK Nettingsdorf-Badminton/Racketlon im Buffet und bei der Turnierleitung. Der ASK Nettingsdorf-Badminton/Racketlon wünscht allen eine schöne und besinnliche Weihnachtszeit und einen guten Rutsch ins neue Jahr 2019. Die TA-App sollten fast alle Spieler/Innen aus Salzburg und Oberösterreich auf ihrem Handy haben, Suchbegriff im Play-Store oder App-Store ist „Turnieranmeldung“ somit ist man mit drei Klicks im Turniergeschehen. In diesem Sinne, man sieht sich in der neuen OÖBV-Doppel-Turnierserie 2019 am 6. Jänner in Vorchdorf.</p><p><strong>[Bericht: Peter Krenmayr]</strong></p>","2018-12-05","/content/news/9-OOEBV-Doppel-RLT-MD-in-Haid/5c2d065a4ca19.png","2");
INSERT INTO news VALUES("1041","Bericht-ueber-die-OEsterreichischen-Meisterschaften-der-Schueler-in-Weiz","Bericht über die Österreichischen Meisterschaften der Schüler in Weiz","25","Nachwuchs||OEBV-RLT||Top-News||","<h2>Bericht über die Österreichischen Meisterschaften der Schüler in Weiz</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Bericht-ueber-die-OEsterreichischen-Meisterschaften-der-Schueler-in-Weiz/5c2d06a2a7db9.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_3057.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_3057-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_3057-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Von 8.12.-9.12.2018 fanden in Weiz in der Steiermark die Österreichischen Meisterschaften der Schüler, also der U13 und U15 statt. Aus Oberösterreich reisten insgesamt 11 Spieler aus den Vereinen Alkoven, Ohlsdorf und Traun an, um sich die eine oder andere Medaille in den Einzel-, Doppel- und Mixedbewerben zu erspielen.</strong></p><p>Unterstützt wurden sie dabei von unserem Landestrainer Peter Zauner. Trotz starker Konkurrenz aus den badmintonstarken Bundesländern wurden die Spielerinnen und Spieler auch großteils für ihre Bemühungen belohnt. Dabei konnte sogar ein Titel im Damendoppel U13 gewonnen werden, den Sarah Dlapka (Ohlsdorf) mit ihrer Vorarlberger Partnerin sogar ohne Satzverlust erringen konnte. Nebenbei erreichte Sarah im Dameneinzel und mit ihrem Vereinskollegen Lorenz Windauer im Mixed Doppel U13 die Bronzemedaille und wurde damit die erfolgreichste oberösterreichische Teilnehmerin bei diesen Titelkämpfen. Lorenz Windauer und Sebastian Huber (beide Ohlsdorf) erreichten im Herrendoppel U13 die Bronzemedaille. Ebenso konnten auch Hanna Gillesberger (Ohlsdorf) mit ihrer Partnerin Raffaela Frühauf (Alkoven) die Bronzemedaille im Damendoppel U13 mit nach Hause nehmen, bei wenigen mehr erspielten Punkten wäre es sogar der 2. Platz geworden. Für die weiteren Stockerlplätze aus oberösterreichischer Sicht sorgen Kira Dlapka (Ohlsdorf) im Damendoppel U15 und Jonas Windauer (Ohlsdorf) im Herrendoppel U15 jeweils mit ihren Doppelpartnern aus Kärnten.</p><p>Insgesamt hat man aber gesehen, dass die Konkurrenz besonders im Einzel doch momentan in dieser Altersklasse sehr stark ist. Daher wird in der nächsten Zeit intensives Training notwendig sein, um diese Kluft etwas kleiner werden zulassen.</p><p><strong>[Bericht: Jonas Windauer – Ohlsdorf]</strong></p>","2018-12-11","/content/news/Bericht-ueber-die-OEsterreichischen-Meisterschaften-der-Schueler-in-Weiz/5c2d06a2a7db9.png","4");
INSERT INTO news VALUES("1042","FZ-FORZA-U17-Medvode-International-2018","FZ FORZA U17 Medvode International 2018","25","International||Nachwuchs||Top-News||","<h2>FZ FORZA U17 Medvode International 2018</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/FZ-FORZA-U17-Medvode-International-2018/5c2d06d2c2b22.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-12-10-at-20.10.08.png 485w, http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-12-10-at-20.10.08-160x90.png 160w, http://www.badminton-ooe.at/wp-content/uploads/WhatsApp-Image-2018-12-10-at-20.10.08-317x180.png 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am Donnerstag, 29.11 2018 starteten wir um die Mittagszeit unsere Reise vom Salzburger Hauptbahnhof nach Ljubjana wo wir nach ca 5-stündiger Fahrt ankamen.</strong></p><p><strong>Fazit Jannik Auberger – ASKÖ Traun:</strong> <em>Leider hatte ich im Einzel gleich in der ersten Runde den auf 2 gesetzten Slowenen Miha Masten. Im ersten Satz gelang es mir gut mitzuhalten leider konnte ich meiner guten Leistung im 2ten Satz nicht mehr folgen. Mit leichten Eigenfehlern gab ich das Spiel aus der Hand (18-21, 6:21). Leider hatten wir im Mix (Karoline Pottendorfer und Ich) im Viertelfinale diean 1 gesetzten Serben Mihajlo Tomic und Sara Loncar. Nach schwachem Start im ersten Satz, der auch schnell verloren ging, steigerten wir unsere Leistung. Trotz guter Leistung verloren wir schlussendlich (9:21, 15:21) Im Doppel spielten wir (Bäuerle Tobias und ich) in der Ersten Runde gegen die an 8 gesetzten Ungarn Sebestyen Nagy und Gergely Szita. Mit sehr vielen Eigenfehlern nahmen wir uns die Chance zu gewinnen und verloren leider (12-21, 15-21)</em></p><p><strong>Fazit Kai Niederhuber – Union Neuhofen:</strong> <em>Im Einzel scheiterte ich in der 2ten Runde gegen den an 4 gesetzten Polen Andrzey Niczyporuk. Trotz guter Leistung konnte ich nicht die nötigen Punkte machen und verlor (20-22,14:21)Im Mixdoppel hatten wir (Emily Wu und Ich) im Viertelfinale ungesetzte Spanier als Gegner. Mit etwas Glück haben wir den dritten Satz nach 17:20Rückstand mit 22:20 noch für uns entscheiden können. Wir gewannen (21-18,10-21,22:20) Leider endete unser Turnier im Mixdoppel im Halbfinale als 6 gesetzte gegen die an 2 gesetzten Spanier Jacobo Fernandez und Lucia Rodriguez mit guter Leistung im ersten Satz. Leider machten wir machten wir im 2tenSatz zu viele Fehler und verloren (22-24, 14-21) Im Doppel mit Michael Tomic an Nr. 3 gesetzt gelang mir mein bisher größter Erfolg. Wir scheiterten erst im Finale gegen die an 1 gesetzten Serben Sergej Lukic und Mihajlo Tomic mit guter Leistung. (14-21,16:21)</em></p><p>Zusammenfassend war es ein sehr erfolgreiches Turnier für uns beide mit dem 2. Platz im Doppel und dem 3. Platz im Mix, sowie einigen sehr guten Spielen auf internationaler Bühne.</p><p><strong>[Bericht von Kai Niederhuber]</strong></p>","2018-12-20","/content/news/FZ-FORZA-U17-Medvode-International-2018/5c2d06d2c2b22.png","6");
INSERT INTO news VALUES("1043","5-Medaillen-fuer-den-OOEBV-bei-den-oesterr-Meisterschaften-U17U19","5 Medaillen für den OÖBV bei den österr. Meisterschaften U17/U19","25","Nachwuchs||OEM||Top-News||","<h2>5 Medaillen für den OÖBV bei den österr. Meisterschaften U17/U19</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/5-Medaillen-fuer-den-OOEBV-bei-den-oesterr-Meisterschaften-U17U19/5c2d0703ca763.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/Bericht-OÖBV.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/Bericht-OÖBV-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/Bericht-OÖBV-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>5 Medaillen für den OÖBV, eine in Gold, bei den Österreichischen Meisterschaften U17 & U19</strong></p><p><strong>Von 15.12-16.12.2018 fanden in Judenburg die österreichischen Meisterschaften der Jugend statt. Aus oberösterreichischer Sicht nahmen insgesamt 7 Spieler von 4 verschiedenen Vereinen teil.</strong></p><p>Im Rahmen der Wettkämpfe wurde also wieder um Medaillen gekämpft. Trotz starker Konkurrenz von den anderen Bundesländern konnten 5 Medaillen gefeiert werden. Kai Niederhuber (UBC Neuhofen) avancierte zum erfolgreichsten oberösterreichischen Teilnehmer, mit einer Goldmedaille (MX U17) und einer Silbermedaille (HD U17). Weiters sorgten Luca Froschauer (ASKÖ Traun) mit zwei Bronzemedaillen (HD U19, HE U19) und Adrian Schwarzmann (BC Windischgarsten) mit einer Bronzemedaille (HD U17) für weitere Medaillen.</p><p>Ein großer Dank gilt den Betreuern, die eine sichere Hin- und Rückfahrt ermöglicht und die oberösterreichischen Spieler tatkräftig unterstützt haben.</p><p><strong>[Bericht: Adrian Schwarzmann]</strong></p>","2018-12-20","/content/news/5-Medaillen-fuer-den-OOEBV-bei-den-oesterr-Meisterschaften-U17U19/5c2d0703ca763.png","10");
INSERT INTO news VALUES("1044","Prosit-Neujahr","Prosit Neujahr","25","Top-News||","<h2>Prosit Neujahr</h2><p><img width=\"320\" height=\"180\" src=\"/content/news/Prosit-Neujahr/5c2d0791d4c91.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/HP-001-320x180.jpg 320w, http://www.badminton-ooe.at/wp-content/uploads/HP-001-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/HP-001.jpg 485w\" sizes=\"(max-width: 320px) 100vw, 320px\" class=\"fr-fic fr-dii fr-fil\"></p><p><br></p>","2018-12-27","/content/news/Prosit-Neujahr/5c2d0791d4c91.png","6");
INSERT INTO news VALUES("1045","Neue-Ranglisten-online","Neue Ranglisten online","25","Nachwuchs||Top-News||","<h2>Neue Ranglisten online</h2><p><img width=\"320\" height=\"160\" src=\"/content/news/Neue-Ranglisten-online/5c3e3559b147d.png\" alt=\"\" class=\"fr-fic fr-dii fr-fil\"></p><p>Die neuen Ranglisten, die für die diesjährigen Nachwuchs Einzelturniere gelten sind nun online u</p>","2019-01-03","/content/news/Neue-Ranglisten-online/5c3e3559b147d.png","6");
INSERT INTO news VALUES("1046","Lokalmatadore-Hoeller--Gruber-siegten-in-Vorchdorf","Lokalmatadore Höller / Gruber siegten in Vorchdorf","25","OOEBV-RLT||Top-News||","<h2>Lokalmatadore Höller / Gruber siegten in Vorchdorf</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/Lokalmatadore-Hoeller--Gruber-siegten-in-Vorchdorf/5c3e357ef3e97.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_20190106_180321.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20190106_180321-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20190106_180321-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>23 Herrendoppel und 8 Damendoppel beteiligten sich bei ersten Badminton Turnier des Jahres 2019, dem 1. OÖBV Doppel RLT in Vorchdorf.</strong></p><p>Nach vielen spannenden und teils auch überraschenden Vorrundenspielen konnten sich letztlich die beiden Lokalmatadore des UBC Vorchdorf, Rene Höller und Bernhard Gruber als Turniersieger feiern lassen. Sie bezwangen im Finale Christian Putz / Jürgen Schmidt (UBC Neuhofen) mit 19:21, 21:12, 21:13. Rang drei ging an die Salzburger Wolfgang Harl / Ralf Stiglbauer.</p><p>Bei den Damen konnten sich die Topgesetzten Lisa Dober / Tanja Edlacher (SKV Pottenbrunn) im Finale gegen Carola-Bianca Mauhart / Kerstin Knogler 8ASK Nettingsdorf) mit 21:16, 21:16 durchsetzen. Rang drei ging an Julia Pohlmüller / Sarah Anleitner (ASKÖ Traun / ATSV Steinbach /Grünburg).</p><p><strong>[Bericht: UBC Vorchdorf – Harald Starl]</strong></p>","2019-01-15","/content/news/Lokalmatadore-Hoeller--Gruber-siegten-in-Vorchdorf/5c3e357ef3e97.png","11");
INSERT INTO news VALUES("1047","OOE-NACHWUCHS-Ranglistenturnier-2019-nach-dem-neuen-System","OÖ-NACHWUCHS-Ranglistenturnier 2019 nach dem neuen System","25","Nachwuchs||Top-News||","<h2>OÖ-NACHWUCHS-Ranglistenturnier 2019 nach dem neuen System</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/OOE-NACHWUCHS-Ranglistenturnier-2019-nach-dem-neuen-System/5c3e35cc4f911.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/IMG_20190112_145126730_2.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20190112_145126730_2-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/IMG_20190112_145126730_2-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Am 12./13. Jänner 2019 fand das erste OÖ-NACHWUCHS-Ranglistenturnier in Ohlsdorf statt. Zum ersten Mal wurden dabei am Samstag die A-Bewerbe der Burschen und Mädchen und am Sonntag die B-Bewerbe der Burschen und Mädchen bzw. der C-Bewerb bei den Burschen gespielt. Im A-Bewerb spielten die besten 13 Nachwuchsspieler bei den Burschen und Mädels aus Oberösterreich um den Sieg.</strong></p><p>Lauter durchwegs gute und vor allem spannende Spiele brachten am Nachmittag bei den Burschen Stefan Schausberger und bei den Mädchen Kira Dlapka als Sieger (beide Union Ohlsdorf) hervor. Im B-Bewerb am Sonntag gewannen dann Iker Preiner (Salzburg) beiden Burschen (16 Teilnehmer) und Hannah Durchschlag (Union Ohlsdorf) bei den Mädels (11 Teilnehmerinnen) und dürfen sich als Sieger des B-Bewerbes darüberfreuen, beim nächsten Turnier dann im A-Bewerb zu spielen. Den C-Bewerb bei den Burschen (5 Teilnehmer) gewann Lorenz Mair (Union Ohlsdorf), der dann beim nächsten Mal im B-Bewerb spielen darf.</p><p>Das neue System, das die Altersklassen ablöst, traf fast überall auf große Zustimmung. Die Vorteile liegen eigentlich klar auf der Hand, zum einen müssen keine Altersklassen wegen zu geringer Teilnehmerzahl abgesagt werden, zum anderen waren eine Großzahl der Spiele viel ausgeglichener und spannender als beim traditionellen Altersklassensystem. Nun bleibt nur noch zu hoffen, dass das System auch den gewünschten Nutzen bringt, nämlich das unser Nachwuchs durch die Spiele mehr gefordert wird und sich dadurch weiterentwickelt. Die neuen Ranglisten für die nächsten Turniere sind nach der Auswertung gemeinsam mit der Systemerklärung dann auf der Homepage ersichtlich.</p><p><strong>[Bericht: Stephan Dlapka – Union Ohlsdorf]</strong></p>","2019-01-15","/content/news/OOE-NACHWUCHS-Ranglistenturnier-2019-nach-dem-neuen-System/5c3e35cc4f911.png","11");
INSERT INTO news VALUES("1048","2-Bundesliga-BSC-70-Linz-haelt-Anschluss-an-Spitze","2. Bundesliga: BSC 70 Linz h&auml;lt Anschluss an Spitze","25","Bundesliga||Top-News||","<h2>2. Bundesliga: BSC 70 Linz h&auml;lt Anschluss an Spitze</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/2-Bundesliga-BSC-70-Linz-haelt-Anschluss-an-Spitze/5c3e35f3d72db.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/40172594042_66fabb3809_z.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/40172594042_66fabb3809_z-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/40172594042_66fabb3809_z-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Der BSC 70 Linz hat zum Start in die R&uuml;ckrunde den Anschluss an die Spitze gehalten. Die Linzer besiegten ausw&auml;rts den BC Raiffeisen Alkoven mit 5:3. Der Tabellenf&uuml;hrer Badminton Moving Wr. Neustadt besiegt ebenfalls ausw&auml;rts Union VRC Badminton mit 6:2. Der dritte O&Ouml;-Vertreter in der 2. Bundesliga Union Ohlsdorf verlor ausw&auml;rts gegen WBH Wien knapp mit 3:5.</strong>-&gt;</p><p>Der BSC 70 Linz bleibt damit vorerst auf dem zweiten Platz hinter Badminton Moving Wr. Neustadt. Der WBH konnte mit dem Sieg gegen Ohlsdorf an der Ober&ouml;sterreichern vorbeiziehen und belegt nun den 3. Platz. Dahinter rangiert punktegleich mit den Ohlsdorfern Union VRC Badminton. Die rote Laterne h&auml;lt der BC Raiffeisen Alkoven.</p><p><strong>Nachfolgend das Statement vom BSC 70 Linz:</strong><br><em>Mit einer soliden Leistung kamen wir zu dem Sieg gegen Alkoven. Auch wenn wir den Druck des Siegens hatten, zeigten die Spieler bei den Siegen solide Leistungen. Aufgrund von mehrerer Ausf&auml;lle mussten wir kurzerhand die Formationen ver&auml;ndern. Nachdem auch Gasper Krivec verhindert war, musste Mannschaftsf&uuml;hrer Harald Hochgatterer im 2. Einzel einspringen.<br>F&uuml;r die n&auml;chste Bundesligarunde m&uuml;ssen wir uns in einigen Bereichen verbessern. Hoffentlich k&ouml;nnen wir dann auch wieder auf den kompletten Kader zur&uuml;ckgreifen. Die Spiele gegen die beiden Wiener Clubs, die aktuell die direkten Konkurrenten um den Playoff Platz sind, gilt es positiv zu gestalten. Die beiden Begegnungen ausw&auml;rts verloren wir jeweils. Bleibt zu hoffen, dass wir zu Hause unsere St&auml;rke besser n&uuml;tzen k&ouml;nnen.</em></p><p><strong>[Bericht: Redaktion &ndash; Lukas Rebhandl]</strong></p>","2019-01-15","/content/news/2-Bundesliga-BSC-70-Linz-haelt-Anschluss-an-Spitze/5c3e35f3d72db.png","12");
INSERT INTO news VALUES("1049","1-Bundesliga-Askoe-Traun-bleibt-Tabellenfuehrer","1. Bundesliga: Askö Traun bleibt Tabellenführer","25","Bundesliga||Top-News||","<h2>1. Bundesliga: Askö Traun bleibt Tabellenführer</h2><p><img width=\"317\" height=\"180\" src=\"/content/news/1-Bundesliga-Askoe-Traun-bleibt-Tabellenfuehrer/5c3e3620e9acd.png\" alt=\"\" oldsource=\"http://www.badminton-ooe.at/wp-content/uploads/20190112_150445.jpg 485w, http://www.badminton-ooe.at/wp-content/uploads/20190112_150445-160x90.jpg 160w, http://www.badminton-ooe.at/wp-content/uploads/20190112_150445-317x180.jpg 317w\" sizes=\"(max-width: 317px) 100vw, 317px\" class=\"fr-fic fr-dii fr-fil\"></p><p><strong>Askö Traun hat am Wochenende zum Start in der Rückrunde auswärts gegen askö kelag Kärnten mit 5:3 gewonnen. Die Trauner verteidigen damit die Tabellenführung in der 1. Bundesliga. Die weiteren Ergebnisse: Raiffeisen UBSC Wolfurt besiegt Zuhause Badminton Mödling; ASV Pressbaum holt einen Auswärtssieg gegen BC Feldkirch.</strong></p><p><strong>Nachfolgend das Statement von Askö Traun (Herbert Koch): </strong><br><em>Gott sei Dank ist die Anreise nach dem Schneeproblem von Peter Zauner letztlich normal verlaufen. Die Vorbereitungen in der Halle waren im normalen Umfang gewährleistet. Die Kärntner haben sich in der Begegnung einigermaßen zur Wehr gesetzt. Unsere Routiniers Jürgen Koch und Peter Zauner, Lisa Heidenreich und Florentina Constantinescu, sicherten die erforderlichen Punkte für unsere Mannschaft. Filimon Collins steuerte den 5. Punkt bei.</em></p><p><em>In der Winter- Übertrittszeit hat sich der ASV Pressbaum mit einem Weltklasseathleten aus Indonesien maßgeblich verstärkt. Die Niederösterreicher bleiben, genauso wie der UBSC Wolfurt, ein starker Konkurrent um den Meistertitel. Beide haben Ihre Spiele am Wochenende ebenfalls gewonnen. Am 26. und 27.1. geht es in einer Doppelrunde gegen Mödling und Feldkirch zu Hause schon wieder weiter.</em></p><p><strong>[Bericht: Redaktion – Lukas Rebhandl]</strong></p>","2019-01-15","/content/news/1-Bundesliga-Askoe-Traun-bleibt-Tabellenfuehrer/5c3e3620e9acd.png","14");
