INSERT INTO news VALUES("1075","OOEBV-Nachwuchs-ABC-Ranglistenturnier","OÖBV Nachwuchs A,B,C Ranglistenturnier","24","","<h2>OÖBV Nachwuchs A,B,C Ranglistenturnier</h2><p><span class=\"fr-img-caption fr-fic fr-fil fr-dib\" style=\"width: 338px;\"><span class=\"fr-img-wrap\"><img src=\"/content/news/OOEBV-Nachwuchs-ABC-Ranglistenturnier/5c8800e32736b.png\" style=\"width: 389px;\"><span class=\"fr-img-wrap\"><img src=\"/content/news/OOEBV-Nachwuchs-ABC-Ranglistenturnier/5c8800e32792e.png\" href=\"https://qweqwewq.asdasd.ggdf234234.dfsda\">https://qweqwewq.asdasd.ggdf234234.dfsda</a><br></span></span></span></p><p>Bereits 3 Runden vor Ende der Saison stand das 2. Team des BSC 70 Linz praktisch als OÖ. Landesmeister fest.<br>Nur mehr theoretisch waren die Linzer noch von der Konkurrenz einholbar, hätten diese alle Spiele mit 8:0 gewinnen<br>müssen und die Linzer hätten keine weitere Begegnung gewinnen oder unentschieden spielen dürfen.<br>Das Team  des BSC 70 Linz 2 verlor aber in den letzten 4 Saisons maximal 1 Begegnung pro Spielzeit.</p><p>Am Do. 07.03.2019 spielte das Team gegen die 2. Mannschaft von Bundesligist Alkoven und gewann dieses<br>souverän mit 6:2. Damit war der Landesmeistertitel endgültig besiegelt.<br>Es wurden 2 Runden innerhalb der letzten 5 Tage absolviert.<br>Mit dem 17. Titel ziehen die Linzer in der Statistik weiter davon. Nächst erfolgreich sind die Sportfreunde aus Traun.<br>Askö Traun steht derzeit bei 13. OÖ. Landesmeistertitel.</p><p>Am letzten Spieltag (25.3.) wird es zum Saisonabschluss beim abgeschlagenen Letzten \'ATSV Steyr\' kommen.</p><p><strong>Statement des Obmanns des BSC 70 Linz (Reinhard Hechenberger)</strong></p><p>„Unsere 2. Mannschaft ist eine sehr ausgeglichene und starke Mannschaft. Wir haben daher viele Aufstellungsvarianten und auch<br>Ausfälle bei den Herren können wir kompensieren. Unsere Spieler freuen sich auf jede Begegnung und oft ist es für den Mannschaftsführer<br>Christoph Kainrath schwer die Mannschaft aufzustellen. Ziel ist es immer so viele Spieler einzusetzen wie es geht bzw. wie es Sinn macht.<br>Seit dem Jahr 2010 gingen 5 der 9 möglichen Team Landesmeistertitel an uns. Seit dem Jahr 2000 immerhin auch noch 8 von 19</p>","2019-03-12","/content/news/OOEBV-Nachwuchs-ABC-Ranglistenturnier/5c8800e32736b.png","1");
