INSERT INTO page_content VALUES("28","senioren","1","<p><br></p><h3>Serior Master 2016</h3><p>Der ober&ouml;sterreichische Badmintonverband und der Veranstalter Ask&Ouml; Traun richten das 4. O&Ouml;BV Senior Masters 2016 aus. Das Turnier ist ein reines Doppelturnier und wird am Samstag 14. Mai bis Sonntag 15. Mai 2016 ausgetragen. Ein besonderes Highlight wird die Players-Party mit Tombola und Tischzauberei sein. Nachfolgend die Details.</p><p><br></p><p>Veranstalter: Ober&ouml;sterreichischer Badminton Verband<br>Ausrichter: ASK&ouml; Traun, www.badminton-traun.at<br>Austragungsort: Bundesschulzentrum Traun, Schulstra&szlig;e 59/Eingang Kreuzfeldstra&szlig;e 7, 4050 Traun<br>7 Spielfelder</p><p>Termin: Samstag, 14. Mai 2015 - Sonntag, 15. Mai 2016<br>Beginnzeit: 10:00 Uhr (Samstag), 09:30 Uhr (Sonntag)<br>Turnierablauf: Beginn mit MXD.<br>Nach der Auslosung wird der Ablauf im Internet bekannt gegeben. Bewerbe: HD, DD und MXD</p><p>Alterslimit: Die TeilnehmerInnen m&uuml;ssen vor dem 1.1.1981 geboren sein (&uuml;ber 35 Jahre)<br>Altersklassen: z&auml;hlt das Gesamtalter der Paarung: 70+, 80+, 90+, 100+, 110+, 120+, 130+ (z.B. TeilnehmerIn-1: 35 Jahre und TeilnehmerIn-2: 40 Jahre = Altersklasse 70+)<br>Wenn in einer Altersklasse weniger, als 4 Teilnehmer gemeldet sind, werden Altersklassen zusammengezogen.<br>Spielmodus: Jede Paarung in der gegebenen Disziplin hat mind. 3 Spiele. Bei 4 bis 5 TeilnehmerInnen in der Altersklasse spielt jeder gegen jeden.<br>B&auml;lle: m&uuml;ssen von den Teilnehmern gestellt werden. Als Richtlinie gilt die Ballzulassung des &ouml;BV. Andere B&auml;lle, z.B. Kunstoffb&auml;lle sind nur dann erlaubt, wenn der Gegner einverstanden ist.<br>Nennungen: An Ask&Ouml; Traun Badminton: herbert.koch@gmx.at oder auf www.badminton-traun.at<br>Spielerlizenz nicht unbedingt erforderlich!<br>Nennschluss: Montag, 9. Mai 2016<br>Nenngeld: &euro; 10,- pro Teilnehmer/in, je Bewerb</p><p>Auskunft: Herbert Koch, herbert.koch@gmx.at , 0664-240 75 56<br>Preise: Pokale f&uuml;r SiegerInnen, Medaillen und Urkunden f&uuml;r Platzierte, Sachpreise&Uuml;bernachtung: Hotel Almtalerhof***, Leerwies 1, 4050 Traun, 07229-733 01-0, almtalerhof@aon.at, <a href=\"//www.almtalerhof.at\">www.almtalerhof.at</a></p><p><br></p><h3>Serior Master 2015</h3><p><strong>Doppelturnier der besonderen Art</strong></p><p>Veranstalter: Ober&ouml;sterreichischer Badminton Verband</p><p><br></p><p>Ausrichter:&nbsp;<strong>ASK&Ouml; Traun</strong></p><p>Austragungsort:<br><strong>Bundesschulzentrum Traun</strong> - 7 Spielfelder (Eingang Kreuzfeldstra&szlig;e 7)</p><p>Termin:<br><strong>Samstag, 2. Mai 2015 - Sonntag, 3. Mai 2015</strong></p><p>Beginnzeit:<br>10:00 Uhr (Samstag), 09:30 Uhr (Sonntag)</p><p>Turnierablauf:<br>Beginn mit MXD. Nach der Auslosung wird der Ablauf im Internet bekannt gegeben.</p><p>Bewerbe: HD, DD und MXD</p><p>Link zur Tournamentsoftware:<br><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=A2232258-138D-48C0-87E1-A4BCB8A3A3A1\">Tournamentsoftware</a></p><p>Alterslimit:<br>Die Teilnehmer m&uuml;ssen vor dem 1.1.1980 geboren sein (&uuml;ber 35 Jahre)</p><p>Altersklassen:<br>z&auml;hlt&nbsp;<strong>das Gesamtalter der Paarung</strong>: 70+, 80+, 90+, 100+, 110+, 120+, 130+<br>(z.B. Teilnehmer-1: 35 Jahre und Teilnehmer-2: 40 Jahre = Altersklasse 70+)<br>Wenn in einer Altersklasse weniger, als 4 Teilnehmer gemeldet sind, werden 2 Altersklassen zusammengezogen.</p><p>Spielmodus:<br>Jede Paarung in der gegebenen Disziplin hat mind. 3 Spiele. Bei 4 bis 5 Teilnehmern in der Altersklasse spielt jeder gegen jeden. Sonst wird nach Schweizer System gelost</p><p>B&auml;lle:<br>m&uuml;ssen von den Teilnehmern gestellt werden. Als Richtlinie gilt die Ballzulassung des &Ouml;BV.</p><p>Nennungen:<br>direkt, vom Verein oder Verband an das Sekretariat des O&Ouml;BV:&nbsp;<a href=\"mailto:%20ooe-badmintonverband@aon.at\">ooe-badmintonverband@aon.at</a></p><p>Nennschluss:&nbsp;<strong>Montag, 27. April 2015</strong></p><p>Nenngeld: &euro; 10,- pro Teilnehmer, je Bewerb</p><p><strong>Auslosung: Donnerstag, 30. April 2015</strong></p><p>Turnierleitung: ASK&Ouml; Traun</p><p>Oberschiedsrichter: Klaus Mitterhauser, Janos Halasz</p><p>Auskunft: Herbert Koch -&nbsp;<a href=\"mailto:%20herbert.koch@gmx.at\">herbert.koch@gmx.at</a> - Handy 0664 2407556</p><p>&Uuml;bernachtung: Hotel Almtalerhof***, Leerwies 1, 4050 Traun, Tel. +43/7229/73301-0,&nbsp;<a href=\"mailto:%20almtalerhof@aon.at\">almtalerhof@aon.at</a> -&nbsp;<a href=\"https://www.almtalerhof.at/\">www.almtalerhof.at</a></p><p>Players Party: Samstag ca. 20:00 Uhr im Bundesschulzentrum mit Rahmenprogramm (Unkostenbeitrag &euro; 10,- f&uuml;r Speisen/Getr&auml;nke)</p><p><br></p><h3>Serior Master 2012</h3><p>Am 26./27.10.20112 fand bereits das zweite Senior Masters statt. Spielberechtigt waren alle Senioren ab 35 Jahre. 41 Teilnehmer aus 6 Bundesl&auml;ndern fanden sich am Nationalfeiertag in Linz/Urfahr ein.</p><p><br></p><p><strong>Sieger:<br>Herrendoppel:</strong><br>HD 70 : Tarek El Dabbagh + Gerhard Mayr<br>HD 100: Wolfgang Luber + Max Pichler<br>HD 109: Joachim Bergner + Walter Struger<br>HD Senior Super Finals: Tarek El Dabbagh + Gerhard Mayr</p><p><strong>Damendoppel:</strong><br>DD 80: Anja Friedrich + Elisabeth Pr&ouml;ll</p><p><strong>Mixdoppel:</strong><br>MD 70: Harald Friedrich + Anja Friedrich<br>MD 100: Harald Starl + Waltraud Kronsteiner</p><p><a href=\"http://obv.tournamentsoftware.com/sport/winners.aspx?id=CE262E3F-47CF-4FE5-AF0F-60698D930C67\">Tournamentsoftware</a></p><p><br></p><h3>Serior Master 2011</h3><p>Am 26.10.2011 fand, angeregt durch den O&Ouml;BV-Seniorenreferenten Janos Halasz, das erste Senior Masters in Neuhofen statt. Es sollte ein &Ouml;sterreich weites Turnier f&uuml;r den Altersbereich ab 35 Jahren durchgef&uuml;hrt werden.47 Teilnehmer aus 7 Bundesl&auml;ndern fanden sich am Nationalfeiertag in Neuhofen in einem mit den ) 9 Landesfahnen sch&ouml;n geschm&uuml;ckten Turnsaal ein.Die Er&ouml;ffnung machte Gerhard Brunnbaur (Union Vorstandsmitglied aus Neuhofen), der in seiner Ansprache &auml;u&szlig;erst lobend erw&auml;hnte, welch tolle Idee diese bundesl&auml;nder&uuml;bergreifende Veranstaltung sei. Anschlie&szlig;end begr&uuml;&szlig;te auch der Pr&auml;sident des O&Ouml;-Badmintonverbandes Herbert Koch die anwesenden Teilnehmer und Rabel Andreas er&ouml;ffnete dieses erste Senioren Masters.Wie in der Ausschreibung schon erw&auml;hnt wurde das Alter der beiden Spieler zusammengez&auml;hlt und so kamen die einzelnen Klassen zustande.Klaus Mitterhauser unterst&uuml;tzte uns am PC.</p><p><br></p><p><strong>Sieger:<br>Herrendoppel:</strong><br>HD 70 : Markus Piribauer + Thanh Tran<br>HD 90: Wolfgang Dornig + Peter Krenmayr<br>HD 100: Joachim Berger + Walter Struger<br>HD 110: Peter Golazewski + Johannes Lenhart</p><p><strong>Damendoppel:</strong><br>DD 80: Karin Steinbichler + Susanne Swoboda<br>DD 100:Alexandra Pelz + Sylvia Weiss</p><p><strong>Mixdoppel:</strong><br>MD 70: Markus Piribauer + Karin Steinbichler<br>MD 100: Karl Pr&ouml;ll + Elisabeth Pr&ouml;ll<br>MX 110: Walter Struger + Hilde Kreulitsch</p><p><strong>MX 100 Super Finale: Pr&ouml;ll/Pr&ouml;ll - diese Paarung gewann den ersten fl&uuml;ssigen 0,33 Liter Pokal gesponsert von Eggenberger Bier</strong></p><p>Turnierende war gegen 16 Uhr mit Siegerehrung und gemeinsamen Foto.</p><p>Falls jemand Lust hat, sich Fotos vom Turnier mailen zu lassen, bitte kurzes Mail an:&nbsp;<a href=\"mailto:%20lind.p@aon.at\">lind.p@aon.at</a></p><p>Janos danken wir f&uuml;r seine gute Idee und den Teilnehmern f&uuml;r ihr faires Verhalten. Wir hoffen, dass dieses ins Leben gerufene Senioren Masters weiterhin bestehen bleibt und sich in Zukunft auch Veranstalter daf&uuml;r finden. Danke auch unseren zwei jungen Damen am Buffet, die ihre Aufgabe toll gemeistert haben.</p><p><a href=\"http://obv.tournamentsoftware.com/sport/tournament.aspx?id=02C0AF40-8F72-4A6E-9D73-90B74AB0489C\">Spiele auf der Tournamentsoftware</a><br>Bericht: Peter Lindner/UBC Neuhofen</p><p><br></p><h3>&Ouml;M Senioren 2010</h3><p>Bericht &uuml;ber die&nbsp;<strong>&Ouml;sterreichische Senioren Meisterschaft</strong></p><p>Judenburg, 27-28.November 2010-12-06</p><p><br></p><p>Aus Ober&ouml;sterreich sind folgende Spieler dort gewesen:</p><p>BSC 70 Linz: Ursula Edelm&uuml;ller Andreas B&ouml;hm<br>Sabine Salzer Janos Halasz<br>Harald Hochgatterer<br>Wolfgang Sternberger</p><p>Nettingsdorf: Josef Handlechner<br>Peter Krenmayr</p><p>Union Urfahr: Martin Grafinger<br>Gerhard Mayr</p><p>Vorchdorf: Waltraud Kronsteiner<br>Harald Starl</p><p>Die Ergebnisse:<br>Hochgatterer H.: 1. Platz HE 35+ 1. Platz HD 35+ 2. Platz MX 35+<br>B&ouml;hm A: 2. Platz HD 40+<br>Halasz J: 3. Platz HE 60+<br>Edelm&uuml;ller U: 2. Platz MX 35+</p><p>Handlechner J: 1. Platz HD 45+ 3/4. Platz HE 45+<br>Krenmayr P: 1. Platz HD 45+ 1. Platz HE 45+</p><p>Mayr G: 2. Platz HD 40+ 3/4. Platz HE 45+</p><p>Starl H: 1. Platz HD 35+ 2. Platz HE 45+ 1. Platz MX 45+<br>Kronsteiner W: 1. Platz DD 45+ 1. Platz DE 50+ 1. Platz MX 45+</p><p>Janos Halasz, Seniorenreferent des O&Ouml;BV</p>");
