64 2407556</p><p>&Uuml;bernachtung: Hotel Almtalerhof***, Leerwies 1, 4050 Traun, Tel. +43/7229/73301-0, <a href=\"mailto: almtalerhof@aon.at\">almtalerhof@aon.at</a> - <a href=\"https://www.almtalerhof.at/\">www.almtalerhof.at</a></p><p>Players Party: Samstag ca. 20:00 Uhr im Bundesschulzentrum mit Rahmenprogramm (Unkostenbeitrag &euro; 10,- f&uuml;r Speisen/Getr&auml;nke)</p><br><br><p>");
