INSERT INTO page_content VALUES("32","senioren","5","<p><h3>&Ouml;M Senioren 2010</h3>Bericht &uuml;ber die <b>&Ouml;sterreichische Senioren Meisterschaft</b><br>Judenburg, 27-28.November 2010-12-06</p><p>Aus Ober&ouml;sterreich sind folgende Spieler dort gewesen:</p><p>BSC 70 Linz: Ursula Edelm&uuml;ller Andreas B&ouml;hm<br>Sabine Salzer Janos Halasz<br>Harald Hochgatterer<br>Wolfgang Sternberger</p><p>Nettingsdorf: Josef Handlechner<br>Peter Krenmayr</p><p>Union Urfahr: Martin Grafinger<br>Gerhard Mayr</p><p>Vorchdorf: Waltraud Kronsteiner<br>Harald Starl</p><p>Die Ergebnisse:<br>Hochgatterer H.: 1. Platz HE 35+ 1. Platz HD 35+ 2. Platz MX 35+<br>B&ouml;hm A: 2. Platz HD 40+<br>Halasz J: 3. Platz HE 60+<br>Edelm&uuml;ller U: 2. Platz MX 35+</p><p>Handlechner J: 1. Platz HD 45+ 3/4. Platz HE 45+<br>Krenmayr P: 1. Platz HD 45+ 1. Platz HE 45+</p><p>Mayr G: 2. Platz HD 40+ 3/4. Platz HE 45+</p><p>Starl H: 1. Platz HD 35+ 2. Platz HE 45+ 1. Platz MX 45+<br>Kronsteiner W: 1. Platz DD 45+ 1. Platz DE 50+ 1. Platz MX 45+</p><p>Janos Halasz, Seniorenreferent des O&Ouml;BV</p>");
INSERT INTO page_content VALUES("33","schiedsrichter","1","<p><strong>Schiedsrichter an der &Ouml;sterreichische Staatsmeisterschaft, Linz 5-7.Feb.2010</strong></p><p>Vom &Ouml;BV: Klaus Schlieben (BWF), Ewald Cejnek (BE), Michael Steiner.</p><p>Aus Tschechien kommt: Jana Honnerova (BE)</p><p>Vom O&Ouml;BV: Karl Pr&ouml;ll, Andi Rabel, Klaus Mitterhauser, Steiner Reinhard, Andi B&ouml;hm, Reinhard Hechenberger, Michael Giel. Wahrscheinlich noch Hans Gr&uuml;n, als alt-neuer SR!</p><p><br></p><p><u>Freitag</u>: Schlieben, Cejnek, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)<br><u>Samstag</u>: Schlieben, Cejnek, Honnerova, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Rabel, Gr&uuml;n (?)<br><u>Sonntag</u>: Cejnek, Steiner, Honnerova, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)</p><p>Laut Verordnungen des &Ouml;BV werden alle Spiele geschiedst, Aufschlagsrichter und Linienrichter kommen ab Semifinale in Einsatz.<br>Kleidung f&uuml;r die Schiedsrichter: olivengr&uuml;nes Polo / Pullover, schwarze Hose, Schuhe, dunkle Socken.</p><p>Die Schiedsrichter Kollegen werden wahrscheinlich auch die Linienrichter Funktionen ab und zu &uuml;bernehmen - m&uuml;ssen.</p><p>Freitag kommt Michael Nemec vom &amp;oOuml;BV Schiedsrichterreferat, der die Arbeit der Schiedsrichter vom O&Ouml;BV unter die Lupe nimmt und wird uns sicher gute Ratschl&auml;ge geben. Nach dem Ende der Spiele am Freitag - voraussichtlich nach 22:00 - organisieren wir ein gemeinsames Treffen mit ihm, in seinem Hotel. ALLE Schiedsrichter sind gebeten daran teil zu nehmen. Samstag haben wir zw. ca. 12:20 - 13:00 eine Pause geplant. Michael m&ouml;chte, dass wir diese Pause gemeinsam verbringen.</p><p>Janos Halasz, Referee an den &Ouml;M</p><p><br></p><p><strong>Ausbildung von Linienrichtern (LR)</strong></p><p>Im Rahmen der Landesnachwuchsmeisterschaft (23-24.Januar 2010) werden Spieler (und Interessenten) zu Linienrichtern ausgebildet. Die Ausbildung wird vom internationalen Schiedsrichter des &Ouml;BV, Janos Halasz durchgef&uuml;hrt.</p><p>Die genaue Arbeit der Linienrichter wird erkl&auml;rt, die m&ouml;glichen Fehler, das Verhalten am Spielfeld,die Zusammenarbeit der LR mit dem Schiedsrichter, die Konflikte zwischen Spieler &lt;-&gt; LR.</p><p>Die ausgebildeten LR werden die M&ouml;glichkeit haben in den Semifinalen und Finalen der &Ouml;sterreichischen Staatsmeisterschaft (7.Februar 2010, in Solar City) eingesetzt zu werden.</p><p>Ort der Ausbildung: Bundesschulzentrum (BSZ), Traun</p><p><br></p><p><strong>Pages</strong>: 1&nbsp;<a href=\"http://localhost/schiedsrichter_page2\">2</a>&nbsp;</p>");
INSERT INTO page_content VALUES("34","schiedsrichter","2","<p><u>Freitag</u>:   Schlieben, Cejnek, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)<br><u>Samstag</u>: Schlieben, Cejnek, Honnerova, Steiner, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Rabel, Gr&uuml;n (?)<br><u>Sonntag</u>: Cejnek, Steiner, Honnerova, Pr&ouml;ll, Mitterhauser, Hechenberger, B&ouml;hm, Giel, Rabel, Gr&uuml;n (?)</p><p>Laut Verordnungen des &Ouml;BV werden alle Spiele geschiedst, Aufschlagsrichter und Linienrichter kommen ab Semifinale in Einsatz.<br>Kleidung f&uuml;r die Schiedsrichter: olivengr&uuml;nes Polo / Pullover, schwarze Hose, Schuhe, dunkle Socken.</p><p>Die Schiedsrichter Kollegen werden wahrscheinlich auch die Linienrichter Funktionen ab und zu &uuml;bernehmen - m&uuml;ssen.</p><p>Freitag kommt Michael Nemec vom &oOuml;BV Schiedsrichterreferat, der die Arbeit der Schiedsrichter vom O&Ouml;BV unter die Lupe nimmt und wird uns sicher gute Ratschl&auml;ge geben. Nach dem Ende der Spiele am Freitag - voraussichtlich nach 22:00 - organisieren wir ein gemeinsames Treffen mit ihm, in seinem Hotel. ALLE Schiedsrichter sind gebeten daran teil zu nehmen. Samstag haben wir zw. ca. 12:20 - 13:00 eine Pause geplant. Michael m&ouml;chte, dass wir diese Pause gemeinsam verbringen.</p><p>Janos Halasz, Referee an den &Ouml;M</p>");
INSERT INTO page_content VALUES("35","schiedsrichter","3","<p><b>Ausbildung von Linienrichtern (LR)</b></p><p>Im Rahmen der Landesnachwuchsmeisterschaft (23-24.Januar 2010) werden Spieler (und Interessenten) zu Linienrichtern ausgebildet. Die Ausbildung wird vom internationalen Schiedsrichter des &Ouml;BV, Janos Halasz durchgef&uuml;hrt.</p><p>Die genaue Arbeit der Linienrichter wird erkl&auml;rt, die m&ouml;glichen Fehler, das Verhalten am Spielfeld,die Zusammenarbeit der LR mit dem Schiedsrichter, die Konflikte zwischen Spieler <-> LR.</p><p>Die ausgebildeten LR werden die M&ouml;glichkeit haben in den Semifinalen und Finalen der &Ouml;sterreichischen Staatsmeisterschaft (7.Februar 2010, in Solar City) eingesetzt zu werden.</p><p>Ort der Ausbildung: Bundesschulzentrum (BSZ), Traun</p><p><b>Pages</b>: 1 <a href=\"schiedsrichter_page2\">2</a></p>");
INSERT INTO page_content VALUES("36","schiedsrichter_page2","1","<p><strong>Schiedsrichter f&uuml;r Jugend &Ouml;M (U17-U19) in Judenburg (12-14.Feb) dringend gesucht</strong></p><p>Liebe Sportkollegen,<br>der Zeit und Interesse h&auml;tte soll mich bei mir melden. Das Turnier ist sehr interessant, man kann spannende Spiele erwarten und die Spieler von morgen gleich beobachten.<br>Die Stimmung ist gut, die Halle vom Quartier nur 10 min. zu Fu&szlig; weit. Judenburg ist mit Zug / Auto gut erreichbar. Zahlung, Verpflegung - wie &uuml;blich.</p><p>Janos Halasz, Referee an der &Ouml;M U17-U19 (Mail: <a href=\"mailto:%20janos_halasz@hotmail.com\">janos_halasz@hotmail.com</a>)</p><p><br></p><p><strong>Neue Einstufung f&uuml;r die Schiedsrichter vom O&Ouml;BV</strong></p><p>im SR-Referat haben wir eine Struktur &uuml;berlegt und entsprechend der Erfahrung, K&ouml;nnen, usw. haben wir die Schiedsrichter in 4 Stufen (Gruppen) eingeteilt:</p><p><u>Kat. A</u>: der SR in dieser Gruppe darf Spiele der&nbsp;1. BL&nbsp;(<strong>auch Heimverein</strong>) schiedsen. Diese Kategorie entspricht den national gehobenen Aufgaben (ngA).<br><u>Kat. B</u>: der SR in dieser Gruppe darf Spiele der&nbsp;1. BL, wie auch der 2.BL (auch Heimverein) schiedsen.<br><u>Kat. C</u>: der SR in dieser Gruppe darf Spiele der 2.BL schiedsen.<br><u>Kat. D</u>: der SR in dieser Gruppe war zu lange inaktiv. Er/sie darf nur mit zus&auml;tzlicher/neuer Ausbildung reaktiviert, bzw. als SR eingesetzt werden.</p><p><u>Zus&auml;tzliche Anforderungen</u>:&nbsp;<strong>Fort- bzw. Weiterbildung ist Pflicht:</strong></p><p><br></p><ul><li>f&uuml;r Kategorie B mindestens alle 3 Jahre,</li><li>f&uuml;r Kategorie C alle 2 Jahre.</li><li>Kategorie D kann nur mehr mit Fort- bzw. Weiterbildung reaktiviert werden.</li></ul><p><br></p><p>F&uuml;r die h&ouml;chste Turnierkategorie &Ouml;M und Staatsmeisterschaften k&ouml;nnen nur Schiedsrichter in der Kategorie A und B eingesetzt werden.</p><p>Diese Liste wurde mit Wirkung am 21.September 2010 festgelegt und ist f&uuml;r die Saison 2010/2011 g&uuml;ltig. Die Kenntnisse, neue Erfahrungen und Engagement der Schiedsrichter wird am Saisonende vom SR Referat O&Ouml; neu bewertet und entsprechend k&ouml;nnen die SR in andere Kategorie (h&ouml;here oder niedrigere) eingestuft werden.</p><p>Die Schiedsrichter (in Klub Reihenfolge) in der&nbsp;<u>Kategorie A</u>: Pr&ouml;ll Karl&nbsp;<strong>ASK&Ouml; Badmintonverein Pasching</strong>, B&ouml;hm Andreas, Halasz Janos, Mitterhauser Klaus&nbsp;<strong>BSC 70 Linz</strong>, Rabel Andreas&nbsp;<strong>UBC Neuhofen</strong>.</p><p>Die Schiedsrichter in der&nbsp;<u>Kategorie B</u>: Gr&uuml;n Johann, Reifetshammer Rudolf&nbsp;<strong>ASK&Ouml; Traun</strong>, Freim&uuml;ller Fritz, Freim&uuml;ller Tina, Keplinger Hermann, Sch&ouml;ringhumer Christian, Skovlund S&ouml;ren, Stockinger Harald, Stoiber Ulrich&nbsp;<strong>BC Alkoven</strong>, Giel Michael Peter, Hechenberger Reinhard, Steiner Reinhard&nbsp;<strong>BSC 70 Linz</strong>, Baumgartner Florian, Horninger Gerald, Retschitzegger Lukas, Retschitzegger Josef, Schausberger Hermann&nbsp;<strong>Sportunion Ohlsdorf</strong>, Eckhardt Oliver, Forstinger Manfred, Starl Harald&nbsp;<strong>UBC Vorchdorf</strong>.</p><p>Die Schiedsrichter in der&nbsp;<u>Kategorie C</u>: L&ouml;sch Dieter, Reifetshammer Karola&nbsp;<strong>ASK&Ouml; Traun</strong>, Aumayr Philipp, Aumayr Valerie, Freim&uuml;ller Hilde&nbsp;<strong>BC Alkoven</strong>.</p><p>Die (der) Schiedsrichter in der&nbsp;<u>Kategorie D</u>: Hofreiter Wolfgang&nbsp;<strong>ATSV Steyr</strong>.</p><p>F&uuml;rs O&Ouml;BV Schiedsrichterreferat&nbsp;<br>Klaus Mitterhauser und Janos Halasz</p><p><br></p><p><strong>Pages</strong>:&nbsp;<a href=\"http://localhost/schriedsrichter\">1</a> 2</p>");
INSERT INTO page_content VALUES("37","schiedsrichter_page2","2","<p><b>Neue Einstufung f&uuml;r die Schiedsrichter vom O&Ouml;BV</b></p><p>im SR-Referat haben wir eine Struktur &uuml;berlegt und entsprechend der Erfahrung, K&ouml;nnen, usw. haben wir die Schiedsrichter in 4 Stufen (Gruppen) eingeteilt:</p><p><u>Kat. A</u>: der SR in dieser Gruppe darf Spiele der <span style=\"color: #FF0000\">1. BL</span> (<b>auch Heimverein</b>) schiedsen. Diese Kategorie entspricht den national gehobenen Aufgaben (ngA).<br><u>Kat. B</u>: der SR in dieser Gruppe darf Spiele der <span style=\"color: #FF0000\">1. BL</span>, wie auch der 2.BL (auch Heimverein) schiedsen.<br><u>Kat. C</u>: der SR in dieser Gruppe darf Spiele der 2.BL schiedsen.<br><u>Kat. D</u>: der SR in dieser Gruppe war zu lange inaktiv. Er/sie darf nur mit zus&auml;tzlicher/neuer Ausbildung reaktiviert, bzw. als SR eingesetzt werden.</p><p><u>Zus&auml;tzliche Anforderungen</u>: <b>Fort- bzw. Weiterbildung ist Pflicht:</b></p>");
INSERT INTO page_content VALUES("38","schiedsrichter_page2","3","<ul><li>f&uuml;r Kategorie B mindestens alle 3 Jahre,</li><li>f&uuml;r Kategorie C alle 2 Jahre.</li><li>Kategorie D kann nur mehr mit Fort- bzw. Weiterbildung reaktiviert werden.</li></ul>");
INSERT INTO page_content VALUES("39","schiedsrichter_page2","4","<p>F&uuml;r die h&ouml;chste Turnierkategorie &Ouml;M und Staatsmeisterschaften k&ouml;nnen nur Schiedsrichter in der Kategorie A und B eingesetzt werden.</p><p>Diese Liste wurde mit Wirkung am 21.September 2010 festgelegt und ist f&uuml;r die Saison 2010/2011 g&uuml;ltig. Die Kenntnisse, neue Erfahrungen und Engagement der Schiedsrichter wird am Saisonende vom SR Referat O&Ouml; neu bewertet und entsprechend k&ouml;nnen die SR in andere Kategorie (h&ouml;here oder niedrigere) eingestuft werden.</p><p>Die Schiedsrichter (in Klub Reihenfolge) in der <u>Kategorie A</u>: Pr&ouml;ll Karl <b>ASK&Ouml; Badmintonverein Pasching</b>, B&ouml;hm Andreas, Halasz Janos, Mitterhauser Klaus <b>BSC 70 Linz</b>, Rabel Andreas <b>UBC Neuhofen</b>.</p><p>Die Schiedsrichter in der <u>Kategorie B</u>: Gr&uuml;n Johann, Reifetshammer Rudolf <b>ASK&Ouml; Traun</b>, Freim&uuml;ller Fritz, Freim&uuml;ller Tina, Keplinger Hermann, Sch&ouml;ringhumer Christian, Skovlund S&ouml;ren, Stockinger Harald, Stoiber Ulrich <b>BC Alkoven</b>, Giel Michael Peter, Hechenberger Reinhard, Steiner Reinhard <b>BSC 70 Linz</b>, Baumgartner Florian, Horninger Gerald, Retschitzegger Lukas, Retschitzegger Josef, Schausberger Hermann <b>Sportunion Ohlsdorf</b>, Eckhardt Oliver, Forstinger Manfred, Starl Harald <b>UBC Vorchdorf</b>.</p><p>Die Schiedsrichter in der <u>Kategorie C</u>: L&ouml;sch Dieter, Reifetshammer Karola <b>ASK&Ouml; Traun</b>, Aumayr Philipp, Aumayr Valerie, Freim&uuml;ller Hilde <b>BC Alkoven</b>.</p><p>Die (der) Schiedsrichter in der <u>Kategorie D</u>: Hofreiter Wolfgang <b>ATSV Steyr</b>.</p><br><p>F&uuml;rs O&Ouml;BV Schiedsrichterreferat <br>Klaus Mitterhauser und Janos Halasz</p>");
