INSERT INTO page_content VALUES("53","impressum","1","<p>Impressum gem&auml;&szlig; &sect; 24 MedienGesetz, Offenlegung gem. &sect; 25 MedienGesetz sowie Anbieteridentifizierung gem&auml;&szlig; &sect; 5 Abs. 1 E-Commerce-Gesetz</p><p><br></p><h4>O&Ouml;. Badmintonverband</h4><p><br></p><p><strong>Pr&auml;sident</strong><br>Herbert Koch<br>Theodor-K&ouml;rnerstra&szlig;e 5/4<br>A-4050 Traun, &ouml;sterreich<br>Mobiltelefon: +43 (664) 2407556<br>Email:&nbsp;<a href=\"mailto:herbert.koch@gmx.at\">herbert.koch@gmx.at</a><br>Internet: www.badminton-ooe.at</p><p><strong>Verbandssekretariat</strong><br>Karin Burger&nbsp;<br>Voltastrasse 7&nbsp;<br>A-4040 Linz&nbsp;<br>Mobiltelefon: +43 (681) 10621408&nbsp;<br>E-Mail:&nbsp;<a href=\"mailto:ooe-badmintonverband@aon.at\">ooe-badmintonverband@aon.at</a></p><p>ZVR-Zahl: 362288350<br>Bankverbindung: Raiffeisenbank Leonding<br>IBAN: AT98 3427 6000 0003 0007</p><p><strong>Verbandsgegenstand</strong><br>Der Verband, dessen T&auml;tigkeit nicht auf Gewinn gerichtet ist, bezweckt die F&ouml;rderung des K&ouml;rpersports.</p><p>Mitglied des &ouml;sterreichischen Badmintonverbandes</p><p><strong>Medieninhaber</strong><br>O&Ouml;. Badmintonverband, Theodor-K&ouml;rnerstra&szlig;e 5/4<br>A-4050 Traun</p><p><strong>Rechtliche Hinweise</strong><br><em>1. Inhalt des Onlineangebotes</em><br>Der Autor &uuml;bernimmt keinerlei Gew&auml;hr f&uuml;r die Aktualit&auml;t, Korrektheit, Vollst&auml;ndigkeit oder Qualit&auml;t der bereitgestellten Informationen. Haftungsanspr&uuml;che gegen den Autor, welche sich auf Sch&auml;den materieller oder ideeller Art beziehen, die durch die Nutzung oder Nichtnutzung der dargebotenen Informationen bzw. durch die Nutzung fehlerhafter und unvollst&auml;ndiger Informationen verursacht wurden, sind grunds&auml;tzlich ausgeschlossen, sofern seitens des Autors kein nachweislich vors&auml;tzliches oder grob fahrl&auml;ssiges Verschulden vorliegt. Alle Angebote sind freibleibend und unverbindlich. Der Autor beh&auml