n, Tondokumente, Videosequenzen und Texte zu beachten, von ihm selbst erstellte Grafiken, Tondokumente, Videosequenzen und Texte zu nutzen oder auf lizenzfreie Grafiken, Tondokumente, Videosequenzen und Texte zur&uuml;ckzugreifen. Alle innerhalb des Internetangebotes genannten und ggf. durch Dritte gesch&uuml;tzten Marken- und Warenzeichen unterliegen uneingeschr&auml;nkt den Bestimmungen des jeweils g&uuml;ltigen Kennzeichenrechts und den Besitzrechten der jeweiligen eingetragenen Eigent&uuml;mer. Allein aufgrund der blo&szlig;en Nennung ist nicht der Schluss zu ziehen, dass Markenzeichen nicht durch Rechte Dritter gesch&uuml;tzt sind! Das Copyright f&uuml;r ver&ouml;ffentlichte, vom Autor selbst erstellte Objekte bleibt allein beim Autor der Seiten. Eine Vervielf&auml;ltigung oder Verwendung solcher Grafiken, Tondokumente, Videosequenzen und Texte in anderen elektronischen oder gedruckten Publikationen ist ohne ausdr&uuml;ckliche Zustimmung des Autors nicht gestattet.<br><em>4. Datenschutz</em><br>Sofern innerhalb des Internetangebotes die M&ouml;glichkeit zur Eingabe pers&ouml;nlicher oder gesch&auml;ftlicher Daten (Emailadressen, Namen, Anschriften) besteht, so erfolgt die Preisgabe dieser Daten seitens des Nutzers auf ausdr&uuml;cklich freiwilliger Basis. Die Inanspruchnahme und Bezahlung aller angebotenen Dienste ist &ndash; soweit technisch m&ouml;glich und zumutbar &ndash; auch ohne Angabe solcher Daten bzw. unter Angabe anonymisierter Daten oder eines Pseudonyms gestattet. Die Nutzung der im Rahmen des Impressums oder vergleichbarer Angaben ver&ouml;ffentlichten Kontaktdaten wie Postanschriften, Telefon- und Faxnummern sowie Emailadressen durch Dritte zur &uuml;bersendung von nicht ausdr&uuml;cklich angeforderten Informationen ist nicht gestattet. Rechtliche Schritte gegen die Versender von sogenannten Spam-Mails bei Verst&ouml;ssen gegen dieses Verbot sind ausdr&uuml;cklich vorbehalten.<br><em>5. Rechtswirksamkeit dieses Haftungsausschlusses</em>&nbsp;<br>Dieser Haftungsausschluss ist als Teil des Internetangebotes zu betrachten, von dem aus auf diese Seite verwiesen wurde. Sofern Teile oder einzelne Formulierungen dieses Textes der geltenden Rechtslage nicht, nicht mehr oder nicht vollst&auml;ndig entsprechen sollten, bleiben die &uuml;brigen Teile des Dokumentes in ihrem Inhalt und ihrer G&uuml;ltigkeit davon unber&uuml;hrt.</p><p><strong>Redaktion</strong><br>Webmaster: Klaus Mitterhauser &ndash;&nbsp;<a href=\"mailto:klaus.mitterhauser@liwest.at\">klaus.mitterhauser@liwest.at</a><br>Contentmaster: Simon und Lukas Rebhandl &ndash;&nbsp;<a href=\"mailto:berichte-ooebv@gmx.at\">berichte-ooebv@gmx.at</a> und Karin Burger &ndash;&nbsp;<a href=\"mailto:ooe-badmintonverband@aon.at\">ooe-badmintonverband@aon.at</a></p>");
INSERT INTO page_content VALUES("54","vorstand?editBox","1","<p>Am 22.05.2018 wurde bei der Mitgliederversammlung im Olympiast&uuml;tzpunkt/Linz der neue Vorstand f&uuml;r die Funktionsperiode 2018-2021 gew&auml;hlt. Im Vorstand werden wichtige Entscheidungen stets gemeinsam getroffen. Die h&ouml;chste Instanz ist Pr&auml;sident Herbert Koch. </p>");
INSERT INTO page_content VALUES("55","trainingszeiten","1","<p><span style=\"color: rgb(226, 80, 65);\">Montag</span></p><table cellpadding=\"10\" cellspacing=\"0\"><tbody><tr><td>BORG-Basis-Training</td><td>15:30-17:30 Uhr</td><td>Olympiazentrum Linz</td></tr></tbody></table><p><span style=\"color: rgb(226, 80, 65);\">Dienstag</span></p><table cellpadding=\"10\" cellspacing=\"0\"><tbody><tr><td>BORG-Training</td><td>07:45-09:15 Uhr</td><td>Olympiazentrum Linz Halle 3</td></tr><tr><td>BORG + BTZ Training</td><td>17:00-19:00 Uhr</td><td>Olympiazentrum Linz Halle 2</td></tr></tbody></table><p><span style=\"color: rgb(226, 80, 65);\">Mittwoch</span></p><table cellpadding=\"10\" cellspacing=\"0\"><tbody><tr><td>BORG-Athletik</td><td>07:45-09:15 Uhr</td><td>Olympiazentrum Linz Halle 2</td></tr><tr><td>BORG + BTZ + Allg. Kl.Training</td><td>18:30-20:30 Uhr</td><td>Olympiazentrum Linz Halle 3</td></tr></tbody></table><p><span style=\"color: rgb(226, 80, 65);\">Donnerstag</span></p><table cellpadding=\"10\" cellspacing=\"0\"><tbody><tr><td>BORG-Training</td><td>08:00-10:00 Uhr</td><td>Olympiazentrum Linz Halle 2</td></tr><tr><td>BORG + BTZ Training</td><td>15:30-17:30 Uhr</td><td>Olympiazentrum Linz</td></tr></tbody></table><p>Der Trainingsbetrieb am BNLZ-Nord ist grunds&auml;tzlich f&uuml;r O&Ouml;BV-Spieler offen. Trainingsteilnahmen bitte mit Landestrainer Peter Zauner&nbsp;<br>(Handy 0676-841234861) absprechen.</p>");
